INSERT INTO {prefix}Event (eid, name, eventDateType, eventDate1, eventDatePrecision, eventDateDiff, eventDateDiffType, postedDate, description, postedUid)VALUES
(1, 'Epic Castle Siege', 'c', TIMESTAMP('2021-07-07', '14:12:20'), 'd', 39, 'm', TIMESTAMP('2021-12-31', '14:12:20'), 'The day when two of the servers largest factions engaged in an epic battle to seize control of the mighty Castle Blackstone. With armies clashing, trebuchets launching flaming projectiles, and cunning strategies at play, it was a day of fierce combat and tactical brilliance that left a lasting mark on the servers history.', 36),
(3, 'Treasure Hunt Extravaganza', 'c', TIMESTAMP('2023-07-22', '14:12:20'), 'm', 2, 'm', TIMESTAMP('2021-08-29', '14:12:20'), 'The day when a hidden treasure map was discovered, leading players on a server-wide scavenger hunt. Explorers embarked on a journey filled with riddles, puzzles, and challenges that spanned various biomes, revealing the servers rich lore and rewarding players with valuable in-game loot.', 82),
(4, 'Inaugural Build Contest', 'c', TIMESTAMP('2023-09-07', '14:12:20'), 'h', 84, 'm', TIMESTAMP('2022-06-15', '14:12:20'), 'A community-wide build competition that brought out the servers creative spirit. Players were tasked with constructing awe-inspiring structures, from colossal castles to intricate redstone contraptions. The contest fostered a sense of unity, showcasing the servers artistic talents and diverse architectural styles.', 7),
(7, 'Dungeon of the Ancients', 'c', TIMESTAMP('2022-01-18', '14:12:20'), 'd', 0, 'h', TIMESTAMP('2021-03-13', '14:12:20'), 'The unveiling of a mysterious, long-forgotten dungeon buried beneath the servers surface. Players embarked on a perilous journey filled with traps, puzzles, and ancient guardians to uncover the secrets of the dungeon. The discovery of hidden lore and legendary artifacts made it an unforgettable adventure.', 25),
(9, 'Pixel Art Gallery Grand Opening', 'c', TIMESTAMP('2021-05-26', '14:12:20'), 'm', 86, 'd', TIMESTAMP('2021-06-02', '14:12:20'), 'The launch of a dedicated gallery to showcase the incredible pixel art creations of the servers talented players. From pixelated renditions of famous characters to stunning landscapes, the gallery became a testament to the creativity and skill of the servers artistic community.', 56),
(14, 'Mystic Relics Unearthed', 'c', TIMESTAMP('2023-03-28', '14:12:20'), 'd', 22, 'h', TIMESTAMP('2023-03-03', '14:12:20'), 'The discovery of hidden, powerful relics buried deep underground. Players embarked on a treasure-hunting quest, uncovering these ancient artifacts with unique abilities, adding a new layer of strategy to gameplay.', 63),
(15, 'Giant Build-Off', 'c', TIMESTAMP('2022-08-16', '14:12:20'), 'h', 29, 'm', TIMESTAMP('2023-04-10', '14:12:20'), 'A colossal building competition where players formed teams to create massive, interconnected structures. The competition transformed the landscape with breathtaking architectural marvels, fostering teamwork and architectural innovation.', 70),
(18, 'Mob Apocalypse Challenge', 'c', TIMESTAMP('2023-05-10', '14:12:20'), 'm', 47, 'h', TIMESTAMP('2021-12-18', '14:12:20'), 'A server-wide event where waves of increasingly challenging mobs invaded the world. Players had to band together to defend their homes and cities, requiring strategic cooperation to survive the onslaught.', 46),
(20, 'Diplomatic Summit', 'c', TIMESTAMP('2022-07-27', '14:12:20'), 'd', 99, 'h', TIMESTAMP('2021-12-28', '14:12:20'), 'A gathering of faction leaders to negotiate treaties, trade agreements, and alliances. The summit facilitated diplomacy, peace talks, and the resolution of server-wide conflicts through dialogue rather than warfare.', 37),
(21, 'Realm of Magic Expansion', 'c', TIMESTAMP('2021-02-20', '14:12:20'), 'h', 74, 'h', TIMESTAMP('2022-05-01', '14:12:20'), 'An enchanting update introducing a realm of magic, with enchanted forests, mystical creatures, and spells. Players could become wizards, mastering arcane arts and harnessing the power of magic.', 40),
(23, 'Pirates Cove Discovery', 'c', TIMESTAMP('2021-08-04', '14:12:20'), 'm', 60, 'm', TIMESTAMP('2021-11-02', '14:12:20'), 'The unearthing of a hidden pirates cove, complete with buried treasure, cursed artifacts, and swashbuckling adventures on the high seas. It added a thrilling nautical dimension to server exploration.', 15),
(24, 'Olympic Games Extravaganza', 'c', TIMESTAMP('2021-12-16', '14:12:20'), 'd', 29, 'h', TIMESTAMP('2021-08-01', '14:12:20'), 'A sporting event featuring a wide range of competitions, from archery and horse racing to parkour and swimming races. The Olympic Games united the server in friendly competition and athleticism.', 9),
(25, 'World-Ending Cataclysm', 'c', TIMESTAMP('2021-10-02', '14:12:20'), 'm', 32, 'h', TIMESTAMP('2021-07-03', '14:12:20'), 'A lore-driven event where a cataclysmic event threatened the servers existence. Players had to collaborate to prevent the disaster and protect their world, resulting in an unforgettable storyline.', 66),
(26, 'Quest for the Elders Wisdom', 'c', TIMESTAMP('2022-04-16', '14:12:20'), 'd', 72, 'd', TIMESTAMP('2021-12-02', '14:12:20'), 'A server-wide quest involving puzzles, riddles, and mysteries to uncover the ancient wisdom of a wise council of elders. Completing the quest provided players with valuable knowledge and rewards.', 75),
(28, 'Realm of Dreams Expansion', 'c', TIMESTAMP('2021-03-05', '14:12:20'), 'd', 7, 'd', TIMESTAMP('2023-05-23', '14:12:20'), 'The introduction of a dream world accessible through special portals, offering players a surreal, whimsical experience filled with imaginative landscapes, dream creatures, and unique challenges.', 86),
(31, 'Mega-Dungeon Exploration', 'c', TIMESTAMP('2021-07-23', '14:12:20'), 'h', 62, 'm', TIMESTAMP('2023-01-15', '14:12:20'), 'The unveiling of an enormous, multi-leveled dungeon teeming with traps, puzzles, and formidable bosses. It was a test of courage, teamwork, and strategy for players daring enough to venture into its depths.', 45),
(35, 'Minecraft Film Festival', 'c', TIMESTAMP('2023-09-28', '14:12:20'), 'm', 88, 'm', TIMESTAMP('2023-03-25', '14:12:20'), 'A community-driven film festival where players showcased their cinematic talents by creating in-game movies and animations, resulting in a creative outpouring of storytelling.', 21),
(42, 'Server-Wide Art Gallery', 'c', TIMESTAMP('2021-11-23', '14:12:20'), 'h', 86, 'd', TIMESTAMP('2023-05-29', '14:12:20'), 'The creation of an art gallery displaying players exquisite artwork, sculptures, and pixel art, celebrating the diverse artistic talents within the server community.', 21),
(44, 'Treasure Galleon Expedition', 'c', TIMESTAMP('2022-01-17', '14:12:20'), 'm', 87, 'm', TIMESTAMP('2023-05-26', '14:12:20'), 'A high-seas adventure where players embarked on epic quests to discover sunken treasure galleons, battling sea monsters and rival crews for the most coveted treasures of the deep.', 23),
(46, 'Server-Wide Census', 'c', TIMESTAMP('2022-10-08', '14:12:20'), 'm', 10, 'd', TIMESTAMP('2022-04-06', '14:12:20'), 'An initiative to document the servers population, gathering data on players interests, activities, and in-game achievements, providing insights into the servers demographics.', 87),
(47, 'Alliance of the Elements', 'c', TIMESTAMP('2022-08-06', '14:12:20'), 'h', 21, 'd', TIMESTAMP('2021-12-04', '14:12:20'), 'A union of elemental factions to restore balance to the servers world, with each faction representing an element such as fire, water, earth, and air, contributing unique powers and abilities.', 15),
(48, 'Giant Pumpkin Festival', 'c', TIMESTAMP('2021-12-11', '14:12:20'), 'm', 30, 'd', TIMESTAMP('2022-09-17', '14:12:20'), 'An annual pumpkin festival where players participated in pumpkin growing contests, pumpkin carving competitions, and enjoyed a festive atmosphere with pumpkin-themed decorations.', 21),
(52, 'Server-wide Art Installation Project', 'c', TIMESTAMP('2022-12-31', '14:12:20'), 'd', 19, 'm', TIMESTAMP('2022-03-24', '14:12:20'), 'An ambitious project where players joined forces to create a massive server-wide art installation. This collaborative masterpiece incorporated various building styles, materials, and themes, showcasing the servers creative spirit and dedication to artistry. The art installation served as a testament to the servers commitment to fostering artistic expression.', 69),
(57, 'Cursed Artifacts Unearthed', 'c', TIMESTAMP('2023-05-20', '14:12:20'), 'h', 55, 'h', TIMESTAMP('2023-09-06', '14:12:20'), 'The discovery of a trove of cursed artifacts with potent, unpredictable effects. Players could choose to harness the artifacts powers, but doing so carried risks. These enigmatic items added intrigue and unpredictability to the servers gameplay, challenging players to wield their magic responsibly.', 22),
(58, 'War of the Realms', 'c', TIMESTAMP('2022-03-09', '14:12:20'), 'm', 96, 'h', TIMESTAMP('2021-03-09', '14:12:20'), 'A server-wide, faction-based event that pitted different realms against each other in a battle for supremacy. Each realm had its distinct strengths, weaknesses, and culture, resulting in a dynamic and strategic war that tested players unity and alliances.', 9),
(59, 'Nether Expansion: Infernal Reckoning', 'c', TIMESTAMP('2023-05-14', '14:12:20'), 'h', 14, 'h', TIMESTAMP('2023-08-05', '14:12:20'), 'An extensive update to the Nether, with new biomes, structures, and fierce Nether mobs. The Infernal Reckoning expansion transformed the Nether into a rich and challenging environment, encouraging players to explore and conquer its fiery landscapes.', 24),
(62, 'War of the Factions: Elemental Clash', 'c', TIMESTAMP('2023-02-13', '14:12:20'), 'h', 63, 'm', TIMESTAMP('2021-05-13', '14:12:20'), 'A grand faction-based tournament that revolved around the mastery of elemental magic. Factions specialized in fire, water, earth, and air abilities, engaging in elemental battles that tested their magical prowess, strategy, and coordination.', 32),
(63, 'Astronomical Observatory Build-Off', 'c', TIMESTAMP('2021-05-20', '14:12:20'), 'm', 72, 'h', TIMESTAMP('2021-07-31', '14:12:20'), 'A competition that celebrated the servers celestial wonders by challenging players to construct observatories and stargazing platforms. The event encouraged architectural innovation, and the resulting observatories became centers for astronomical discovery.', 53),
(64, 'Underground Utopia Rediscovered', 'c', TIMESTAMP('2022-10-03', '14:12:20'), 'm', 18, 'h', TIMESTAMP('2023-03-30', '14:12:20'), 'The unearthing of an ancient underground utopia, a hidden world beneath the surface. Players embarked on a journey to explore this subterranean realm, which was once a thriving civilization with advanced technology, presenting a fascinating archaeological expedition.', 73),
(65, 'Lost Worlds Multiverse', 'c', TIMESTAMP('2022-06-08', '14:12:20'), 'm', 17, 'd', TIMESTAMP('2021-09-03', '14:12:20'), 'The introduction of a multiverse, where players could traverse different worlds, each with its unique theme, challenges, and rules. The Lost Worlds Multiverse expanded the servers horizons, encouraging exploration and diversifying gameplay experiences.', 83),
(66, 'Pixel Art Festival Spectacular', 'c', TIMESTAMP('2023-07-23', '14:12:20'), 'h', 40, 'm', TIMESTAMP('2022-12-02', '14:12:20'), 'A grand festival celebrating the artistry of players who specialized in pixel art. The event featured pixel art competitions, showcases, and interactive exhibits, shining a spotlight on the creativity and talent of the servers artists.', 3),
(69, 'Chronicles of the Server', 'c', TIMESTAMP('2022-10-30', '14:12:20'), 'd', 78, 'd', TIMESTAMP('2021-12-12', '14:12:20'), 'The publication of a comprehensive in-game history book, documenting the servers past, present, and the stories of its players. Chronicles of the Server served as a lasting record of the servers growth and player contributions.', 52),
(71, 'Parallel Dimensions: Mirror Realms', 'c', TIMESTAMP('2021-07-08', '14:12:20'), 'm', 51, 'm', TIMESTAMP('2021-09-17', '14:12:20'), 'An update introducing parallel dimensions accessible through mystical portals. Mirror Realms were alternate versions of the servers world, offering unique challenges, terrain, and resources. Players ventured into these dimensions, uncovering hidden mysteries and forging connections between the realms.', 20),
(75, 'Epic Wither Boss Siege', 'c', TIMESTAMP('2022-11-15', '14:12:20'), 'm', 53, 'h', TIMESTAMP('2021-02-25', '14:12:20'), 'A server-wide event where players united to confront a colossal wither boss that threatened to wreak havoc. This epic siege demanded cooperation, strategy, and resourcefulness to vanquish the menacing creature, resulting in grand battles and heroic achievements.', 56),
(76, 'Server-Wide Explorers Society', 'c', TIMESTAMP('2021-11-06', '14:12:20'), 'h', 3, 'm', TIMESTAMP('2023-01-23', '14:12:20'), 'The founding of an Explorers Society dedicated to mapping uncharted territories and uncovering hidden secrets within the servers world. Society members embarked on expeditions, shared their findings, and contributed to the servers collective knowledge.', 17),
(79, 'Enchanted Fairy Grove', 'c', TIMESTAMP('2022-07-17', '14:12:20'), 'd', 47, 'm', TIMESTAMP('2023-06-25', '14:12:20'), 'The discovery of an enchanted, secret fairy grove within the servers forests. Players could interact with mystical fairies, gain fairy abilities, and participate in quests that celebrated the magic and enchantment of the grove.', 25),
(80, 'Epic Puzzle-Master Challenge', 'c', TIMESTAMP('2023-07-22', '14:12:20'), 'd', 40, 'd', TIMESTAMP('2023-05-03', '14:12:20'), 'A puzzle-solving competition where players tackled intricate, mind-bending puzzles and riddles. The challenge tested players wits, problem-solving skills, and patience, rewarding them with rare treasures and recognition as puzzle masters.', 83),
(82, 'The Tournament of Champions', 'c', TIMESTAMP('2023-08-04', '14:12:20'), 'h', 89, 'm', TIMESTAMP('2021-05-15', '14:12:20'), 'A grand tournament that brought together the most skilled players from various disciplines, including PvP combat, parkour, and redstone engineering. The Tournament of Champions featured intense battles, thrilling races, and intricate contraption challenges, with the winners earning the coveted title of "Server Champion."', 81),
(83, 'Evolving Enchantments Update', 'c', TIMESTAMP('2022-02-23', '14:12:20'), 'm', 98, 'm', TIMESTAMP('2023-10-29', '14:12:20'), 'An enchantment system overhaul that introduced evolving enchantments. Players could invest time and resources to unlock hidden potential within their enchanted items, creating a dynamic and personalized gear progression system that encouraged experimentation and specialization.', 78),
(84, 'Legends of the Deep: Krakens Wrath', 'c', TIMESTAMP('2022-12-24', '14:12:20'), 'h', 74, 'd', TIMESTAMP('2023-09-14', '14:12:20'), 'The emergence of the legendary Kraken, an enormous sea monster that terrorized the servers oceans. Players had to form crews and sail into dangerous waters, battling the colossal beast in epic naval battles. The Legends of the Deep: Krakens Wrath event epitomized maritime exploration and teamwork.', 13),
(87, 'Ancient Hieroglyph Quest', 'c', TIMESTAMP('2023-01-21', '14:12:20'), 'm', 56, 'm', TIMESTAMP('2021-03-05', '14:12:20'), 'A complex puzzle-solving quest that revolved around deciphering ancient hieroglyphs scattered across the servers deserts. Players collaborated to unlock the secrets of these enigmatic symbols, leading to the discovery of hidden temples and treasures.', 31),
(90, 'The Solar Eclipse', 'c', TIMESTAMP('2023-06-06', '14:12:20'), 'm', 1, 'd', TIMESTAMP('2023-04-20', '14:12:20'), 'A rare celestial event where a total solar eclipse occurred, temporarily transforming the servers day into night. During the Solar Eclipse, players had unique opportunities to embark on adventures in the darkened world, encountering new challenges, creatures, and celestial phenomena.', 83),
(91, 'Server-Wide World Fair', 'c', TIMESTAMP('2023-07-05', '14:12:20'), 'd', 60, 'd', TIMESTAMP('2023-07-14', '14:12:20'), 'The hosting of a World Fair, where players and factions showcased their unique builds, inventions, and creations. The fair highlighted the servers diverse and talented community, celebrating their architectural, redstone, and artistic achievements.', 38),
(95, 'Quantum City Construction', 'c', TIMESTAMP('2023-03-31', '14:12:20'), 'h', 46, 'm', TIMESTAMP('2021-03-29', '14:12:20'), 'A groundbreaking project where players collaborated to build a futuristic Quantum City, complete with advanced technology, skybridges, and immersive environments. The city represented a vision of the future, highlighting the servers dedication to innovation and architectural grandeur.', 42),
(97, 'The Time Crystal Catastrophe', 'c', TIMESTAMP('2022-09-05', '14:12:20'), 'd', 27, 'h', TIMESTAMP('2023-04-04', '14:12:20'), 'A server-wide event involving a catastrophic breach of time crystals that caused temporal anomalies and disruptions. Players embarked on time-traveling adventures to fix the rifts in time, undoing the chaos and unraveling an intricate temporal storyline.', 90),
(100, 'Era of Titans Ascendant', 'c', TIMESTAMP('2022-04-08', '14:12:20'), 'm', 91, 'm', TIMESTAMP('2022-02-25', '14:12:20'), 'The awakening of ancient, god-like titans that reshaped the servers world with their monumental presence. Players had to forge alliances, master their skills, and face off against these titans in epic battles that shaped the servers lore and future.', 60),
(101, 'The Cosmic Labyrinth', 'c', TIMESTAMP('2022-04-20', '14:12:20'), 'm', 9, 'h', TIMESTAMP('2022-12-05', '14:12:20'), 'The unveiling of the Cosmic Labyrinth, an intricate, otherworldly maze filled with puzzles, traps, and mysteries. Players embarked on an enigmatic journey within this labyrinth, discovering hidden realms, unlocking secrets, and uncovering the labyrinths place in the servers history.', 3),
(105, 'Era of Elemental Ascendancy', 'c', TIMESTAMP('2022-09-17', '14:12:20'), 'm', 31, 'm', TIMESTAMP('2023-07-22', '14:12:20'), 'A period where players aligned with elemental factions to achieve elemental ascendancy and unlock unique powers. This era of elemental dominance introduced elemental battles, challenges, and allegiances that shaped the servers political landscape.', 50),
(106, 'Legends of the Eternal Phoenix', 'c', TIMESTAMP('2022-06-04', '14:12:20'), 'd', 9, 'h', TIMESTAMP('2023-09-29', '14:12:20'), 'The emergence of the Eternal Phoenix, a mythical creature that symbolized rebirth and renewal. Players embarked on quests to discover the secrets of the Phoenix, gaining powerful abilities and unraveling its role in the servers lore.', 80),
(110, 'Nether Fortress Siege', 'c', TIMESTAMP('2022-09-08', '14:12:20'), 'h', 61, 'm', TIMESTAMP('2022-07-02', '14:12:20'), 'The Nether Fortress Siege was an epic event where players stormed the Nethers treacherous fortresses to face hordes of deadly creatures. With well-coordinated tactics, players overcame challenges and collected valuable resources like blaze rods and Netherwart. This event showcased the servers commitment to challenges beyond the Overworld.', 1),
(113, 'Elytra Grand Prix', 'c', TIMESTAMP('2021-09-26', '14:12:20'), 'm', 31, 'h', TIMESTAMP('2022-01-11', '14:12:20'), 'The Elytra Grand Prix was a high-speed racing event where participants donned their Elytra wings for an adrenaline-fueled race across the servers vast landscapes. Racers weaved through challenging aerial courses, showcasing their flight skills and pushing the boundaries of Minecrafts physics.', 35),
(115, 'Underground Cave Expedition', 'c', TIMESTAMP('2022-12-14', '14:12:20'), 'm', 92, 'h', TIMESTAMP('2023-03-12', '14:12:20'), 'Players donned their spelunking gear to explore the servers extensive network of underground caves. These dark and mysterious caverns held valuable resources and were home to exotic creatures, making the expedition an exciting and perilous adventure that tested the bravery of those who participated.', 10),
(119, 'Minecraft Olympics Spectacle', 'c', TIMESTAMP('2023-08-14', '14:12:20'), 'd', 78, 'd', TIMESTAMP('2022-02-05', '14:12:20'), 'A massive server-wide Olympics event that celebrated various sports and competitions, from archery and swimming to parkour and equestrian events. Athletes from across the server competed in the spirit of friendly rivalry, embodying the Olympic values of unity, friendship, and excellence.', 73),
(120, 'Emerald Isles Discovery', 'c', TIMESTAMP('2021-10-30', '14:12:20'), 'h', 2, 'd', TIMESTAMP('2021-04-18', '14:12:20'), 'The revelation of the Emerald Isles, a lush archipelago where players could embark on quests, uncover ancient lore, and gather rare resources. This tropical paradise encouraged exploration, island hopping, and pirate-themed adventures.', 65),
(121, 'Era of Draconic Domination', 'c', TIMESTAMP('2022-08-21', '14:12:20'), 'm', 63, 'm', TIMESTAMP('2021-06-26', '14:12:20'), 'The emergence of powerful dragons as the dominant forces in the servers world. Factions sought to forge alliances with these mighty creatures, engage in aerial dragon battles, and establish dragon-themed settlements, reshaping the servers political landscape.', 74),
(122, 'The Enchanted Menagerie', 'c', TIMESTAMP('2023-08-31', '14:12:20'), 'm', 17, 'd', TIMESTAMP('2023-01-09', '14:12:20'), 'The creation of an enchanting menagerie filled with magical creatures, mythical beasts, and wondrous fauna. Players explored the menageries habitats, participated in quests, and learned about the servers mystical fauna while experiencing enchanting encounters.', 52),
(124, 'Mythical Beasts Ascendancy', 'c', TIMESTAMP('2021-04-03', '14:12:20'), 'h', 30, 'h', TIMESTAMP('2022-06-19', '14:12:20'), 'The resurgence of mythical creatures and beasts that took the servers world by storm. Players embarked on quests to uncover the secrets and origins of these creatures, forming bonds and forging alliances with them for epic adventures.', 38),
(125, 'Astral Projection Questline', 'c', TIMESTAMP('2021-04-23', '14:12:20'), 'm', 46, 'd', TIMESTAMP('2022-07-08', '14:12:20'), 'A mystical questline where players learned the ancient art of astral projection, allowing them to explore astral realms, interact with ethereal beings, and uncover astral mysteries that connected the spiritual dimension to the servers lore.', 71),
(126, 'Specters Haunted Mansion', 'c', TIMESTAMP('2021-05-03', '14:12:20'), 'd', 12, 'd', TIMESTAMP('2021-10-16', '14:12:20'), 'The discovery of an enigmatic haunted mansion, shrouded in spectral legends and eerie tales. Players ventured into the mansions darkened halls, solving ghostly puzzles, and confronting poltergeists and otherworldly apparitions.', 46),
(129, 'Lunar Eclipse Celebration', 'c', TIMESTAMP('2022-08-11', '14:12:20'), 'm', 83, 'm', TIMESTAMP('2023-05-14', '14:12:20'), 'A celestial celebration during a rare lunar eclipse, where the servers night was illuminated by a silver glow. Players participated in lunar-themed events, enjoyed lunar-themed fireworks, and engaged in enchanting activities under the lunar eclipse.', 42),
(130, 'Realm of the Bards Tale', 'c', TIMESTAMP('2022-05-24', '14:12:20'), 'm', 46, 'm', TIMESTAMP('2023-09-10', '14:12:20'), 'The introduction of a captivating dimension dedicated to music, art, and storytelling. Players entered the Realm of the Bards Tale, participating in musical contests, sharing stories, and exploring interactive artworks, immersing themselves in the world of creativity and culture.', 46),
(131, 'Shadow Council Intrigue', 'c', TIMESTAMP('2022-11-12', '14:12:20'), 'h', 94, 'm', TIMESTAMP('2021-10-09', '14:12:20'), 'An event where a mysterious Shadow Council emerged, wielding dark powers and enigmatic schemes. Players embarked on espionage missions, unmasked the councils secrets, and navigated through a web of intrigue that unfolded as an evolving narrative.', 1),
(133, 'Era of Technomagical Renaissance', 'c', TIMESTAMP('2022-02-04', '14:12:20'), 'd', 57, 'm', TIMESTAMP('2022-05-24', '14:12:20'), 'A transformative era where players combined magic and technology to create innovative technomagical devices. This fusion led to the development of enchanting machinery, automated systems, and magitech gadgets, revolutionizing gameplay and exploration.', 55),
(137, 'Elemental Titans Unleashed', 'c', TIMESTAMP('2021-11-05', '14:12:20'), 'h', 22, 'm', TIMESTAMP('2022-06-24', '14:12:20'), 'The awakening of colossal elemental titans that tested the servers might and resilience. Players formed grand alliances to face these elemental giants, leading to monumental battles and heroic tales of survival.', 80),
(138, 'Phantom Opera Masquerade', 'c', TIMESTAMP('2022-08-30', '14:12:20'), 'd', 34, 'h', TIMESTAMP('2023-06-22', '14:12:20'), 'An enchanting masquerade ball hosted by mysterious phantoms within the server. Players donned elegant masks and danced the night away in a phantom-hosted ballroom, engaging in dances, social interactions, and phantom-themed quests.', 40),
(141, 'Minecraft Symphony Spectacle', 'c', TIMESTAMP('2022-02-17', '14:12:20'), 'm', 7, 'm', TIMESTAMP('2023-08-06', '14:12:20'), 'A grand orchestral performance within the server, featuring compositions by talented players and live in-game performances. The Symphony Spectacle brought music and culture to the forefront, offering an immersive auditory experience for the entire server community.', 27),
(143, 'Mystic Muses Riddles', 'c', TIMESTAMP('2021-02-15', '14:12:20'), 'h', 85, 'd', TIMESTAMP('2023-04-24', '14:12:20'), 'An event that revolved around the enigmatic riddles and challenges presented by a mystic muse. Players engaged in intellectual quests, unraveled puzzles, and embarked on a journey to uncover hidden truths within the servers lore.', 26),
(144, 'Nether Survival Challenge', 'c', TIMESTAMP('2022-05-13', '14:12:20'), 'm', 33, 'm', TIMESTAMP('2021-10-20', '14:12:20'), 'Participants faced the ultimate test of survival in the Nether, navigating its harsh environment, battling formidable foes, and collecting rare resources. The Nether Survival Challenge was a true trial by fire for the servers bravest players.', 34),
(145, 'Haunted Mansion Adventure', 'c', TIMESTAMP('2021-12-23', '14:12:20'), 'h', 72, 'd', TIMESTAMP('2022-06-13', '14:12:20'), 'Players embarked on a spine-tingling adventure through a mysterious haunted mansion filled with traps, puzzles, and eerie surprises. This event provided a thrilling Halloween experience with a Minecraft twist.', 63),
(148, 'Secret Santa Gift Exchange', 'c', TIMESTAMP('2022-03-05', '14:12:20'), 'd', 74, 'm', TIMESTAMP('2023-10-20', '14:12:20'), 'In the spirit of the holidays, players participated in a heartwarming Secret Santa gift exchange event. Players were paired up anonymously and exchanged thoughtful in-game gifts, spreading joy and goodwill across the server.', 16),
(149, 'Epic PvP Battle Royale', 'c', TIMESTAMP('2023-05-05', '14:12:20'), 'h', 0, 'm', TIMESTAMP('2022-10-18', '14:12:20'), 'The Epic PvP Battle Royale pitted players against each other in an intense free-for-all battle. Armed with their wits and combat skills, participants fought for supremacy in an adrenaline-fueled contest.', 38),
(150, 'Minecraft Olympics', 'c', TIMESTAMP('2023-05-22', '14:12:20'), 'h', 62, 'm', TIMESTAMP('2021-12-09', '14:12:20'), 'The server hosted its very own Minecraft Olympics, featuring a variety of sporting events, including parkour, archery, and boat racing. This friendly competition showcased the diverse talents of the servers community.', 55),
(152, 'Desert Temple Treasure Hunt', 'c', TIMESTAMP('2023-09-29', '14:12:20'), 'm', 48, 'm', TIMESTAMP('2023-05-16', '14:12:20'), 'Players embarked on an expedition to uncover hidden treasures within the vast desert temples scattered across the servers deserts. This event combined puzzle-solving and exploration as participants searched for the elusive riches.', 37),
(154, 'Island Survival Challenge', 'c', TIMESTAMP('2021-05-23', '14:12:20'), 'm', 74, 'd', TIMESTAMP('2021-04-22', '14:12:20'), 'Players were marooned on remote islands and had to survive using only the resources available to them. The Island Survival Challenge tested players survival skills, creativity, and teamwork in a remote and unforgiving environment.', 9),
(156, 'Server Lore Reveal', 'c', TIMESTAMP('2021-06-22', '14:12:20'), 'd', 39, 'd', TIMESTAMP('2023-07-29', '14:12:20'), 'An event where the servers lore and backstory were unveiled to the community, shedding light on the worlds history, characters, and mysteries. This revelation added depth to the servers narrative and engaged players in its rich storytelling.', 44),
(159, 'Mob Arena Mayhem', 'c', TIMESTAMP('2023-10-27', '14:12:20'), 'd', 23, 'd', TIMESTAMP('2021-12-13', '14:12:20'), 'A mob-infested arena was created for players to test their combat skills. The Mob Arena Mayhem event challenged players to survive waves of hostile creatures, earning rewards and glory for their prowess.', 70),
(163, 'End City Expedition', 'c', TIMESTAMP('2022-01-20', '14:12:20'), 'm', 59, 'd', TIMESTAMP('2021-11-08', '14:12:20'), 'Adventurers ventured into the End to explore the enigmatic End Cities, collect Shulker shells, and unlock the secrets of this mysterious dimension. The End City Expedition was an otherworldly adventure that tested players courage and resourcefulness.', 83),
(164, 'Biome Beauty Contest', 'c', TIMESTAMP('2023-02-13', '14:12:20'), 'm', 58, 'h', TIMESTAMP('2023-02-23', '14:12:20'), 'Players competed to create the most visually stunning and immersive biomes, showcasing their landscaping skills and creativity. The Biome Beauty Contest resulted in breathtaking natural landscapes that enhanced the servers aesthetics.', 79),
(165, 'Minecraft Symphony', 'c', TIMESTAMP('2021-04-29', '14:12:20'), 'h', 37, 'h', TIMESTAMP('2021-11-10', '14:12:20'), 'Musically-inclined players collaborated to create a virtual symphony within the game, with note blocks and redstone circuitry. The Minecraft Symphony was a unique and harmonious event that celebrated the servers artistic diversity.', 17),
(166, 'Celestial Dragons Ascendance', 'c', TIMESTAMP('2022-07-20', '14:12:20'), 'h', 90, 'm', TIMESTAMP('2021-03-19', '14:12:20'), 'The rise of the Celestial Dragon, a guardian of the servers world with the power to influence celestial events. Players embarked on quests, aligning with the dragon to harness its celestial powers and protect the servers realm from otherworldly threats.', 63),
(167, 'Era of Astral Architects', 'c', TIMESTAMP('2022-12-28', '14:12:20'), 'h', 34, 'h', TIMESTAMP('2021-02-20', '14:12:20'), 'A transformative era that celebrated the servers builders and architects, featuring grand building competitions, architectural showcases, and a focus on architectural innovation. Players crafted monumental structures, pushing the boundaries of creativity and design.', 90),
(169, 'Minecraft Renaissance Faire', 'c', TIMESTAMP('2023-02-21', '14:12:20'), 'd', 28, 'm', TIMESTAMP('2021-04-15', '14:12:20'), 'A Renaissance Faire that celebrated the servers culture, art, and history, allowing players to immerse themselves in a bygone era. Festivities included jousting tournaments, costumed parades, and theatrical performances, fostering a sense of historical reenactment and community.', 49),
(171, 'Era of Server-wide Diplomacy', 'c', TIMESTAMP('2022-03-07', '14:12:20'), 'h', 72, 'h', TIMESTAMP('2023-06-04', '14:12:20'), 'An era marked by diplomatic summits and negotiations among factions, fostering alliances, trade agreements, and international relations. The era emphasized peaceful coexistence and cooperation over conflict and warfare.', 18),
(175, 'Era of Mechanical Marvels', 'c', TIMESTAMP('2021-03-24', '14:12:20'), 'h', 77, 'm', TIMESTAMP('2021-06-28', '14:12:20'), 'A period marked by the creation of intricate mechanical contraptions and automations. Players designed elaborate machines, elaborate devices, and intricate redstone creations, driving the servers industrial revolution.', 13),
(178, 'Epic Exoplanetary Expeditions', 'c', TIMESTAMP('2023-03-25', '14:12:20'), 'm', 9, 'm', TIMESTAMP('2023-10-24', '14:12:20'), 'The expansion of the servers interstellar portal network, enabling players to embark on epic expeditions to distant exoplanets and cosmic wonders. These journeys opened up opportunities for extraterrestrial colonization, resource gathering, and cosmic discoveries.', 40),
(179, 'Astral Runes Enigma', 'c', TIMESTAMP('2022-02-21', '14:12:20'), 'd', 89, 'h', TIMESTAMP('2021-08-17', '14:12:20'), 'A mystical event where players decoded astral runes scattered across the servers landscapes. These runes contained celestial secrets, leading to astral adventures and the unraveling of cosmic mysteries.', 36),
(180, 'Era of Etherial Citadels', 'c', TIMESTAMP('2021-04-03', '14:12:20'), 'h', 42, 'm', TIMESTAMP('2022-10-06', '14:12:20'), 'An era marked by the construction of ethereal citadels, grand fortresses that floated in the servers skies. Players designed floating cities, aerial battles, and architectural marvels that defied gravity, reshaping the servers architectural landscape.', 69),
(187, 'Enchanted Armor Forging', 'c', TIMESTAMP('2023-10-15', '14:12:20'), 'h', 10, 'm', TIMESTAMP('2023-06-20', '14:12:20'), 'An event where players could craft and enchant personalized, enchanted armor sets, each with unique abilities and cosmetic variations. The event celebrated customization and individuality, allowing players to express their unique playstyles.', 18),
(188, 'Era of Elemental Reckoning', 'c', TIMESTAMP('2021-11-09', '14:12:20'), 'd', 29, 'd', TIMESTAMP('2022-04-22', '14:12:20'), 'A period marked by elemental upheaval and elemental titans returning to test the servers strength and resolve. Players engaged in elemental wars, challenges, and allegiances that defined the servers elemental political landscape.', 68),
(189, 'Lost Chronicles Expedition', 'c', TIMESTAMP('2021-08-12', '14:12:20'), 'h', 68, 'd', TIMESTAMP('2021-12-30', '14:12:20'), 'An ambitious expedition dedicated to uncovering forgotten chapters in the servers history. Players ventured into hidden archives, deciphered cryptic texts, and pieced together lost lore, enriching the servers narrative with rediscovered stories.', 49),
(191, 'Era of Nautical Dominion', 'c', TIMESTAMP('2022-08-06', '14:12:20'), 'm', 20, 'd', TIMESTAMP('2022-06-17', '14:12:20'), 'A transformative era focused on naval supremacy, shipbuilding, and maritime exploration. Players navigated the high seas, engaged in naval battles, and colonized islands, shaping the servers oceanic realms and political dynamics.', 13),
(193, 'Astral Observatory Skywatch', 'c', TIMESTAMP('2022-03-23', '14:12:20'), 'd', 17, 'd', TIMESTAMP('2023-10-19', '14:12:20'), 'A grand observatory event, held at the servers Astral Observatory, where players gathered to stargaze, witness celestial phenomena, and engage in astronomical quests. The Astral Observatory fostered an appreciation for the servers night skies.', 5),
(194, 'Era of Ethereal Harmonies', 'c', TIMESTAMP('2021-04-28', '14:12:20'), 'd', 25, 'd', TIMESTAMP('2023-06-20', '14:12:20'), 'A period marked by the resurgence of ethereal beings and harmonious entities that influenced the servers lore and narratives. Players forged bonds with these ethereal beings, shaping the servers cultural and mystical landscape.', 14),
(195, 'Festival of Luminous Fireflies', 'c', TIMESTAMP('2021-04-03', '14:12:20'), 'h', 44, 'm', TIMESTAMP('2021-04-15', '14:12:20'), 'A luminous festival dedicated to the servers fireflies, illuminating the night with their magical glow. Players enjoyed firefly-themed contests, captivating light displays, and quests that celebrated the mystical world of the fireflies.', 70),
(196, 'Ocean Monument Raid', 'c', TIMESTAMP('2022-05-23', '14:12:20'), 'h', 26, 'm', TIMESTAMP('2023-06-17', '14:12:20'), 'Daring players teamed up to conquer the formidable Ocean Monuments, battling Guardians and Elder Guardians to claim the coveted sponges. The Ocean Monument Raid was a thrilling underwater adventure that showcased the servers aquatic challenges.', 68),
(197, 'Epic Horse Race Across Realms', 'c', TIMESTAMP('2022-10-21', '14:12:20'), 'h', 40, 'h', TIMESTAMP('2022-11-30', '14:12:20'), 'Riders and breeders competed in an epic horse race spanning different biomes and terrains. The Horse Race Across Realms was an exhilarating event that highlighted the servers diverse landscapes and equestrian community.', 91),
(199, 'Skyblock Challenge', 'c', TIMESTAMP('2022-07-14', '14:12:20'), 'd', 82, 'h', TIMESTAMP('2023-08-24', '14:12:20'), 'Players embarked on a challenging Skyblock adventure, starting with minimal resources on a tiny island in the sky. The Skyblock Challenge tested players resourcefulness and ingenuity as they transformed their humble island into a thriving world.', 43),
(200, 'Pirate Cove Raid', 'c', TIMESTAMP('2021-06-02', '14:12:20'), 'd', 23, 'm', TIMESTAMP('2021-02-20', '14:12:20'), 'Adventurers embarked on a perilous expedition to raid a well-guarded Pirate Cove, filled with traps, hidden treasures, and formidable pirate mobs. The Pirate Cove Raid was a thrilling journey into piracy and adventure on the high seas.', 80),
(201, 'Custom Minigame Marathon', 'c', TIMESTAMP('2022-06-25', '14:12:20'), 'h', 99, 'd', TIMESTAMP('2021-09-08', '14:12:20'), 'The server hosted a custom-made minigame marathon with a variety of unique challenges and games. This event showcased the creativity of the servers minigame developers and provided endless hours of fun for players.', 10),
(204, 'Minecraft Zoo Grand Opening', 'c', TIMESTAMP('2021-04-03', '14:12:20'), 'h', 55, 'm', TIMESTAMP('2021-10-06', '14:12:20'), 'Builders and animal enthusiasts gathered to create a breathtaking zoo, showcasing Minecrafts diverse wildlife. The Minecraft Zoo Grand Opening celebrated the servers dedication to preserving and displaying in-game creatures.', 62),
(205, 'Server-Wide Treasure Hunt', 'c', TIMESTAMP('2022-07-12', '14:12:20'), 'd', 93, 'd', TIMESTAMP('2021-11-04', '14:12:20'), 'A server-wide treasure hunt event featured riddles, puzzles, and clues scattered across the servers vast terrain. Participants embarked on a thrilling quest to uncover hidden treasures, emphasizing the servers passion for exploration and discovery.', 36),
(212, 'Nether Fort Bridge Construction', 'c', TIMESTAMP('2021-03-16', '14:12:20'), 'h', 88, 'd', TIMESTAMP('2021-06-25', '14:12:20'), 'In a monumental construction effort, players built a grand bridge connecting two Nether Fortresses, allowing safe passage between the dangerous locations. The Nether Fort Bridge Construction was a symbol of the servers dedication to infrastructure.', 29),
(213, 'Halloween Costume Contest', 'c', TIMESTAMP('2023-04-30', '14:12:20'), 'h', 15, 'm', TIMESTAMP('2022-03-30', '14:12:20'), 'Players donned their most creative and spooky costumes in a Halloween Costume Contest. The event highlighted the servers sense of fun and celebration during the Halloween season.', 66),
(214, 'Ancient Ruins Puzzle Challenge', 'c', TIMESTAMP('2021-05-30', '14:12:20'), 'd', 10, 'm', TIMESTAMP('2022-11-11', '14:12:20'), 'Adventurers explored ancient ruins filled with intricate puzzles and challenges. The Ancient Ruins Puzzle Challenge was a brain-teasing event that tested players problem-solving skills and teamwork.', 62),
(215, 'Hoglin Racing Derby', 'c', TIMESTAMP('2023-01-01', '14:12:20'), 'm', 62, 'd', TIMESTAMP('2022-04-15', '14:12:20'), 'A unique event where players participated in Hoglin racing, racing these lumbering creatures on a specially designed track. The Hoglin Racing Derby was a quirky and entertaining competition that highlighted the servers sense of humor.', 70),
(216, 'Netherite Castle Siege', 'c', TIMESTAMP('2023-03-30', '14:12:20'), 'd', 79, 'd', TIMESTAMP('2023-06-09', '14:12:20'), 'Players took part in an epic siege of a Netherite-encrusted fortress, overcoming powerful defenders to claim valuable Netherite resources. The Netherite Castle Siege was a testament to the servers love for challenging battles and epic loot.', 92),
(217, 'Horse Jumping Championship', 'c', TIMESTAMP('2023-03-20', '14:12:20'), 'd', 94, 'd', TIMESTAMP('2023-05-03', '14:12:20'), 'Equestrian enthusiasts and their trusty steeds competed in a horse jumping championship. The event showcased the bond between players and their horses, as they navigated intricate jumping courses with precision.', 31),
(222, 'Firework Spectacular', 'c', TIMESTAMP('2022-06-29', '14:12:20'), 'm', 22, 'd', TIMESTAMP('2021-05-13', '14:12:20'), 'A grand fireworks display lit up the night sky, celebrating the servers milestones, anniversaries, and special occasions. The Firework Spectacular was a dazzling event that showcased the servers sense of community and celebration.', 46),
(227, 'Elemental Forges of Power', 'c', TIMESTAMP('2022-05-04', '14:12:20'), 'h', 41, 'm', TIMESTAMP('2022-09-25', '14:12:20'), 'The introduction of Elemental Forges that allowed players to forge elemental weapons and equipment. Players harnessed the power of fire, water, earth, and air to craft powerful gear with unique elemental abilities, encouraging strategic customization and specialization.', 44),
(229, 'Era of Nether Reclamation', 'c', TIMESTAMP('2022-03-13', '14:12:20'), 'h', 78, 'm', TIMESTAMP('2021-04-03', '14:12:20'), 'A transformation of the Nether, with players working together to cleanse the fiery realm, restore its balance, and unlock its hidden secrets. The Nether Reclamation breathed new life into the dimension, making it a realm of discovery and adventure.', 78),
(233, 'Voyage to the Underworld Abyss', 'c', TIMESTAMP('2022-06-02', '14:12:20'), 'h', 6, 'd', TIMESTAMP('2023-09-21', '14:12:20'), 'A daring expedition to the heart of the servers Underworld Abyss, a dark dimension shrouded in mystery and danger. Explorers descended into the abyss, confronting fearsome creatures, navigating through treacherous terrain, and uncovering hidden narratives.', 57),
(234, 'Minecraft Cultural Renaissance', 'c', TIMESTAMP('2023-02-23', '14:12:20'), 'm', 8, 'h', TIMESTAMP('2022-08-19', '14:12:20'), 'A cultural renaissance celebrating the servers diverse traditions, arts, and history. Players participated in festivals, showcased their unique cultural contributions, and engaged in cross-cultural exchanges, fostering a sense of community and mutual appreciation.', 89),
(235, 'Realm of Eternal Moonlight', 'c', TIMESTAMP('2021-06-03', '14:12:20'), 'd', 89, 'd', TIMESTAMP('2022-05-29', '14:12:20'), 'The unveiling of the Realm of Eternal Moonlight, an enchanting dimension that existed in perpetual moonlight. Players journeyed into this mystical realm, experiencing its captivating moonlit landscapes, quests, and celestial creatures.', 24),
(236, 'Era of Eldritch Mysteries', 'c', TIMESTAMP('2022-09-27', '14:12:20'), 'm', 79, 'd', TIMESTAMP('2021-08-03', '14:12:20'), 'A period marked by the resurgence of eldritch beings and cosmic mysteries that influenced the servers lore and narratives. Players engaged with eldritch entities, shaping the servers cultural and enigmatic landscape.', 67),
(239, 'Era of Cybernetic Frontiers', 'c', TIMESTAMP('2023-06-04', '14:12:20'), 'h', 73, 'm', TIMESTAMP('2022-04-24', '14:12:20'), 'A transformative era featuring cybernetic advancements, combining technology and biology to create innovative cyborg enhancements. Players embraced cybernetic augmentations, pushing the boundaries of technological innovation and exploration.', 76),
(241, 'Enchanted Storytellers Camp', 'c', TIMESTAMP('2022-03-26', '14:12:20'), 'm', 76, 'm', TIMESTAMP('2023-03-08', '14:12:20'), 'The establishment of an enchanted camp dedicated to storytelling, where players shared their server experiences and stories through interactive narratives, games, and creative expression.', 34),
(246, 'Era of Mythic Origins', 'c', TIMESTAMP('2022-05-05', '14:12:20'), 'm', 100, 'm', TIMESTAMP('2021-03-02', '14:12:20'), 'An era focused on uncovering the mythic origins of the servers world, its deities, and the creation of the cosmos. Players delved into the mythology, piecing together ancient tales and mythical histories that shaped the servers narrative.', 27),
(247, 'Mystic Flute of Enchantment', 'c', TIMESTAMP('2022-03-10', '14:12:20'), 'd', 28, 'd', TIMESTAMP('2022-03-14', '14:12:20'), 'An enchanting event where players discovered a mystical flute that had the power to enchant and awaken the servers landscapes. Players played enchanting melodies, transforming biomes, and unveiling hidden quests, altering the servers environments in enchanting ways.', 35),
(253, 'Era of Cursed Chronicles', 'c', TIMESTAMP('2021-06-22', '14:12:20'), 'm', 54, 'm', TIMESTAMP('2023-03-02', '14:12:20'), 'An era influenced by dark and cursed forces that haunted the servers narratives and lore. Players embarked on quests to uncover the origins of these curses and confront the dark entities that held the server in their grip.', 82),
(254, 'Timeless Timepiece Questline', 'c', TIMESTAMP('2023-02-06', '14:12:20'), 'h', 92, 'd', TIMESTAMP('2022-06-02', '14:12:20'), 'A mystical questline centered around a timeless timepiece that allowed players to manipulate time itself. Players ventured through time-related quests, unlocking the secrets and powers of the timepiece, and experiencing the servers narrative in a unique way.', 11),
(255, 'Ancient Temple Puzzle Extravaganza', 'c', TIMESTAMP('2023-11-05', '14:12:20'), 'd', 21, 'd', TIMESTAMP('2021-10-19', '14:12:20'), 'Players embarked on a multifaceted journey to solve puzzles and riddles within a long-forgotten ancient temple. The Ancient Temple Puzzle Extravaganza challenged participants with intricate mechanisms, hidden chambers, and cryptic inscriptions, revealing lore and treasures as they unraveled the temples secrets. This event encouraged critical thinking, teamwork, and a deep appreciation for Minecrafts puzzles.', 3),
(256, 'Mega Survival Challenge', 'c', TIMESTAMP('2023-06-15', '14:12:20'), 'm', 22, 'd', TIMESTAMP('2021-12-11', '14:12:20'), 'In the Mega Survival Challenge, players were dropped into a vast and dynamic survival world. They had to contend with changing biomes, unpredictable weather, and fluctuating resources. Participants honed their survival skills, showcasing their ability to adapt to a variety of challenges. From crafting shelters to managing food sources, this event offered a comprehensive experience in the art of survival.', 61),
(257, 'Sky Wars: Floating Island Combat', 'c', TIMESTAMP('2022-11-20', '14:12:20'), 'h', 46, 'd', TIMESTAMP('2022-08-02', '14:12:20'), 'The Sky Wars event took warfare to the skies, as players battled on floating islands suspended above the void. Competitors utilized limited resources to construct their islands, arm themselves, and engage in intense aerial combat. The event emphasized strategy, resource management, and aerial combat skills.', 53),
(258, 'Great Cave Expedition', 'c', TIMESTAMP('2023-02-14', '14:12:20'), 'd', 89, 'd', TIMESTAMP('2022-11-16', '14:12:20'), 'Adventurers set out on an extensive expedition into a sprawling underground cave system. This multi-layered cave network was a subterranean marvel, featuring diverse biomes, rare resources, and unique underground flora and fauna. The Great Cave Expedition was a comprehensive journey into the servers depths, testing players caving skills, cartography, and resource gathering abilities.', 89),
(260, 'Pixel Art Gallery Exhibition', 'c', TIMESTAMP('2022-11-29', '14:12:20'), 'm', 9, 'm', TIMESTAMP('2021-07-15', '14:12:20'), 'The Pixel Art Gallery Exhibition was a meticulously curated showcase of the servers most impressive pixel art creations. It offered visitors the opportunity to explore a gallery filled with intricate pixel art masterpieces, each painstakingly crafted with blocks. The event delved into the stories behind each artwork, the techniques used, and the inspiration behind these stunning visual creations.', 30),
(261, 'Nether Portal Relay Race', 'c', TIMESTAMP('2022-08-03', '14:12:20'), 'd', 53, 'm', TIMESTAMP('2023-01-06', '14:12:20'), 'Teams of players raced through an intricate series of Nether portals, connected across various parts of the servers world. The Nether Portal Relay Race was a fast-paced event that tested the participants navigation, coordination, and Nether survival skills. It also explored the mechanics of creating and managing Nether portals.', 83),
(262, 'Server Documentary Film Premiere', 'c', TIMESTAMP('2021-06-19', '14:12:20'), 'm', 46, 'd', TIMESTAMP('2023-05-10', '14:12:20'), 'The Server Documentary Film Premiere celebrated the culmination of a collaborative project where players, filmmakers, and storytellers came together to produce a documentary film about the servers history and community. The event offered an exclusive screening of the documentary, followed by discussions with the creators, reflecting on the process of capturing the servers journey over time.', 66),
(264, 'Desert Expedition and Oasis Discovery', 'c', TIMESTAMP('2022-12-01', '14:12:20'), 'h', 43, 'm', TIMESTAMP('2023-08-11', '14:12:20'), 'The Desert Expedition and Oasis Discovery event offered participants the opportunity to explore the arid deserts of the server, searching for hidden oases and uncovering the secrets of ancient desert civilizations. The event delved into desert survival strategies, desert-specific resources, and the mysteries of desert biomes, including desert temples and villages.', 1),
(266, 'Minecraft Artisan Showcase', 'c', TIMESTAMP('2021-11-05', '14:12:20'), 'm', 23, 'd', TIMESTAMP('2023-02-17', '14:12:20'), 'The Minecraft Artisan Showcase celebrated the servers finest artisans and craftsmen, featuring their handcrafted furniture, decorations, and architectural designs. The event provided insight into the process of designing and constructing intricate in-game decor, highlighting the artistic and practical aspects of these creations.', 2),
(268, 'Nether Highway Construction Relay', 'c', TIMESTAMP('2022-03-17', '14:12:20'), 'd', 55, 'd', TIMESTAMP('2022-10-03', '14:12:20'), 'The Nether Highway Construction Relay was a team-based competition where players raced to construct and connect segments of the servers intricate Nether highway system. The event showcased the technical aspects of building efficient transportation networks in the Nether, focusing on speed, coordination, and the architectural creativity behind these projects.', 91),
(270, 'Nether Biome Showcase', 'c', TIMESTAMP('2021-08-18', '14:12:20'), 'd', 21, 'm', TIMESTAMP('2022-05-26', '14:12:20'), 'The Nether Biome Showcase event provided an in-depth exploration of the diverse biomes within the Nether dimension. Participants delved into the mechanics, flora, and fauna of Nether biomes such as the Warped Forest, Crimson Forest, and Soul Sand Valley. The event also highlighted how players harnessed the unique resources and challenges of these biomes.', 24),
(271, 'Skyblock Survival Masterclass', 'c', TIMESTAMP('2022-02-19', '14:12:20'), 'h', 54, 'm', TIMESTAMP('2023-04-23', '14:12:20'), 'Skyblock Survival Masterclass offered players a comprehensive tutorial on mastering the art of surviving on a minimalistic floating island. Participants were guided through the process of resource management, island expansion, and creative solutions to challenges. The event emphasized the principles of self-sufficiency and creative problem-solving.', 49),
(272, 'Floating Castle Building Contest', 'c', TIMESTAMP('2023-08-31', '14:12:20'), 'h', 20, 'm', TIMESTAMP('2023-11-04', '14:12:20'), 'Builders showcased their architectural ingenuity by creating gravity-defying floating castles in the sky. The Floating Castle Building Contest explored the artistic and structural elements of these stunning constructions, showcasing designs, construction techniques, and the enchanting stories behind each floating castle.', 1),
(273, 'Nether Quartz Mining Expedition', 'c', TIMESTAMP('2022-03-03', '14:12:20'), 'm', 42, 'm', TIMESTAMP('2023-11-09', '14:12:20'), 'The Nether Quartz Mining Expedition provided players with a chance to delve into the Nethers quartz-rich biomes. Participants learned about the unique challenges and rewards of mining Nether quartz, as well as the resources applications in crafting and building. The event highlighted the servers approach to resource gathering and resource-driven adventures.', 21),
(275, 'Creeper Spleef Championship', 'c', TIMESTAMP('2022-11-18', '14:12:20'), 'h', 69, 'h', TIMESTAMP('2021-05-03', '14:12:20'), 'The Creeper Spleef Championship combined the classic Spleef game with the unpredictable presence of creepers. Participants engaged in intense matches where they attempted to outmaneuver opponents while avoiding explosive surprises. The event emphasized agility, strategy, and the unique challenges of combatting mobs in a competitive setting.', 64),
(276, 'Nether Castle Siege Reenactment', 'c', TIMESTAMP('2023-04-15', '14:12:20'), 'm', 47, 'm', TIMESTAMP('2021-09-20', '14:12:20'), 'Players gathered to reenact epic battles within a meticulously recreated Nether castle. The Nether Castle Siege Reenactment delved into historical and narrative aspects of the server, allowing participants to step into the shoes of legendary figures and experience server lore firsthand. This event combined storytelling, combat, and immersive role-playing.', 52),
(278, 'Haunted Mineshaft Exploration', 'c', TIMESTAMP('2021-11-26', '14:12:20'), 'h', 20, 'h', TIMESTAMP('2021-04-06', '14:12:20'), 'Adventurers ventured into dark and treacherous mineshafts with a haunted twist. The Haunted Mineshaft Exploration event offered participants a spine-tingling experience as they uncovered eerie stories, secrets, and supernatural occurrences within the servers underground network. This immersive adventure combined exploration, storytelling, and mystery.', 71),
(280, 'Jungle Temple Expedition', 'c', TIMESTAMP('2022-11-29', '14:12:20'), 'd', 5, 'm', TIMESTAMP('2021-09-16', '14:12:20'), 'The Jungle Temple Expedition invited players to delve into the heart of dense jungles to explore ancient temples. Participants encountered a variety of traps, puzzles, and hidden treasures while learning about jungle biomes and their characteristics. The event highlighted the servers commitment to immersive storytelling and discovery in lush jungle settings.', 30),
(281, 'Minecraft Science Fair', 'c', TIMESTAMP('2021-10-11', '14:12:20'), 'h', 27, 'h', TIMESTAMP('2021-05-23', '14:12:20'), 'The Minecraft Science Fair showcased the servers most inventive experiments and scientific creations. Participants presented their innovative and educational projects, exploring concepts like redstone contraptions, automation, and Minecrafts potential for hands-on learning. The event celebrated the intersection of creativity and education within the server.', 38),
(282, 'Redstone Engineering Symposium', 'c', TIMESTAMP('2022-12-06', '14:12:20'), 'h', 73, 'm', TIMESTAMP('2021-04-18', '14:12:20'), 'The Redstone Engineering Symposium brought together the servers most skilled redstone engineers to share their latest contraptions, innovations, and techniques. Participants attended workshops, lectures, and hands-on demonstrations, delving into the complexities of redstone circuitry and automation.', 22),
(283, 'Enderpearl Relay Race', 'c', TIMESTAMP('2022-02-10', '14:12:20'), 'm', 87, 'h', TIMESTAMP('2022-10-06', '14:12:20'), 'Teams of players competed in an Enderpearl Relay Race, where they used Enderpearls to traverse challenging terrain and obstacles. This event emphasized teamwork, resource management, and Enderpearl throwing accuracy as participants passed the pearl from one team member to another to complete the relay.', 1),
(287, 'Server-Wide Block Swap Challenge', 'c', TIMESTAMP('2021-07-27', '14:12:20'), 'h', 58, 'h', TIMESTAMP('2022-07-25', '14:12:20'), 'The Server-Wide Block Swap Challenge encouraged players to think creatively by organizing a massive block swap project. Participants worked collaboratively to replace specific blocks within a designated area with a different block type, exploring concepts of aesthetics, teamwork, and large-scale terraforming.', 57),
(288, 'The Art of Redstone Sculpture', 'c', TIMESTAMP('2022-01-12', '14:12:20'), 'h', 93, 'd', TIMESTAMP('2021-07-05', '14:12:20'), 'The Art of Redstone Sculpture event introduced players to the fusion of redstone engineering and artistic creativity. Participants learned how to incorporate redstone circuitry into their sculptures, creating dynamic and interactive art pieces. The event emphasized the marriage of technology and art within Minecraft.', 65),
(289, 'Minecraft History Preservation Project', 'c', TIMESTAMP('2022-08-21', '14:12:20'), 'd', 54, 'd', TIMESTAMP('2022-01-29', '14:12:20'), 'The Minecraft History Preservation Project was a community initiative dedicated to documenting and preserving significant landmarks, structures, and narratives within the server. Participants discussed the historical significance of these elements, their architectural styles, and the stories they told about the servers past.', 12),
(292, 'The Language of Enchantments Workshop', 'c', TIMESTAMP('2022-11-16', '14:12:20'), 'h', 23, 'd', TIMESTAMP('2022-11-15', '14:12:20'), 'The Language of Enchantments Workshop provided players with an in-depth understanding of the enchantment system within Minecraft. Participants explored enchantment tables, the mechanics behind enchanting, and how to optimize their gear for various gameplay styles. The event aimed to educate and empower players with knowledge of enchantments.', 29),
(293, 'Minecraft Server Cartography Exhibition', 'c', TIMESTAMP('2022-05-13', '14:12:20'), 'm', 76, 'h', TIMESTAMP('2021-07-05', '14:12:20'), 'The Minecraft Server Cartography Exhibition showcased the art and science of mapmaking within the server. Participants shared their meticulously crafted in-game maps, offering insights into the cartographic principles, world exploration, and how these maps contributed to navigation and community development.', 87),
(296, 'Mega Build Showcase', 'c', TIMESTAMP('2021-07-22', '14:12:20'), 'm', 10, 'm', TIMESTAMP('2023-10-01', '14:12:20'), 'The Mega Build Showcase was an awe-inspiring exhibition of architectural creativity and talent. Builders from the community spent weeks crafting enormous structures that pushed the boundaries of what was possible in Minecraft. From intricate medieval castles to futuristic cities, the event featured a diverse range of architectural styles. Participants shared their building techniques and inspired others to embark on their own ambitious projects.', 26),
(297, 'The Battle of the Strongholds', 'c', TIMESTAMP('2023-09-14', '14:12:20'), 'd', 72, 'd', TIMESTAMP('2022-08-03', '14:12:20'), 'The Battle of the Strongholds was an epic PVP event that tested the servers might and strategy. Teams clashed in a massive underground fortress, battling for control of valuable resources and secret chambers. The intense close-quarters combat, traps, and hidden passageways added a layer of excitement to the event. It was a true test of teamwork and tactical prowess, and the victors earned bragging rights as the servers strongest faction.', 14),
(299, 'The Great Redstone Expo', 'c', TIMESTAMP('2023-04-26', '14:12:20'), 'd', 55, 'h', TIMESTAMP('2023-08-06', '14:12:20'), 'The Great Redstone Expo was a celebration of the servers engineering brilliance. Redstone enthusiasts showcased their most innovative creations, from complex automated farms to mind-boggling contraptions. Participants explained the intricacies of their inventions, sharing tips and tricks for others to improve their redstone skills. The expo served as a hub for knowledge exchange and an opportunity for the community to appreciate the genius of its engineers.', 82),
(300, 'The Oceanic Odyssey', 'c', TIMESTAMP('2022-06-29', '14:12:20'), 'm', 36, 'h', TIMESTAMP('2023-09-21', '14:12:20'), 'The Oceanic Odyssey was a daring maritime adventure that saw players setting sail on a vast ocean in search of uncharted islands and buried treasures. Participants constructed ships, gathered supplies, and braved the unpredictable sea in pursuit of fame and riches. The event was a test of navigation skills and resource management as players encountered hostile sea creatures and navigated through storms in the quest for hidden loot.', 13),
(301, 'The Festival of Elements', 'c', TIMESTAMP('2021-04-29', '14:12:20'), 'd', 16, 'm', TIMESTAMP('2022-06-12', '14:12:20'), 'The Festival of Elements was a grand celebration of Minecrafts elemental forces. Participants were tasked with representing one of the four elements—earth, water, fire, and air—in elaborate builds and creative performances. Each elemental district featured unique challenges and activities related to its theme. The event fostered creativity and community spirit while honoring the natural elements that make Minecraft a captivating world to explore.', 11),
(305, 'The Mythical Creature Hunt', 'c', TIMESTAMP('2021-08-23', '14:12:20'), 'm', 58, 'h', TIMESTAMP('2021-08-25', '14:12:20'), 'The Mythical Creature Hunt was an adventure that sent players on a quest to uncover rare and mythical creatures hidden throughout the server. Participants sought out legendary beasts, such as the elusive Mooshroom King and the enigmatic Ender Manticore. These creatures, once found, presented unique challenges and rewards.', 64),
(309, 'The Kingdoms Diplomatic Summit', 'c', TIMESTAMP('2021-02-15', '14:12:20'), 'm', 56, 'h', TIMESTAMP('2023-09-04', '14:12:20'), 'The Kingdoms Diplomatic Summit was a unique event that fostered political intrigue and alliances among server kingdoms. Representatives from various realms gathered to discuss treaties, trade agreements, and territorial disputes. The event highlighted the servers rich lore and the intricacies of its political landscape.', 87),
(311, 'The Netherite Forging Festival', 'c', TIMESTAMP('2022-01-22', '14:12:20'), 'm', 45, 'd', TIMESTAMP('2022-11-02', '14:12:20'), 'The Netherite Forging Festival was a celebration of the servers dedication to upgrading equipment. Players gathered to smelt ancient debris into netherite ingots, enhancing their gear. The festival featured forging contests, demonstrations, and a chance for players to improve their equipment through collective effort.', 83),
(313, 'The Minigame Madness Marathon', 'c', TIMESTAMP('2022-08-26', '14:12:20'), 'd', 86, 'h', TIMESTAMP('2021-07-16', '14:12:20'), 'The Minigame Madness Marathon featured a variety of custom minigames created by the servers talented builders. Participants engaged in everything from parkour challenges to trivia quizzes, competing for prizes and bragging rights. The event showcased the creativity and game design skills of the community.', 52),
(315, 'The Equestrian Grand Prix', 'c', TIMESTAMP('2021-12-25', '14:12:20'), 'd', 19, 'h', TIMESTAMP('2023-06-18', '14:12:20'), 'The Equestrian Grand Prix was a competitive horse racing event that took place on a specially designed racetrack. Participants showcased their fastest horses, skilled jockeys, and clever obstacle navigation in a series of thrilling races. It was a showcase of equine athleticism and horsemanship.', 49),
(316, 'The Enchanted Book Swap', 'c', TIMESTAMP('2022-05-29', '14:12:20'), 'm', 78, 'h', TIMESTAMP('2022-12-14', '14:12:20'), 'The Enchanted Book Swap was an event where players gathered to exchange rare enchanted books and knowledge. Enchantment enthusiasts shared their expertise, offered trades, and discussed the intricacies of enchanting gear in Minecraft. The event celebrated the art of customization and enchantment.', 79),
(318, 'The Great Iceberg Exploration', 'c', TIMESTAMP('2022-09-12', '14:12:20'), 'd', 91, 'm', TIMESTAMP('2021-05-28', '14:12:20'), 'The Great Iceberg Exploration sent players on a journey to uncover the mysteries of the servers frozen polar regions. They traversed vast icy landscapes, discovered hidden ice caves, and braved blizzards and frosty creatures. The event celebrated the beauty and challenges of icy biomes.', 82),
(319, 'The Potion Masters Championship', 'c', TIMESTAMP('2023-04-11', '14:12:20'), 'h', 95, 'h', TIMESTAMP('2022-12-30', '14:12:20'), 'The Potion Masters Championship was a competition where alchemists demonstrated their mastery of brewing. Participants concocted unique potions and elixirs, aiming to impress the judges with their inventiveness and skill. The event showcased the servers fascination with the mystical art of potion-making.', 50),
(321, 'The Legendary Music Festival', 'c', TIMESTAMP('2022-05-07', '14:12:20'), 'm', 54, 'm', TIMESTAMP('2022-07-10', '14:12:20'), 'The Legendary Music Festival was a vibrant celebration of music and performance. Musicians and artists from the server came together to create live music, showcases, and interactive performances. The event offered a chance for the community to unwind and enjoy the creative talents of its members.', 40),
(322, 'The Battle of the Gods', 'c', TIMESTAMP('2022-11-23', '14:12:20'), 'd', 73, 'd', TIMESTAMP('2023-06-28', '14:12:20'), 'The Battle of the Gods was an epic event where players confronted powerful boss mobs inspired by mythology. Participants teamed up to defeat these god-like creatures, each possessing unique abilities and challenges. The event celebrated the servers love for epic battles and epic loot.', 17),
(324, 'The Biome Biathlon', 'c', TIMESTAMP('2021-07-20', '14:12:20'), 'm', 86, 'h', TIMESTAMP('2022-02-08', '14:12:20'), 'The Biome Biathlon was a multisport event that combined the challenges of various biomes. Players competed in activities such as swimming in cold biomes, parkour in forest biomes, and more. The event showcased the servers diversity of environments and the athleticism of its players.', 19),
(325, 'Minecraft Museum of Ancient Artifacts', 'c', TIMESTAMP('2023-07-06', '14:12:20'), 'm', 53, 'm', TIMESTAMP('2023-07-14', '14:12:20'), 'The Minecraft Museum of Ancient Artifacts displayed a curated collection of server-specific historical artifacts and relics. This event provided insight into the backstory of each artifact, its significance within the servers lore, and the methods used to recover and preserve these treasures.', 18),
(327, 'Nether Hub Redesign Competition', 'c', TIMESTAMP('2023-11-03', '14:12:20'), 'm', 59, 'd', TIMESTAMP('2023-02-02', '14:12:20'), 'The Nether Hub Redesign Competition challenged builders to reimagine and redesign the servers central Nether hub. Participants showcased their architectural prowess and transit planning skills, discussing their design philosophies, practical considerations, and the importance of efficient Nether transportation.', 64),
(329, 'Village Festival and Trade Fair', 'c', TIMESTAMP('2022-10-08', '14:12:20'), 'm', 35, 'd', TIMESTAMP('2022-05-05', '14:12:20'), 'The Village Festival and Trade Fair brought together players from server villages for a grand celebration. Participants discussed the unique cultures and economies of their respective villages, highlighting the architectural styles, traditions, and economic activities that defined each community.', 40),
(331, 'Minecraft Music Composer Contest', 'c', TIMESTAMP('2021-12-03', '14:12:20'), 'd', 1, 'h', TIMESTAMP('2023-03-23', '14:12:20'), 'The Minecraft Music Composer Contest celebrated the servers talented musicians and composers. Participants shared their original Minecraft compositions and discussed their creative process, highlighting the significance of music and soundscapes in Minecraft.', 89),
(332, 'Server-Wide Ender Pearl Relay Race', 'c', TIMESTAMP('2022-04-27', '14:12:20'), 'm', 39, 'd', TIMESTAMP('2023-04-19', '14:12:20'), 'In the Server-Wide Ender Pearl Relay Race, teams of players passed Ender Pearls from one location to another across vast distances. The event emphasized Ender Pearl throwing accuracy, teamwork, and efficient communication strategies as participants coordinated relay transitions and reached their destination.', 18),
(334, 'Nether Portal Network Expansion', 'c', TIMESTAMP('2023-04-12', '14:12:20'), 'd', 0, 'd', TIMESTAMP('2023-07-23', '14:12:20'), 'Players collaborated to expand the servers Nether portal network, connecting new regions and settlements. This event highlighted the logistical and transportation challenges of managing a complex portal system, discussing the architecture of hub portals, travel routes, and their impact on server connectivity.', 12),
(336, 'Minecraft Engineering Symposium', 'c', TIMESTAMP('2022-04-11', '14:12:20'), 'h', 12, 'd', TIMESTAMP('2022-04-22', '14:12:20'), 'The Minecraft Engineering Symposium brought together the servers most ingenious engineers and redstone experts to exchange ideas and knowledge. Participants presented their innovative contraptions, showcased the application of redstone principles, and shared their thoughts on the role of engineering in Minecraft.', 74),
(339, 'Dungeon Delve Lore Session', 'c', TIMESTAMP('2022-07-18', '14:12:20'), 'm', 43, 'd', TIMESTAMP('2022-09-02', '14:12:20'), 'Dungeon Delve Lore Sessions explored the servers dungeon complexes and their role within the overarching narrative. Participants discussed the lore, backstory, and mysteries surrounding dungeons, revealing their connections to server history and character development.', 48),
(342, 'Nether Quartz Engineering Expo', 'c', TIMESTAMP('2022-06-11', '14:12:20'), 'h', 89, 'm', TIMESTAMP('2021-07-24', '14:12:20'), 'The Nether Quartz Engineering Expo provided a platform for players to showcase their innovative uses of Nether quartz in redstone contraptions, automation systems, and architectural designs. Participants discussed the properties and applications of Nether quartz within the servers technological landscape.', 8),
(346, 'Biome-Based Building Exhibition', 'c', TIMESTAMP('2022-08-13', '14:12:20'), 'h', 100, 'd', TIMESTAMP('2021-08-07', '14:12:20'), 'The Biome-Based Building Exhibition featured impressive structures that harmoniously integrated with their respective biomes. Participants explained how they designed and constructed their buildings to reflect the natural environments, showcasing the architectural principles and environmental considerations behind their creations.', 20),
(350, 'Minecraft Environmental Impact Report', 'c', TIMESTAMP('2021-07-31', '14:12:20'), 'm', 22, 'm', TIMESTAMP('2021-07-30', '14:12:20'), 'The Minecraft Environmental Impact Report assessed the servers ecological footprint and environmental sustainability practices. Participants discussed renewable energy sources, eco-friendly construction methods, and initiatives to reduce the servers impact on its virtual environment.', 74),
(357, 'The Mob Arena Madness', 'c', TIMESTAMP('2022-10-27', '14:12:20'), 'h', 55, 'd', TIMESTAMP('2021-05-24', '14:12:20'), 'The Mob Arena Madness was a challenging event that pitted players against waves of hostile mobs in a specially designed arena. Participants fought for their survival, honing their combat skills while earning rewards based on their performance.', 62),
(362, 'The Aerial Archery Tournament', 'c', TIMESTAMP('2021-08-11', '14:12:20'), 'h', 38, 'm', TIMESTAMP('2021-08-15', '14:12:20'), 'The Aerial Archery Tournament was a precision contest where participants used elytra to soar through the skies and shoot targets from mid-air. It demanded both flying skill and expert marksmanship, combining the thrill of flight with archery.', 66),
(363, 'The Biome Swap Challenge', 'c', TIMESTAMP('2022-08-18', '14:12:20'), 'd', 74, 'h', TIMESTAMP('2021-03-12', '14:12:20'), 'The Biome Swap Challenge was an intriguing competition where players swapped biomes with one another and adapted to their new surroundings. The event celebrated the adaptability of players and the diversity of the servers terrain.', 57),
(364, 'The Redstone Relay Race', 'c', TIMESTAMP('2021-04-24', '14:12:20'), 'd', 55, 'd', TIMESTAMP('2022-12-16', '14:12:20'), 'The Redstone Relay Race was a thrilling competition where teams built complex redstone contraptions to propel an item through a relay-style racecourse. It showcased teamwork, creativity, and technical proficiency.', 36),
(366, 'The Village Expansion Challenge', 'c', TIMESTAMP('2022-03-17', '14:12:20'), 'd', 94, 'h', TIMESTAMP('2023-02-08', '14:12:20'), 'The Village Expansion Challenge was an urban planning contest where players expanded and improved villages across the server. They added new structures, farms, and defenses, creating thriving communities and fortresses.', 5),
(367, 'The Biome-Themed Costume Ball', 'c', TIMESTAMP('2023-09-14', '14:12:20'), 'm', 6, 'd', TIMESTAMP('2023-04-08', '14:12:20'), 'The Biome-Themed Costume Ball was a masquerade event where players donned costumes inspired by the servers various biomes. It provided an opportunity for participants to showcase their creativity and love for Minecrafts diverse environments.', 9),
(369, 'The Ultimate Mining Marathon', 'c', TIMESTAMP('2021-03-06', '14:12:20'), 'd', 38, 'm', TIMESTAMP('2022-07-30', '14:12:20'), 'The Ultimate Mining Marathon was a competition that challenged players to mine as many valuable resources as possible within a time limit. Miners descended into underground caverns and tunnels, competing to collect precious ores and gems.', 33),
(370, 'The Biome-Border Border Challenge', 'c', TIMESTAMP('2022-02-04', '14:12:20'), 'm', 65, 'd', TIMESTAMP('2023-07-11', '14:12:20'), 'The Biome-Border Border Challenge was a thrilling race where players sprinted along the borders between biomes. The event tested players parkour and navigation skills as they hopped from one distinct environment to another.', 45),
(375, 'The Grand Canyon Carving Challenge', 'c', TIMESTAMP('2021-08-26', '14:12:20'), 'm', 54, 'd', TIMESTAMP('2022-12-01', '14:12:20'), 'The Grand Canyon Carving Challenge saw players sculpting grand canyon landscapes within a custom canyon arena. The event highlighted players creative prowess and ability to craft awe-inspiring terrains.', 67),
(378, 'The Wild Horse Roundup', 'c', TIMESTAMP('2022-03-29', '14:12:20'), 'd', 90, 'h', TIMESTAMP('2022-06-25', '14:12:20'), 'The Wild Horse Roundup sent players on an adventure to capture and tame wild horses that roamed the servers plains and savannas. Participants proved their equestrian skills and expertise in horsemanship.', 21),
(379, 'The Realm Wars', 'c', TIMESTAMP('2022-07-22', '14:12:20'), 'd', 40, 'm', TIMESTAMP('2021-07-11', '14:12:20'), 'The Realm Wars was a server-wide conflict where player-built kingdoms and factions engaged in epic battles, castle sieges, and territorial disputes. The event highlighted the servers political dynamics and provided a stage for large-scale PvP warfare.', 86),
(380, 'The Endless Library Exploration', 'c', TIMESTAMP('2022-05-14', '14:12:20'), 'd', 70, 'd', TIMESTAMP('2022-01-08', '14:12:20'), 'The Endless Library Exploration was an intellectual quest where players delved into a vast, labyrinthine library filled with puzzles, knowledge, and hidden lore. It tested participants wit and lore-finding abilities.', 30),
(381, 'The Nether Rollercoaster Rally', 'c', TIMESTAMP('2023-05-08', '14:12:20'), 'm', 89, 'm', TIMESTAMP('2021-08-13', '14:12:20'), 'The Nether Rollercoaster Rally was a thrilling event that challenged players to construct rollercoasters within the Nethers harsh and fiery environment. Participants designed thrilling rides, showcasing their creativity and adaptability in a challenging setting.', 44),
(382, 'Era of the Celestial Archive', 'c', TIMESTAMP('2022-03-04', '14:12:20'), 'm', 67, 'd', TIMESTAMP('2021-08-29', '14:12:20'), 'An era dedicated to the preservation of celestial knowledge and the creation of the Celestial Archive, an in-game library of celestial lore, star charts, and celestial events. Players contributed to the archive, fostering an appreciation for the servers astronomical wonders.', 39),
(384, 'Cataclysmic Reckoning', 'c', TIMESTAMP('2021-06-01', '14:12:20'), 'h', 50, 'm', TIMESTAMP('2022-12-05', '14:12:20'), 'A server-wide event where cataclysmic forces threatened to reshape the servers world. Players united to face natural disasters, apocalyptic challenges, and the emergence of powerful titans, working together to ensure the servers survival and rebirth.', 26),
(389, 'Era of Elemental Genesis', 'c', TIMESTAMP('2021-12-25', '14:12:20'), 'h', 60, 'h', TIMESTAMP('2023-04-02', '14:12:20'), 'A period that delved into the creation myths of elemental magic and the birth of elemental deities. Players participated in elemental creation quests, learned the origins of elemental magic, and explored the primordial forces that shaped the servers universe.', 8),
(390, 'Skyborne Aerial Rally', 'c', TIMESTAMP('2023-06-03', '14:12:20'), 'h', 34, 'h', TIMESTAMP('2023-01-31', '14:12:20'), 'A thrilling aerial rally that brought players together for a skyward race through intricate aerial courses. The Skyborne Aerial Rally added an exciting element of competition and flight to the servers events.', 15),
(392, 'Era of Ethereal Enigmas', 'c', TIMESTAMP('2021-09-30', '14:12:20'), 'h', 99, 'd', TIMESTAMP('2022-11-20', '14:12:20'), 'An era marked by the resurgence of ethereal beings and cosmic enigmas, influencing the servers cultural and narrative landscape. Players forged bonds with these ethereal entities, unveiling mysteries and shaping the servers mystical realm.', 46),
(393, 'Festival of Radiant Blossoms II', 'c', TIMESTAMP('2023-05-08', '14:12:20'), 'm', 82, 'h', TIMESTAMP('2023-05-06', '14:12:20'), 'A sequel to the radiant festival celebrating the servers blooming flowers and vibrant flora. Players engaged in flower-themed contests, enchanting garden displays, and quests that celebrated the world of radiant blossoms.', 6),
(400, 'Era of Cursed Chronicles II', 'c', TIMESTAMP('2023-07-13', '14:12:20'), 'd', 69, 'm', TIMESTAMP('2021-11-08', '14:12:20'), 'A continuation of the era influenced by dark and cursed forces, which haunted the servers narratives and lore. Players embarked on quests to uncover the origins of these curses and confront the dark entities that held the server in their grip.', 33),
(401, 'Timeless Timepiece Questline II', 'c', TIMESTAMP('2021-05-03', '14:12:20'), 'm', 4, 'm', TIMESTAMP('2023-08-16', '14:12:20'), 'A mystical sequel to the questline centered around a timeless timepiece that allowed players to manipulate time itself. Players embarked on time-related quests, unlocking the secrets and powers of the timepiece, and experiencing the servers narrative in a unique way.', 29),
(402, 'Celestial Dragons Ascendance II', 'c', TIMESTAMP('2023-08-14', '14:12:20'), 'h', 6, 'd', TIMESTAMP('2021-08-10', '14:12:20'), 'A sequel to the rise of the Celestial Dragon, a guardian of the servers world with the power to influence celestial events. Players embarked on quests, aligned with the dragon to harness its celestial powers, and protected the servers realm from otherworldly threats.', 85),
(403, 'Epic Siege of the Abyssal Fortress II', 'c', TIMESTAMP('2021-03-21', '14:12:20'), 'h', 59, 'h', TIMESTAMP('2022-06-15', '14:12:20'), 'A thrilling sequel to the server-wide siege of the Abyssal Fortress, an imposing structure hidden within the Abyssal Abyss. This grand siege required cooperation, strategy, and resourcefulness to conquer the fortress, resulting in epic battles and heroic achievements.', 35),
(405, 'Chronicles of the Celestial Atlas II', 'c', TIMESTAMP('2022-01-28', '14:12:20'), 'd', 96, 'd', TIMESTAMP('2022-08-13', '14:12:20'), 'A sequel to the publication of the Celestial Atlas, an in-game compendium documenting the servers celestial phenomena, constellations, and astral lore. The atlas continued to be a valuable resource for astronomers and stargazers within the server community.', 75),
(407, 'Crystal Labyrinth Expedition II', 'c', TIMESTAMP('2023-11-08', '14:12:20'), 'd', 76, 'm', TIMESTAMP('2021-06-15', '14:12:20'), 'A thrilling sequel to the expedition into the depths of the Crystal Labyrinth, an intricate maze filled with crystalline puzzles and enchantments. Players continued to venture into this labyrinth to unravel its mysteries and navigate its stunning crystalline landscapes.', 88),
(408, 'Grand Airship Regatta II', 'c', TIMESTAMP('2022-03-03', '14:12:20'), 'm', 79, 'h', TIMESTAMP('2021-12-06', '14:12:20'), 'A follow-up to the thrilling aerial rally, with new aerial courses and challenges in the Grand Airship Regatta. Players piloted their airships in a high-speed race through intricate skyward tracks, adding an exciting element of competition and flight to the servers events.', 12),
(410, 'End Crystal Placement Tournament', 'c', TIMESTAMP('2022-01-31', '14:12:20'), 'd', 75, 'h', TIMESTAMP('2021-08-06', '14:12:20'), 'The End Crystal Placement Tournament was a competitive event where players showcased their skill and precision in placing End Crystals atop obsidian pillars within the End dimension. Participants discussed tactics, the mechanics of crystal placement, and their strategies for victory.', 22),
(411, 'Minecraft Server Poetry Slam', 'c', TIMESTAMP('2021-08-24', '14:12:20'), 'h', 45, 'd', TIMESTAMP('2021-12-31', '14:12:20'), 'The Minecraft Server Poetry Slam celebrated the creative talents of players through poetic expression. Participants recited original Minecraft-themed poems, shared their inspirations, and explored the art of conveying emotions and stories through verse.', 60),
(412, 'Hidden Temple Design Challenge', 'c', TIMESTAMP('2023-04-28', '14:12:20'), 'd', 10, 'd', TIMESTAMP('2021-10-15', '14:12:20'), 'The Hidden Temple Design Challenge tasked builders with concealing intricate temples within the servers terrain. Participants discussed their approaches to hiding temples, designing traps and puzzles, and crafting engaging narratives around these secretive structures.', 10),
(413, 'Enchanted Realm Exploration', 'c', TIMESTAMP('2021-08-12', '14:12:20'), 'd', 84, 'h', TIMESTAMP('2021-04-23', '14:12:20'), 'Adventurers embarked on an extraordinary journey into the Enchanted Realm, a unique and mystical biome within the server. The event offered insights into the realms enchanting aesthetics, flora, and unique magical mechanics.', 90),
(414, 'Custom Terrain Generation Showcase', 'c', TIMESTAMP('2022-09-01', '14:12:20'), 'm', 32, 'd', TIMESTAMP('2023-02-20', '14:12:20'), 'The Custom Terrain Generation Showcase highlighted the servers innovative terrain generation features and custom landscapes. Participants explored the servers distinctive biomes, generation settings, and the art of crafting unique in-game worlds.', 85),
(416, 'Glow Lichen Cultivation Workshop', 'c', TIMESTAMP('2022-01-31', '14:12:20'), 'h', 9, 'h', TIMESTAMP('2021-08-29', '14:12:20'), 'The Glow Lichen Cultivation Workshop explored the mechanics of cultivating and growing Glow Lichen within the server. Participants discussed the applications of Glow Lichen in lighting design, architecture, and unique aesthetic choices.', 7),
(418, 'Nether Railway Construction Competition', 'c', TIMESTAMP('2021-07-10', '14:12:20'), 'm', 71, 'd', TIMESTAMP('2023-04-15', '14:12:20'), 'The Nether Railway Construction Competition challenged players to design and construct efficient railway systems within the treacherous Nether terrain. Participants discussed the intricacies of Nether railway design, safety measures, and speed optimization.', 47),
(419, 'Ender Pearl Trading Expo', 'c', TIMESTAMP('2023-04-17', '14:12:20'), 'h', 63, 'm', TIMESTAMP('2023-08-07', '14:12:20'), 'The Ender Pearl Trading Expo was a bustling marketplace where players traded Ender Pearls and shared their trading strategies, negotiations, and economic insights related to Ender Pearl commerce within the server.', 5),
(422, 'Witch Hut Investigation and Lore', 'c', TIMESTAMP('2021-06-27', '14:12:20'), 'd', 35, 'd', TIMESTAMP('2021-06-19', '14:12:20'), 'The Witch Hut Investigation and Lore event delved into the lore and history of the servers witch huts, their unique generation, and the stories behind these mystical structures. Participants shared their discoveries, interpretations, and findings.', 1),
(423, 'Server Survival Season Launch', 'c', TIMESTAMP('2021-06-23', '14:12:20'), 'h', 26, 'd', TIMESTAMP('2022-05-28', '14:12:20'), 'The Server Survival Season Launch marked the beginning of a new season of survival gameplay. Participants discussed the seasons goals, rule sets, and exciting challenges, while sharing their survival strategies and ambitions.', 32),
(424, 'End City Skyline Building Contest', 'c', TIMESTAMP('2021-04-23', '14:12:20'), 'm', 100, 'm', TIMESTAMP('2023-11-08', '14:12:20'), 'The End City Skyline Building Contest encouraged players to construct magnificent structures within the servers End Cities. Participants explored End City aesthetics, building techniques, and the narrative significance of these unique locations.', 62),
(430, 'Minecraft Artistic Showcase', 'c', TIMESTAMP('2022-03-09', '14:12:20'), 'd', 90, 'd', TIMESTAMP('2023-03-19', '14:12:20'), 'The Minecraft Artistic Showcase displayed the servers most breathtaking artistic creations. Participants discussed their artistic processes, inspiration, and techniques, showcasing the servers commitment to artistic expression within the game.', 75),
(431, 'Nether Geology Discovery', 'c', TIMESTAMP('2023-04-24', '14:12:20'), 'd', 66, 'd', TIMESTAMP('2023-06-22', '14:12:20'), 'Adventurers embarked on a Nether Geology Discovery expedition to uncover the secrets of the Nethers geological features, including the unique composition, formations, and geological phenomena found within the Nether dimension.', 36),
(434, 'Minecraft Server Mythology Symposium', 'c', TIMESTAMP('2023-08-10', '14:12:20'), 'd', 49, 'h', TIMESTAMP('2023-09-04', '14:12:20'), 'The Minecraft Server Mythology Symposium celebrated the servers unique mythology, legends, and folklore. Participants discussed server-specific myths, legends, and their significance in shaping the servers cultural narratives.', 52),
(438, 'Minecraft Server Artisan Expo', 'c', TIMESTAMP('2022-11-25', '14:12:20'), 'h', 93, 'm', TIMESTAMP('2021-09-07', '14:12:20'), 'The Minecraft Server Artisan Expo celebrated the servers most skilled artisans, showcasing their creations, discussing their creative inspirations, and exploring the servers commitment to the art of crafting.', 73),
(440, 'The Servers Legendary Beasts', 'c', TIMESTAMP('2021-09-06', '14:12:20'), 'm', 59, 'd', TIMESTAMP('2023-07-13', '14:12:20'), 'The Servers Legendary Beasts event explored the lore, history, and significance of the servers legendary creatures and entities. Participants shared stories, legends, and interpretations of these mythical beings.', 47),
(444, 'The Hidden Temple Adventure', 'c', TIMESTAMP('2023-02-04', '14:12:20'), 'm', 91, 'm', TIMESTAMP('2022-02-22', '14:12:20'), 'The Hidden Temple Adventure was an exploration quest where players ventured deep into mystical temples hidden across the server. They unraveled ancient mysteries, deciphered cryptic puzzles, and faced guardians to claim valuable artifacts.', 83),
(446, 'The Constructive Contest', 'c', TIMESTAMP('2022-10-18', '14:12:20'), 'd', 9, 'm', TIMESTAMP('2022-09-24', '14:12:20'), 'The Constructive Contest was a building competition where players collaborated to construct awe-inspiring structures with specific materials and themes. Teams showcased their creativity and teamwork by designing impressive architectural wonders.', 35),
(447, 'The Monumental Maze Race', 'c', TIMESTAMP('2021-08-27', '14:12:20'), 'h', 21, 'h', TIMESTAMP('2021-10-23', '14:12:20'), 'The Monumental Maze Race was a high-speed challenge where players raced through gigantic, intricate mazes filled with surprises and puzzles. The event tested participants agility, problem-solving skills, and determination.', 68),
(448, 'The Elemental Gauntlet', 'c', TIMESTAMP('2023-09-02', '14:12:20'), 'h', 74, 'm', TIMESTAMP('2021-10-26', '14:12:20'), 'The Elemental Gauntlet was an intense PvP competition where players wielded unique elemental weapons and faced off in fast-paced, element-themed battles. Teams battled for supremacy, using their mastery of earth, water, fire, and air elements.', 37),
(449, 'The Grand Oceanic Regatta', 'c', TIMESTAMP('2022-01-07', '14:12:20'), 'm', 9, 'd', TIMESTAMP('2022-02-02', '14:12:20'), 'The Grand Oceanic Regatta was a spectacular sailing race that took place on the vast servers ocean. Players crafted magnificent ships and navigated through perilous waters, racing against the elements and one another.', 22),
(450, 'The Hidden Village Discovery', 'c', TIMESTAMP('2023-09-21', '14:12:20'), 'h', 76, 'm', TIMESTAMP('2021-06-05', '14:12:20'), 'The Hidden Village Discovery was a community event where players worked together to uncover secret, hidden villages scattered across the server. Explorers located these settlements and revitalized them, breathing life into forgotten communities.', 35),
(451, 'The Survivalist Showdown', 'c', TIMESTAMP('2021-10-31', '14:12:20'), 'm', 5, 'd', TIMESTAMP('2022-11-18', '14:12:20'), 'The Survivalist Showdown was an ultimate test of survival skills, dropping players into a challenging wilderness with limited supplies. They had to endure harsh environments, gather resources, and prove their resilience in a survival competition.', 5),
(454, 'The Enchanted Archipelago', 'c', TIMESTAMP('2021-03-07', '14:12:20'), 'm', 53, 'd', TIMESTAMP('2021-09-21', '14:12:20'), 'The Enchanted Archipelago was an exploration quest that sent players to discover mystical islands hidden throughout the server. These islands were filled with magical creatures, puzzles, and secrets waiting to be uncovered.', 73),
(455, 'The Biome Battle Royale', 'c', TIMESTAMP('2023-09-12', '14:12:20'), 'h', 89, 'd', TIMESTAMP('2021-11-03', '14:12:20'), 'The Biome Battle Royale was a large-scale PvP competition where players from different biomes fought for dominance. Teams representing various biomes engaged in epic battles, with distinct landscapes providing tactical advantages.', 9),
(456, 'The Superhero Showcase', 'c', TIMESTAMP('2021-04-17', '14:12:20'), 'h', 100, 'd', TIMESTAMP('2023-01-14', '14:12:20'), 'The Superhero Showcase was an event where players designed and presented their own custom superhero or supervillain characters within the servers lore. Participants brought their characters to life through narratives, costumes, and superpowers.', 82),
(457, 'The Great Treehouse Village', 'c', TIMESTAMP('2021-05-17', '14:12:20'), 'm', 57, 'd', TIMESTAMP('2021-07-08', '14:12:20'), 'The Great Treehouse Village was a massive collaboration where players constructed interconnected treehouses in a towering forest. It was a celebration of the servers sense of community and the ability to create thriving arboreal societies.', 41),
(458, 'The Ancient Ruins Race', 'c', TIMESTAMP('2023-03-02', '14:12:20'), 'h', 42, 'h', TIMESTAMP('2022-08-14', '14:12:20'), 'The Ancient Ruins Race was a thrilling competition where players raced through a network of server-generated ruins, solving puzzles, battling mobs, and claiming valuable artifacts in a quest for victory.', 85),
(459, 'The Biome Swap Marathon', 'c', TIMESTAMP('2021-09-18', '14:12:20'), 'h', 81, 'h', TIMESTAMP('2022-07-23', '14:12:20'), 'The Biome Swap Marathon was an endurance challenge where players continuously moved between biomes, adapting to each environments unique challenges. The event celebrated players ability to master various landscapes.', 4),
(461, 'The Elemental Forge', 'c', TIMESTAMP('2023-06-17', '14:12:20'), 'h', 78, 'm', TIMESTAMP('2022-06-21', '14:12:20'), 'The Elemental Forge was a crafting competition that required participants to forge unique elemental-themed items using specialized materials. Crafters showcased their creativity and resourcefulness to create powerful artifacts.', 23),
(462, 'The Abandoned Mine Expedition', 'c', TIMESTAMP('2023-07-17', '14:12:20'), 'd', 12, 'm', TIMESTAMP('2023-02-11', '14:12:20'), 'The Abandoned Mine Expedition sent players into the depths of abandoned mines, where they uncovered hidden treasures, battled cave dwellers, and navigated treacherous tunnels. The event celebrated spelunking and exploration.', 74),
(463, 'The Redstone Arcade', 'c', TIMESTAMP('2021-05-25', '14:12:20'), 'h', 1, 'h', TIMESTAMP('2022-06-21', '14:12:20'), 'The Redstone Arcade was a fun-filled event where players designed and presented custom redstone-powered arcade games. Attendees enjoyed an array of mini-games, puzzles, and challenges that showcased the servers gaming community.', 19),
(467, 'The Mythical Creatures Parade', 'c', TIMESTAMP('2022-02-17', '14:12:20'), 'm', 25, 'd', TIMESTAMP('2021-03-30', '14:12:20'), 'The Mythical Creatures Parade was a grand parade of players dressed as their favorite mythical creatures, from dragons to unicorns. It was a fantastical event celebrating creativity and the enchanting world of Minecraft.', 61),
(468, 'The Dungeon Crawl Challenge', 'c', TIMESTAMP('2022-11-26', '14:12:20'), 'h', 100, 'h', TIMESTAMP('2023-06-19', '14:12:20'), 'The Dungeon Crawl Challenge was an epic quest that required players to brave perilous dungeons filled with traps, puzzles, and deadly creatures. They explored the depths of these dungeons in search of valuable loot and hidden secrets.', 1),
(469, 'The Underwater Monument Relay', 'c', TIMESTAMP('2022-01-26', '14:12:20'), 'd', 53, 'h', TIMESTAMP('2021-08-31', '14:12:20'), 'The Underwater Monument Relay was an aquatic race where teams navigated underwater monuments, battling guardian mobs and collecting treasure along the way. It celebrated both aquatic exploration and teamwork.', 90),
(470, 'The Enchanted Book Club', 'c', TIMESTAMP('2021-08-06', '14:12:20'), 'h', 31, 'h', TIMESTAMP('2022-12-20', '14:12:20'), 'The Enchanted Book Club was a literary gathering where players shared their favorite enchanted books and discussed enchanting techniques and lore. It was a celebration of Minecrafts enchantment system.', 56),
(474, 'The Elemental Fusion Challenge', 'c', TIMESTAMP('2021-05-20', '14:12:20'), 'm', 25, 'd', TIMESTAMP('2022-09-24', '14:12:20'), 'The Elemental Fusion Challenge was a creative event where players combined elements from different biomes to design unique, hybrid landscapes. It celebrated innovation and the blending of diverse environments.', 35),
(475, 'The Nether Beast Hunt', 'c', TIMESTAMP('2021-10-01', '14:12:20'), 'm', 21, 'h', TIMESTAMP('2022-11-27', '14:12:20'), 'The Nether Beast Hunt was a high-risk adventure that saw players venturing into the Nether to track down and battle formidable Nether creatures. They collected rare materials, such as Nether skulls and ancient bones, in exchange for prestige.', 88),
(477, 'The Redstone Rube Goldberg Challenge', 'c', TIMESTAMP('2023-03-04', '14:12:20'), 'd', 32, 'm', TIMESTAMP('2022-12-05', '14:12:20'), 'The Redstone Rube Goldberg Challenge was a competition where participants constructed elaborate Rube Goldberg machines using redstone and other components. Teams displayed their mastery of redstone mechanics in impressive contraptions.', 83),
(478, 'The Elemental Masters Tournament', 'c', TIMESTAMP('2022-04-26', '14:12:20'), 'h', 66, 'd', TIMESTAMP('2023-07-10', '14:12:20'), 'The Elemental Masters Tournament was a tournament-style competition that pitted players against each other, each representing one of the four elements (earth, water, fire, air). Competitors showcased their mastery of elemental powers in duels and challenges.', 52),
(482, 'The Mythical Lore Symposium', 'c', TIMESTAMP('2022-12-26', '14:12:20'), 'd', 91, 'h', TIMESTAMP('2023-01-05', '14:12:20'), 'The Mythical Lore Symposium was a scholarly gathering where players discussed and shared stories, legends, and myths from their in-game experiences. It was a celebration of the servers rich lore and storytelling.', 25),
(487, 'The Mythic Pet Parade', 'c', TIMESTAMP('2022-08-16', '14:12:20'), 'h', 87, 'h', TIMESTAMP('2021-04-26', '14:12:20'), 'The Mythic Pet Parade was a whimsical event where players dressed up their tamed Minecraft pets as mythical creatures and paraded them through the server. It was a delightful showcase of creativity and pets.', 75),
(488, 'The Elemental Battlegrounds', 'c', TIMESTAMP('2023-07-06', '14:12:20'), 'h', 56, 'h', TIMESTAMP('2022-02-06', '14:12:20'), 'The Elemental Battlegrounds was an intense team competition where players battled in arena-style fights, each team representing one of the four elements (earth, water, fire, air). It was a thrilling showcase of strategy and combat skills.', 70),
(490, 'The Endless Labyrinth Challenge', 'c', TIMESTAMP('2021-05-16', '14:12:20'), 'h', 19, 'h', TIMESTAMP('2022-05-29', '14:12:20'), 'The Endless Labyrinth Challenge was a race through a maze that continuously shifted and reconfigured itself. Participants had to rely on quick thinking and adaptability to overcome the ever-changing labyrinth.', 45),
(491, 'The Biome Harmony Concert', 'c', TIMESTAMP('2021-03-10', '14:12:20'), 'd', 80, 'd', TIMESTAMP('2022-09-15', '14:12:20'), 'The Biome Harmony Concert was a musical event where players from various biomes and regions gathered to perform music, showcasing the servers cultural diversity and the power of music to unite.', 88),
(493, 'The Mythic Art Showcase', 'c', TIMESTAMP('2021-03-16', '14:12:20'), 'h', 77, 'd', TIMESTAMP('2022-07-01', '14:12:20'), 'The Mythic Art Showcase was an art exhibition where players shared their artistic interpretations of mythical creatures, legends, and lore from the servers history. It celebrated creativity and artistic expression.', 10),
(495, 'The Dungeon Delvers Challenge', 'c', TIMESTAMP('2022-04-25', '14:12:20'), 'm', 26, 'm', TIMESTAMP('2022-06-06', '14:12:20'), 'The Dungeon Delvers Challenge was an intense quest where players delved into custom-designed dungeons filled with traps, puzzles, and formidable foes. They solved mysteries and conquered challenges for glory and rewards.', 67),
(500, 'The Server-Wide Festival of Seasons', 'c', TIMESTAMP('2022-05-13', '14:12:20'), 'd', 49, 'h', TIMESTAMP('2022-02-24', '14:12:20'), 'The Server-Wide Festival of Seasons was a celebration of the servers changing biomes and landscapes throughout the year. It featured seasonal-themed events, decorations, and activities, providing a sense of cyclical renewal.', 15),
(501, 'The Race Across Realms', 'c', TIMESTAMP('2023-07-04', '14:12:20'), 'h', 7, 'd', TIMESTAMP('2023-04-22', '14:12:20'), 'The Race Across Realms was an extraordinary race that took players through various custom realms inspired by different server themes. It tested their adaptability and navigational skills as they crossed through diverse environments.', 53),
(502, 'The Elemental Fusion Festival', 'c', TIMESTAMP('2023-07-30', '14:12:20'), 'd', 38, 'h', TIMESTAMP('2022-10-17', '14:12:20'), 'The Elemental Fusion Festival was a collaborative event where players combined elements from distinct biomes to create hybrid landscapes that represented harmony and unity among the servers diverse biomes.', 21),
(503, 'Aquatic Biome Exploration Expedition', 'c', TIMESTAMP('2022-04-18', '14:12:20'), 'h', 28, 'm', TIMESTAMP('2022-08-07', '14:12:20'), 'The Aquatic Biome Exploration Expedition invited adventurers to explore the servers vast aquatic biomes, including oceans, rivers, and coral reefs. Participants discussed the diverse marine life, underwater ecosystems, and the challenges and rewards of underwater exploration.', 25),
(504, 'Minecraft Server Collaborative Art Project', 'c', TIMESTAMP('2023-02-01', '14:12:20'), 'h', 23, 'd', TIMESTAMP('2022-05-16', '14:12:20'), 'The Minecraft Server Collaborative Art Project brought together players to collaborate on a massive art project within the server. Participants discussed their roles in the project, artistic themes, and the significance of working as a team to create large-scale in-game art.', 64),
(505, 'Nether Portal Labyrinth Challenge', 'c', TIMESTAMP('2023-01-19', '14:12:20'), 'd', 2, 'h', TIMESTAMP('2021-04-15', '14:12:20'), 'The Nether Portal Labyrinth Challenge was a thrilling competition where players navigated a labyrinthine network of Nether portals. Participants discussed their strategies, problem-solving skills, and the intricacies of portal navigation in the Nether.', 4),
(506, 'Minecraft Server Community Awards Ceremony', 'c', TIMESTAMP('2022-01-31', '14:12:20'), 'h', 77, 'd', TIMESTAMP('2023-08-28', '14:12:20'), 'The Minecraft Server Community Awards Ceremony recognized and celebrated outstanding contributions and achievements within the servers community. Participants discussed the significance of community involvement, the impact of award-winners, and the spirit of recognition.', 25),
(507, 'Netherwart Farming and Alchemy Workshop', 'c', TIMESTAMP('2021-12-31', '14:12:20'), 'm', 6, 'd', TIMESTAMP('2023-03-13', '14:12:20'), 'The Netherwart Farming and Alchemy Workshop delved into the art of farming Netherwart and the alchemical applications of Nether materials. Participants discussed Nether farming techniques, potion brewing, and the servers approach to alchemy.', 18),
(510, 'End Gateway Exploration', 'c', TIMESTAMP('2021-06-17', '14:12:20'), 'd', 11, 'h', TIMESTAMP('2022-11-14', '14:12:20'), 'The End Gateway Exploration event took players to the far reaches of the End dimension, where they encountered the enigmatic End Gateway portals. Participants discussed the mechanics of these portals, their significance, and their role in the servers lore.', 2),
(512, 'Minecraft Server Environmental Conservation Symposium', 'c', TIMESTAMP('2023-08-19', '14:12:20'), 'd', 83, 'd', TIMESTAMP('2023-02-11', '14:12:20'), 'The Minecraft Server Environmental Conservation Symposium focused on environmental preservation and sustainable in-game practices within the server. Participants discussed renewable resource management, conservation initiatives, and their role in preserving the servers virtual ecosystems.', 65),
(513, 'Minecraft Classic Era Retrospective', 'c', TIMESTAMP('2021-03-19', '14:12:20'), 'd', 13, 'h', TIMESTAMP('2022-05-20', '14:12:20'), 'The Minecraft Classic Era Retrospective celebrated the early days of the server, reflecting on its origins, historical landmarks, and the contributions of long-standing community members. Participants discussed their experiences and contributions during this foundational period.', 66),
(514, 'Custom Biome Creation Showcase', 'c', TIMESTAMP('2022-05-12', '14:12:20'), 'h', 76, 'h', TIMESTAMP('2022-09-01', '14:12:20'), 'The Custom Biome Creation Showcase highlighted the servers custom biome creation features. Participants explored the process of designing and implementing custom biomes, discussing biome aesthetics, unique terrain, and world-building techniques.', 80),
(515, 'Ancient Ruins Restoration Project', 'c', TIMESTAMP('2022-05-18', '14:12:20'), 'd', 47, 'd', TIMESTAMP('2023-03-27', '14:12:20'), 'The Ancient Ruins Restoration Project tasked players with restoring and preserving ancient ruins scattered throughout the server. Participants discussed the historical significance of these ruins, the restoration process, and the role of preserving server history.', 68),
(517, 'Minecraft Server Art Gallery Opening', 'c', TIMESTAMP('2022-05-27', '14:12:20'), 'd', 30, 'h', TIMESTAMP('2021-07-27', '14:12:20'), 'The Minecraft Server Art Gallery Opening showcased the servers most captivating in-game artworks. Participants discussed their artistic inspirations, artistic techniques, and the role of art within the servers cultural landscape.', 32),
(520, 'Nether Castle Architecture Symposium', 'c', TIMESTAMP('2021-05-27', '14:12:20'), 'd', 37, 'm', TIMESTAMP('2023-06-19', '14:12:20'), 'The Nether Castle Architecture Symposium celebrated the architectural styles and designs of Nether castles within the server. Participants explored the aesthetics, layout, and lore of these structures, discussing the cultural significance of Nether castles.', 47),
(522, 'Minecraft Server Music Festival', 'c', TIMESTAMP('2023-03-21', '14:12:20'), 'd', 76, 'd', TIMESTAMP('2021-07-16', '14:12:20'), 'The Minecraft Server Music Festival featured live performances by the servers musicians and composers. Participants discussed their musical journeys, original compositions, and the role of music in the servers culture.', 82),
(529, 'Minecraft Server Lore Symposium', 'c', TIMESTAMP('2022-10-03', '14:12:20'), 'h', 53, 'h', TIMESTAMP('2022-11-20', '14:12:20'), 'The Minecraft Server Lore Symposium was a gathering of lore enthusiasts who explored the servers rich narrative history. Participants shared interpretations, theories, and discussions about the servers lore and storytelling elements.', 36),
(530, 'Biome-Specific Agricultural Showcase', 'c', TIMESTAMP('2022-02-11', '14:12:20'), 'h', 68, 'h', TIMESTAMP('2023-01-05', '14:12:20'), 'The Biome-Specific Agricultural Showcase celebrated the servers diverse agricultural practices, from crop cultivation to animal husbandry. Participants discussed biome-specific farming challenges, innovations, and the role of agriculture in server communities.', 18),
(532, 'The Elemental Crystals Quest', 'c', TIMESTAMP('2022-01-18', '14:12:20'), 'h', 52, 'm', TIMESTAMP('2021-10-12', '14:12:20'), 'The Elemental Crystals Quest was an epic adventure that tasked players with discovering and harnessing the power of four elemental crystals hidden across the server. Each crystal granted unique abilities and was tied to specific biomes, adding an extra layer of strategy to the quest. The event celebrated the servers diverse environments and exploration.', 31),
(534, 'The Skyblock Survival Tournament', 'c', TIMESTAMP('2021-12-17', '14:12:20'), 'm', 32, 'm', TIMESTAMP('2022-07-01', '14:12:20'), 'The Skyblock Survival Tournament was a competitive challenge for skyblock players. Teams competed to see who could thrive the longest on their isolated islands, demonstrating resourcefulness, island design, and efficient resource management.', 44),
(536, 'The Nether Rush Challenge', 'c', TIMESTAMP('2022-03-03', '14:12:20'), 'm', 16, 'd', TIMESTAMP('2022-03-13', '14:12:20'), 'The Nether Rush Challenge was a speedrunning competition where players aimed to reach the Nethers heart as quickly as possible. Participants strategized, gathered resources, and fought Nether mobs to complete the challenge in record time.', 5),
(537, 'The Legendary Artifacts Exhibition', 'c', TIMESTAMP('2023-01-27', '14:12:20'), 'h', 4, 'h', TIMESTAMP('2022-10-05', '14:12:20'), 'The Legendary Artifacts Exhibition was a showcase of rare and valuable items collected by players over the years. It featured legendary gear, ancient artifacts, and unique enchanted items, highlighting the servers commitment to treasure hunting and exploration.', 77),
(540, 'The Crystal Caverns Exploration', 'c', TIMESTAMP('2023-02-03', '14:12:20'), 'd', 26, 'm', TIMESTAMP('2022-10-08', '14:12:20'), 'The Crystal Caverns Exploration sent players deep into a vast underground network of crystalline caves. They uncovered rare gems, solved crystal-themed puzzles, and battled underground monsters in a quest to collect valuable crystal resources.', 77),
(542, 'The Mythic Carnival Extravaganza', 'c', TIMESTAMP('2021-11-19', '14:12:20'), 'm', 31, 'd', TIMESTAMP('2022-02-01', '14:12:20'), 'The Mythic Carnival Extravaganza was a vibrant carnival showcasing minigames, amusement rides, and live performances inspired by the servers lore and legends. It brought together players from all corners of the server for a fun-filled event.', 28),
(544, 'The Mystical Island Discovery', 'c', TIMESTAMP('2022-12-13', '14:12:20'), 'd', 2, 'm', TIMESTAMP('2021-08-31', '14:12:20'), 'The Mystical Island Discovery sent players on an exploration of mystical islands hidden across the server. These islands were filled with puzzles, enigmatic structures, and magical creatures, offering rewards to those who solved their mysteries.', 5),
(545, 'The Redstone Wonderland', 'c', TIMESTAMP('2023-04-29', '14:12:20'), 'm', 45, 'd', TIMESTAMP('2021-05-23', '14:12:20'), 'The Redstone Wonderland was an immersive event where players transformed a dedicated area into a mesmerizing redstone-powered wonderland. The event featured redstone-powered light displays, interactive attractions, and a showcase of redstone engineering.', 20),
(547, 'The Desert Mirage Discovery', 'c', TIMESTAMP('2023-01-02', '14:12:20'), 'd', 67, 'h', TIMESTAMP('2021-11-02', '14:12:20'), 'The Desert Mirage Discovery was a quest that led players through vast deserts filled with mirages, illusions, and hidden treasures. Explorers had to navigate the deceptive landscapes and unveil the secrets concealed within.', 33),
(548, 'The Enchanted Parkour Challenge', 'c', TIMESTAMP('2021-08-14', '14:12:20'), 'm', 1, 'm', TIMESTAMP('2023-09-04', '14:12:20'), 'The Enchanted Parkour Challenge was an intense parkour competition set in a custom-designed enchanted forest biome. Participants raced through the mystical forest, overcoming challenging jumps, obstacles, and illusions to reach the finish line.', 16),
(549, 'The Elemental Altar Convergence', 'c', TIMESTAMP('2023-05-31', '14:12:20'), 'h', 88, 'h', TIMESTAMP('2022-03-25', '14:12:20'), 'The Elemental Altar Convergence was a collaborative effort where players built elemental altars in various biomes. These altars, when activated, produced unique effects or blessings based on the corresponding element, emphasizing the servers sense of unity and shared purpose.', 89),
(555, 'The Server-Wide Myths and Legends Expo', 'c', TIMESTAMP('2022-10-14', '14:12:20'), 'm', 61, 'd', TIMESTAMP('2022-09-28', '14:12:20'), 'The Server-Wide Myths and Legends Expo was an exhibition of the servers most captivating myths and legends, brought to life through storytelling, art, and interactive displays. It celebrated the servers lore and narrative traditions.', 44),
(556, 'The Jungle Canopy Race', 'c', TIMESTAMP('2022-09-29', '14:12:20'), 'm', 27, 'd', TIMESTAMP('2021-08-06', '14:12:20'), 'The Jungle Canopy Race was an exhilarating competition where players raced along treetop canopy walkways in dense jungle biomes. They had to navigate the intricate canopy network to reach the finish line, demonstrating agility and skill.', 74),
(557, 'The Elemental Elixir Symposium', 'c', TIMESTAMP('2022-05-20', '14:12:20'), 'h', 26, 'h', TIMESTAMP('2022-10-24', '14:12:20'), 'The Elemental Elixir Symposium was a gathering where players exchanged knowledge about brewing elemental elixirs, concoctions that harnessed the power of earth, water, fire, and air. The event celebrated alchemical expertise and the servers fascination with the mystical.', 82),
(559, 'The Elemental Throne Coronation', 'c', TIMESTAMP('2021-03-27', '14:12:20'), 'h', 51, 'd', TIMESTAMP('2021-07-24', '14:12:20'), 'The Elemental Throne Coronation was a ceremonial event where players declared the rulers of elemental-themed realms, sitting on grand elemental thrones in custom-built domains. The coronation celebrated leadership and the diverse server regions.', 58),
(560, 'The Endless Labyrinth Race', 'c', TIMESTAMP('2021-09-24', '14:12:20'), 'm', 86, 'm', TIMESTAMP('2023-02-08', '14:12:20'), 'The Endless Labyrinth Race was a high-speed competition through continuously shifting labyrinths. Players navigated through intricate mazes that reconfigured as they moved, relying on quick thinking and adaptability to reach the finish.', 85),
(562, 'Player-Hosted Art Show', 'c', TIMESTAMP('2021-11-23', '14:12:20'), 'm', 20, 'm', TIMESTAMP('2023-01-22', '14:12:20'), 'In the Player-Hosted Art Show, talented server artists and builders showcased their personal artistic works. Participants shared their artistic inspirations, techniques, and personal journeys through art, adding a touch of creativity to the servers cultural landscape.', 73),
(564, 'Minecraft Creative Corner: A Creators Perspective', 'c', TIMESTAMP('2021-06-22', '14:12:20'), 'm', 19, 'd', TIMESTAMP('2022-01-29', '14:12:20'), 'In the Minecraft Creative Corner: A Creators Perspective event, builders and content creators discussed their personal experiences with creating Minecraft content, from map-making to YouTube series. Participants shared insights, challenges, and the creative processes that brought their ideas to life.', 39),
(568, 'Survival Challenges: A Personal Triumph', 'c', TIMESTAMP('2021-08-16', '14:12:20'), 'h', 10, 'd', TIMESTAMP('2021-05-11', '14:12:20'), 'In the Survival Challenges: A Personal Triumph event, players discussed their most memorable survival challenges and the sense of accomplishment that came with overcoming them. Participants shared their personal strategies, survival stories, and lessons learned.', 36),
(574, 'Community Show and Tell: My Unique Build', 'c', TIMESTAMP('2021-03-06', '14:12:20'), 'h', 25, 'h', TIMESTAMP('2023-10-14', '14:12:20'), 'Community Show and Tell: My Unique Build allowed players to share their unique in-game creations. Participants discussed their personal inspirations, building techniques, and the stories behind their individual masterpieces.', 66),
(575, 'Minecraft Life Lessons: Crafting in the Real World', 'c', TIMESTAMP('2021-08-24', '14:12:20'), 'h', 88, 'h', TIMESTAMP('2022-05-02', '14:12:20'), 'Minecraft Life Lessons: Crafting in the Real World explored how Minecraft skills and strategies applied to players real lives. Participants shared personal stories of how the games problem-solving, teamwork, and creativity had an impact beyond the virtual realm.', 91),
(576, 'Player-Hosted Parkour Challenge', 'c', TIMESTAMP('2021-06-07', '14:12:20'), 'd', 98, 'm', TIMESTAMP('2022-10-17', '14:12:20'), 'In the Player-Hosted Parkour Challenge, parkour enthusiasts hosted thrilling courses for fellow players. Participants discussed their personal parkour experiences, their paths to mastery, and the adrenaline of conquering challenging jumps.', 37),
(577, 'The Art of Community: A Personal Perspective', 'c', TIMESTAMP('2023-01-28', '14:12:20'), 'h', 19, 'd', TIMESTAMP('2021-10-04', '14:12:20'), 'The Art of Community: A Personal Perspective event featured players sharing their personal experiences as active community members. Participants discussed their roles, contributions, and the satisfaction of being part of a vibrant in-game society.', 25),
(578, 'Minecraft Storytellers: Personal Narratives', 'c', TIMESTAMP('2023-05-15', '14:12:20'), 'd', 40, 'm', TIMESTAMP('2021-09-30', '14:12:20'), 'The Minecraft Storytellers: Personal Narratives event allowed players to share their personal stories and experiences within the server. Participants revealed the narratives that shaped their Minecraft journey, from humble beginnings to epic adventures.', 5),
(579, 'Player-Hosted Skin Fashion Show', 'c', TIMESTAMP('2021-06-27', '14:12:20'), 'm', 71, 'm', TIMESTAMP('2021-12-31', '14:12:20'), 'The Player-Hosted Skin Fashion Show celebrated players creative skins, where they showcased personal avatars and discussed the inspiration behind their designs. Participants shared their personal style choices and the stories told through their skins.', 50),
(581, 'The Servers Coffee Shop: Personal Conversations', 'c', TIMESTAMP('2021-07-07', '14:12:20'), 'h', 92, 'h', TIMESTAMP('2021-04-01', '14:12:20'), 'The Servers Coffee Shop: Personal Conversations provided a virtual space for players to engage in personal, relaxed conversations. Participants discussed their personal interests, hobbies, and got to know their fellow players on a more intimate level.', 76),
(582, 'Player-Hosted Maze Challenge', 'c', TIMESTAMP('2023-01-06', '14:12:20'), 'h', 81, 'd', TIMESTAMP('2022-12-13', '14:12:20'), 'The Player-Hosted Maze Challenge was a maze-building competition where players created intricate labyrinthine puzzles. Participants discussed their personal approaches to maze design and the thrill of crafting puzzles that left others bewildered.', 50),
(583, 'Minecraft Travel Diaries: Personal Journeys', 'c', TIMESTAMP('2023-11-01', '14:12:20'), 'h', 57, 'm', TIMESTAMP('2021-10-27', '14:12:20'), 'Minecraft Travel Diaries: Personal Journeys allowed players to share their personal travel diaries, recounting adventures, discoveries, and the emotions they experienced while exploring the servers landscapes.', 61),
(584, 'Minecraft Recipe Exchange: Personal Favorites', 'c', TIMESTAMP('2022-10-05', '14:12:20'), 'd', 72, 'm', TIMESTAMP('2023-07-04', '14:12:20'), 'The Minecraft Recipe Exchange: Personal Favorites was a sharing event where players discussed their personal favorite recipes and culinary tips. Participants revealed the recipes that resonated with them and the stories behind their choices.', 29),
(585, 'The Servers Book Club: Personal Reading Experiences', 'c', TIMESTAMP('2021-09-27', '14:12:20'), 'd', 100, 'd', TIMESTAMP('2022-10-14', '14:12:20'), 'The Servers Book Club: Personal Reading Experiences was a literary event where players discussed the books they had read within the server. Participants shared their personal reactions, interpretations, and the impact of in-game literature.', 28),
(594, 'The Mythic Beacon Rally', 'c', TIMESTAMP('2022-09-04', '14:12:20'), 'h', 64, 'h', TIMESTAMP('2021-05-18', '14:12:20'), 'The Mythic Beacon Rally was an event where players embarked on a journey to collect rare and mystical beacon blocks scattered across the server. These beacons possessed unique powers and could only be found in hidden, mythical locations.', 31),
(597, 'The Ethereal Glider Gala', 'c', TIMESTAMP('2022-05-27', '14:12:20'), 'h', 97, 'h', TIMESTAMP('2021-12-02', '14:12:20'), 'The Ethereal Glider Gala was a spectacular event where players showcased their elytra flying skills while exploring a custom-built aerial city. The event combined breathtaking aerial acrobatics with the beauty of a floating metropolis.', 54),
(598, 'The Elemental Cuisine Extravaganza', 'c', TIMESTAMP('2021-04-24', '14:12:20'), 'm', 11, 'h', TIMESTAMP('2021-04-01', '14:12:20'), 'The Elemental Cuisine Extravaganza was a culinary competition where players prepared and presented dishes that represented the four elements (earth, water, fire, air). Chefs incorporated server biomes and their unique flavors into their creations.', 21),
(600, 'The Sky Island Diplomacy Summit', 'c', TIMESTAMP('2021-07-12', '14:12:20'), 'h', 42, 'd', TIMESTAMP('2022-04-28', '14:12:20'), 'The Sky Island Diplomacy Summit brought together players living on sky islands to discuss shared resources, trade agreements, and territorial disputes. It celebrated the unique challenges and opportunities presented by skyblock gameplay.', 40),
(601, 'The Elemental Spirit Carnival', 'c', TIMESTAMP('2021-12-02', '14:12:20'), 'd', 91, 'h', TIMESTAMP('2022-11-08', '14:12:20'), 'The Elemental Spirit Carnival was a festive event where players celebrated the spirits of earth, water, fire, and air through traditional games, rituals, and performances. It showcased cultural diversity and reverence for the elements.', 49),
(602, 'The Realm Mural Masterpiece', 'c', TIMESTAMP('2022-09-04', '14:12:20'), 'm', 0, 'm', TIMESTAMP('2022-11-26', '14:12:20'), 'The Realm Mural Masterpiece was a community art project where players collaborated to create a massive mural representing different server realms and their unique attributes. It celebrated community unity and artistic creativity.', 48),
(603, 'The Enchanted Banquet', 'c', TIMESTAMP('2023-08-13', '14:12:20'), 'h', 65, 'h', TIMESTAMP('2021-10-22', '14:12:20'), 'The Enchanted Banquet was a grand feast where players dined in a specially designed enchanting garden filled with magical flora and fauna. It celebrated enchantment and the servers lush and enchanted landscapes.', 13),
(605, 'The Elemental Lighthouse Showcase', 'c', TIMESTAMP('2022-02-11', '14:12:20'), 'd', 95, 'h', TIMESTAMP('2023-05-06', '14:12:20'), 'The Elemental Lighthouse Showcase was an exhibition of lighthouses built by players in various biomes. Each lighthouse had a unique design and purpose, serving as beacons and landmarks that guided travelers.', 24),
(614, 'The Elemental Themed Parkour Race', 'c', TIMESTAMP('2023-07-06', '14:12:20'), 'h', 93, 'd', TIMESTAMP('2021-11-13', '14:12:20'), 'The Elemental Themed Parkour Race was an exhilarating parkour competition set in biomes representing the four elements. Players navigated challenging parkour courses inspired by the unique terrain and characteristics of each biome.', 92),
(615, 'The Enchanted Sculpture Gallery', 'c', TIMESTAMP('2023-08-03', '14:12:20'), 'm', 58, 'm', TIMESTAMP('2021-11-10', '14:12:20'), 'The Enchanted Sculpture Gallery was an art exhibition where players displayed sculptures crafted from Minecraft blocks. The sculptures depicted mythical creatures, server legends, and iconic landmarks.', 92),
(618, 'The Elemental Garden Sanctuary', 'c', TIMESTAMP('2022-11-25', '14:12:20'), 'd', 51, 'm', TIMESTAMP('2023-09-23', '14:12:20'), 'The Elemental Garden Sanctuary was a serene and contemplative space where players designed and tended to gardens dedicated to the four elements. It was a celebration of mindfulness, nature, and tranquility.', 92),
(619, 'The Elemental Disc Golf Challenge', 'c', TIMESTAMP('2021-12-07', '14:12:20'), 'm', 12, 'd', TIMESTAMP('2021-11-02', '14:12:20'), 'The Elemental Disc Golf Challenge was a unique take on disc golf, with players aiming to throw enchanted discs into elemental-themed baskets set across diverse biomes. It combined precision and creativity in a playful event.', 4),
(620, 'The Grand Elemental Masquerade Ball', 'c', TIMESTAMP('2021-04-16', '14:12:20'), 'm', 64, 'h', TIMESTAMP('2021-08-21', '14:12:20'), 'The Grand Elemental Masquerade Ball was a magnificent ballroom event where players donned enchanting masks representing the four elements. It celebrated the art of dance and masked revelry, blending elegance with Minecrafts enchanting themes.', 16),
(621, 'The Elemental Geyser Expedition', 'c', TIMESTAMP('2023-05-06', '14:12:20'), 'm', 53, 'm', TIMESTAMP('2022-12-09', '14:12:20'), 'The Elemental Geyser Expedition was an adventure that took players to a custom geyser biome. Explorers witnessed powerful geysers, solved puzzles, and collected valuable geothermal resources from the servers natural wonders.', 24),
(622, 'Minecraft Family Reunion: A Personal Connection', 'c', TIMESTAMP('2022-11-19', '14:12:20'), 'd', 96, 'h', TIMESTAMP('2021-02-25', '14:12:20'), 'The Minecraft Family Reunion brought together players who were related, whether as siblings, cousins, or parent-child pairs, within the server. Participants shared their personal connections, in-game family dynamics, and the joy of playing Minecraft with loved ones.', 41),
(627, 'Personal Cave Dwellings Showcase', 'c', TIMESTAMP('2023-06-21', '14:12:20'), 'd', 3, 'd', TIMESTAMP('2022-02-13', '14:12:20'), 'The Personal Cave Dwellings Showcase celebrated players who had made unique homes in underground caves. Participants discussed their personal connections to their cave dwellings, their cozy interiors, and the mysteries of living below ground.', 74),
(630, 'Minecraft Cook-Off: Personal Recipes', 'c', TIMESTAMP('2022-05-07', '14:12:20'), 'm', 47, 'm', TIMESTAMP('2023-09-09', '14:12:20'), 'The Minecraft Cook-Off showcased players culinary skills as they shared their personal recipes, special dishes, and the stories behind their favorite in-game meals.', 85),
(631, 'Personal Survival Stories: From Struggle to Success', 'c', TIMESTAMP('2021-05-17', '14:12:20'), 'h', 70, 'd', TIMESTAMP('2021-11-28', '14:12:20'), 'Personal Survival Stories: From Struggle to Success allowed players to recount their personal survival journeys, from the initial struggles to the ultimate success. Participants discussed their experiences, lessons learned, and the perseverance that had seen them through.', 60),
(632, 'Player-Hosted Costume Party', 'c', TIMESTAMP('2023-06-03', '14:12:20'), 'm', 97, 'd', TIMESTAMP('2023-04-28', '14:12:20'), 'The Player-Hosted Costume Party was a personal and fun event where players dressed up in creative in-game costumes and shared their costume inspirations, stories, and the joy of role-playing.', 29),
(635, 'Personal Boat Tours: Sailing Stories', 'c', TIMESTAMP('2021-06-29', '14:12:20'), 'm', 96, 'd', TIMESTAMP('2023-01-18', '14:12:20'), 'Personal Boat Tours gave players the opportunity to host boat tours of their favorite in-game waterways. Participants shared their personal boating stories, the scenic beauty they had encountered, and the serenity of sailing.', 90),
(636, 'Minecraft Antiques Fair: Personal Treasures', 'c', TIMESTAMP('2023-04-14', '14:12:20'), 'd', 85, 'd', TIMESTAMP('2021-08-16', '14:12:20'), 'The Minecraft Antiques Fair was a personal showcase of players rare in-game collectibles and antiques. Participants discussed their personal treasures, their historical significance, and the excitement of uncovering unique items.', 68),
(638, 'Minecraft Journaling: Personal Logs', 'c', TIMESTAMP('2023-01-23', '14:12:20'), 'm', 91, 'd', TIMESTAMP('2021-06-07', '14:12:20'), 'Minecraft Journaling allowed players to share their personal in-game journals, logs, and diaries. Participants discussed their journaling styles, the role of personal logs in character development, and the insights they had gained from recording their adventures.', 3),
(639, 'The Serenity of Fishing: Personal Reflections', 'c', TIMESTAMP('2023-02-06', '14:12:20'), 'd', 47, 'd', TIMESTAMP('2022-11-18', '14:12:20'), 'The Serenity of Fishing event allowed players to reflect on the personal moments of tranquility they had experienced while fishing in the server. Participants shared their peaceful fishing spots, the emotions tied to fishing, and the escape it provided.', 77),
(642, 'Player-Hosted Minigame Extravaganza', 'c', TIMESTAMP('2022-09-04', '14:12:20'), 'h', 79, 'm', TIMESTAMP('2023-02-03', '14:12:20'), 'In the Player-Hosted Minigame Extravaganza, players designed and hosted personal minigames, sharing the inspiration behind their creations, the challenges they had devised, and the enjoyment of seeing others play their games.', 27),
(643, 'Personal Merchant Tales: Trading Stories', 'c', TIMESTAMP('2021-11-05', '14:12:20'), 'h', 61, 'd', TIMESTAMP('2021-04-13', '14:12:20'), 'Personal Merchant Tales allowed players to share their personal trading stories, from setting up shop in the server marketplace to striking unique deals and partnerships. Participants discussed the art of trading, the joy of commerce, and their success as in-game merchants.', 83),
(644, 'Minecraft Movie Night: Personal Film Picks', 'c', TIMESTAMP('2023-09-22', '14:12:20'), 'd', 3, 'm', TIMESTAMP('2021-03-13', '14:12:20'), 'The Minecraft Movie Night was a personal movie night where players shared their favorite in-game cinematic creations and discussed the personal connections they had to the stories they had watched.', 33),
(646, 'Personal Nighttime Strolls: Moonlit Adventures', 'c', TIMESTAMP('2023-09-23', '14:12:20'), 'm', 72, 'd', TIMESTAMP('2022-04-28', '14:12:20'), 'Personal Nighttime Strolls allowed players to discuss the personal enchantment of in-game nighttime strolls. Participants shared their moonlit adventures, the magic of starry skies, and the personal reflections that came with the night.', 40),
(648, 'Personal Island Getaway: Paradise Tales', 'c', TIMESTAMP('2023-06-19', '14:12:20'), 'm', 29, 'h', TIMESTAMP('2023-02-28', '14:12:20'), 'Personal Island Getaway was an event that highlighted players in-game islands and paradises. Participants discussed their personal island stories, the beauty of their tropical getaways, and the serenity of having an in-game personal retreat.', 7),
(654, 'The Nether Void Expedition', 'c', TIMESTAMP('2021-08-04', '14:12:20'), 'h', 45, 'h', TIMESTAMP('2023-03-08', '14:12:20'), 'The Nether Void Expedition was a daring journey into the void beneath the Nether. Players explored vast void biomes, collecting valuable void shards, engaging in battles, and revealing the mysteries of the Nethers depths.', 28),
(656, 'The Crystal Forge Creation', 'c', TIMESTAMP('2021-10-08', '14:12:20'), 'm', 85, 'h', TIMESTAMP('2021-12-22', '14:12:20'), 'The Crystal Forge Creation was a crafting competition where players used rare, server-specific crystals to forge unique items and tools. Crafters showcased their mastery of the servers precious resources and creative crafting techniques.', 83),
(657, 'The Mythic Raids of Legends', 'c', TIMESTAMP('2023-03-28', '14:12:20'), 'm', 11, 'd', TIMESTAMP('2023-06-09', '14:12:20'), 'The Mythic Raids of Legends was an epic PvE adventure where players faced off against legendary creatures from server lore. They ventured deep into the servers most perilous dungeons and sought to conquer mythical foes for rewards and glory.', 64),
(658, 'The Elemental Cartography Contest', 'c', TIMESTAMP('2021-03-31', '14:12:20'), 'h', 31, 'm', TIMESTAMP('2022-08-10', '14:12:20'), 'The Elemental Cartography Contest was a map-making competition where players created detailed, artistic maps of the servers various biomes. The event celebrated cartography, art, and geographical exploration.', 43),
(660, 'The Lost Civilizations Exhibition', 'c', TIMESTAMP('2023-05-03', '14:12:20'), 'd', 1, 'm', TIMESTAMP('2023-05-12', '14:12:20'), 'The Lost Civilizations Exhibition was a display of historical reenactments and exhibits showcasing the servers lost civilizations. Players reconstructed ancient structures, displayed artifacts, and shared stories about these bygone cultures.', 87),
(661, 'The Enchanted Lake Regatta', 'c', TIMESTAMP('2021-11-03', '14:12:20'), 'h', 13, 'm', TIMESTAMP('2023-07-30', '14:12:20'), 'The Enchanted Lake Regatta was a boat race through an enchanting lake that featured twists, turns, and mystical obstacles. It celebrated the servers enchanting aquatic landscapes and boat racing skills.', 33),
(664, 'The Elemental Cosplay Showcase', 'c', TIMESTAMP('2023-04-26', '14:12:20'), 'h', 80, 'h', TIMESTAMP('2023-07-07', '14:12:20'), 'The Elemental Cosplay Showcase was a costume competition where players dressed up as famous elemental creatures and entities from server lore. Participants embodied these characters and shared their stories.', 33),
(665, 'The Elemental Races of the Elements', 'c', TIMESTAMP('2022-07-20', '14:12:20'), 'h', 74, 'm', TIMESTAMP('2022-11-16', '14:12:20'), 'The Elemental Races of the Elements was a competitive race where players navigated elemental-themed obstacle courses inspired by earth, water, fire, and air. It celebrated speed, agility, and elemental prowess.', 2),
(667, 'The Elemental Biome Ball', 'c', TIMESTAMP('2021-10-06', '14:12:20'), 'm', 93, 'd', TIMESTAMP('2022-05-27', '14:12:20'), 'The Elemental Biome Ball was a grand ballroom dance event where players were invited to represent and showcase the unique dances, music, and traditions of their favorite server biomes.', 5),
(668, 'The Server-Wide Artistic Mural', 'c', TIMESTAMP('2022-07-30', '14:12:20'), 'h', 5, 'h', TIMESTAMP('2023-04-30', '14:12:20'), 'The Server-Wide Artistic Mural was a colossal art project where players contributed to a continuously evolving mural, adding their artistic touch and creativity to an ever-growing masterpiece representing server history.', 89),
(669, 'The Elemental Beacon Relay', 'c', TIMESTAMP('2022-04-21', '14:12:20'), 'm', 40, 'd', TIMESTAMP('2021-02-25', '14:12:20'), 'The Elemental Beacon Relay was a high-stakes race where teams carried elemental beacon blocks through various biomes. The event celebrated teamwork, resourcefulness, and endurance.', 13),
(670, 'The Underworld Lava Parkour', 'c', TIMESTAMP('2021-07-30', '14:12:20'), 'm', 10, 'd', TIMESTAMP('2023-04-12', '14:12:20'), 'The Underworld Lava Parkour was a challenging parkour competition set in a custom-designed underground lava biome. Players had to leap across platforms and navigate treacherous lava flows to reach the finish line.', 90),
(671, 'The Biome-Inspired Live Music Festival', 'c', TIMESTAMP('2021-05-18', '14:12:20'), 'd', 49, 'm', TIMESTAMP('2022-02-21', '14:12:20'), 'The Biome-Inspired Live Music Festival was a lively event featuring in-game live music performances inspired by the servers diverse biomes. It celebrated the servers musical talent and cultural diversity.', 43),
(677, 'The Grand Reef Regatta', 'c', TIMESTAMP('2021-12-01', '14:12:20'), 'd', 34, 'm', TIMESTAMP('2021-12-07', '14:12:20'), 'The Grand Reef Regatta was a thrilling sailing race that took place in the servers coral reef biomes. Players piloted sailboats through coral mazes, raced alongside marine life, and experienced the vibrant beauty of the reefs.', 22),
(678, 'The Elemental Elegance Showcase', 'c', TIMESTAMP('2023-08-06', '14:12:20'), 'd', 47, 'h', TIMESTAMP('2021-12-02', '14:12:20'), 'The Elemental Elegance Showcase was a fashion show event where players presented elegant outfits inspired by the four elements (earth, water, fire, air). It celebrated style, creativity, and the servers enchanting themes.', 56),
(679, 'The Desert Mirage Mirage', 'c', TIMESTAMP('2023-11-02', '14:12:20'), 'h', 37, 'h', TIMESTAMP('2023-03-27', '14:12:20'), 'The Desert Mirage Mirage was an event designed to confuse and challenge players as they navigated a desert filled with optical illusions and mirages. It tested problem-solving skills and resilience.', 33),
(681, 'The Elemental Elemental Beach Party', 'c', TIMESTAMP('2021-03-24', '14:12:20'), 'h', 16, 'm', TIMESTAMP('2023-08-22', '14:12:20'), 'The Elemental Elemental Beach Party was a lively beach party where players celebrated their favorite elemental biomes with themed beach activities, dancing, and beachside games.', 3),
(683, 'Minecraft Server Community Potluck: Personal Recipes', 'c', TIMESTAMP('2022-12-19', '14:12:20'), 'h', 31, 'm', TIMESTAMP('2022-04-05', '14:12:20'), 'The Minecraft Server Community Potluck was a personal feast where players shared their favorite in-game recipes and dishes. Participants discussed their personal cooking experiences, the flavors they loved, and the joy of sharing virtual meals.', 81),
(684, 'Personal Biome Retreats: Nature Escapes', 'c', TIMESTAMP('2023-08-18', '14:12:20'), 'm', 2, 'h', TIMESTAMP('2022-07-11', '14:12:20'), 'Personal Biome Retreats highlighted players personal hideaways and retreats in various biomes. Participants discussed their personal connections to these serene locations, the solace they found in nature, and the in-game escapes they had created.', 35),
(685, 'Minecraft Library Tour: Personal Collections', 'c', TIMESTAMP('2023-09-11', '14:12:20'), 'h', 64, 'h', TIMESTAMP('2021-08-28', '14:12:20'), 'The Minecraft Library Tour allowed players to showcase their personal book collections and discuss the personal significance of each book. Participants shared their favorite in-game reads and the impact they had on their characters.', 51),
(686, 'Player-Hosted Spleef Tournament: Personal Victories', 'c', TIMESTAMP('2021-04-09', '14:12:20'), 'h', 94, 'd', TIMESTAMP('2022-08-12', '14:12:20'), 'In the Player-Hosted Spleef Tournament, players hosted their own personal Spleef competitions, sharing stories of personal victories, challenging arenas, and the satisfaction of sending opponents plummeting into the void.', 6),
(688, 'Minecraft Movie Marathon: Personal Film Favorites', 'c', TIMESTAMP('2022-01-04', '14:12:20'), 'h', 9, 'd', TIMESTAMP('2021-04-27', '14:12:20'), 'The Minecraft Movie Marathon was a personal film night where players shared their favorite in-game cinematic creations and discussed the personal connections they had to the stories they had watched.', 20),
(689, 'Player-Hosted Minecart Race: Personal Speed Records', 'c', TIMESTAMP('2023-06-08', '14:12:20'), 'm', 80, 'h', TIMESTAMP('2023-07-27', '14:12:20'), 'In the Player-Hosted Minecart Race, players hosted personal minecart races, sharing stories of personal speed records, exhilarating tracks, and the thrill of racing against friends.', 87),
(690, 'Personal Monument Building: Tribute Stories', 'c', TIMESTAMP('2021-04-12', '14:12:20'), 'h', 73, 'd', TIMESTAMP('2021-09-18', '14:12:20'), 'Personal Monument Building allowed players to discuss the personal monuments they had created in honor of special occasions, characters, or events. Participants shared the stories behind their tributes, the emotions they conveyed, and the memories they preserved.', 61),
(693, 'Player-Hosted Maze Race: Personal Maze Adventures', 'c', TIMESTAMP('2021-08-18', '14:12:20'), 'd', 20, 'm', TIMESTAMP('2021-09-18', '14:12:20'), 'In the Player-Hosted Maze Race, players hosted personal maze races, sharing stories of their maze adventures, clever puzzles, and the satisfaction of navigating labyrinthine pathways.', 51),
(699, 'Minecraft Cooking Class: Personal Chef Secrets', 'c', TIMESTAMP('2023-06-12', '14:12:20'), 'h', 40, 'd', TIMESTAMP('2023-08-31', '14:12:20'), 'The Minecraft Cooking Class allowed players to become personal chefs, sharing their in-game culinary secrets and discussing personal chef stories, from favorite recipes to secret ingredients.', 13),
(704, 'Minecraft Culinary Showdown: Personal Dishes', 'c', TIMESTAMP('2021-03-13', '14:12:20'), 'h', 8, 'm', TIMESTAMP('2022-11-23', '14:12:20'), 'The Minecraft Culinary Showdown was a culinary competition where players discussed their personal dishes, sharing stories of creativity, presentation, and the culinary delights they had prepared.', 59),
(707, 'Minecraft Server Plantation Tour: Personal Gardens', 'c', TIMESTAMP('2021-12-25', '14:12:20'), 'm', 98, 'h', TIMESTAMP('2023-05-25', '14:12:20'), 'The Minecraft Server Plantation Tour allowed players to showcase their personal in-game plantations and gardens. Participants discussed their personal garden stories, from cultivating crops to tending to lush greenery.', 28),
(708, 'Personal Abandoned Ruin Discovery: Ancient Tales', 'c', TIMESTAMP('2022-02-10', '14:12:20'), 'm', 43, 'm', TIMESTAMP('2023-01-01', '14:12:20'), 'Personal Abandoned Ruin Discovery highlighted players personal stories of uncovering and exploring in-game abandoned ruins. Participants discussed their archaeological adventures, the history behind each ruin, and the mysteries they had solved.', 19),
(712, 'The Elemental Village Revival', 'c', TIMESTAMP('2022-06-04', '14:12:20'), 'm', 97, 'd', TIMESTAMP('2021-12-31', '14:12:20'), 'The Elemental Village Revival was a community-driven effort where players banded together to rejuvenate abandoned villages in the servers various biomes. It celebrated teamwork and the preservation of Minecraft villages.', 86),
(713, 'The Enchanted Botanical Art Show', 'c', TIMESTAMP('2021-02-24', '14:12:20'), 'm', 16, 'm', TIMESTAMP('2023-06-16', '14:12:20'), 'The Enchanted Botanical Art Show was an exhibition where players displayed their artistic interpretations of the servers enchanting plant life. Artists expressed their creativity through paintings, sculptures, and other forms of art.', 16),
(714, 'The Biome Challenge Race', 'c', TIMESTAMP('2023-04-08', '14:12:20'), 'h', 93, 'h', TIMESTAMP('2022-10-08', '14:12:20'), 'The Biome Challenge Race was a dynamic race where players sprinted through a series of custom-designed biome challenges, each inspired by a different server biome. It tested speed, agility, and biome-specific knowledge.', 57),
(715, 'The Elemental Quest for Relics', 'c', TIMESTAMP('2023-05-28', '14:12:20'), 'd', 2, 'h', TIMESTAMP('2021-11-10', '14:12:20'), 'The Elemental Quest for Relics was an extensive adventure that sent players on a quest to uncover ancient, elemental relics scattered across the server. Participants solved puzzles, fought mythical creatures, and unearthed hidden history.', 62),
(716, 'The Elemental Transformation Dance', 'c', TIMESTAMP('2021-03-28', '14:12:20'), 'm', 40, 'h', TIMESTAMP('2022-07-17', '14:12:20'), 'The Elemental Transformation Dance was a dance competition where players showcased their dance moves and creativity while representing the four elements (earth, water, fire, air). It combined dance and storytelling.', 57),
(717, 'The Ender Island Survival Challenge', 'c', TIMESTAMP('2021-03-01', '14:12:20'), 'h', 77, 'm', TIMESTAMP('2021-11-11', '14:12:20'), 'The Ender Island Survival Challenge was a competitive event where players were marooned on custom Ender-themed islands. They had to survive and outlast their competitors in the challenging Ender environment.', 69),
(719, 'The Elemental Festival of Lights', 'c', TIMESTAMP('2022-10-31', '14:12:20'), 'h', 93, 'h', TIMESTAMP('2023-09-11', '14:12:20'), 'The Elemental Festival of Lights was a festival where players celebrated the servers diverse biomes through elaborate light displays, lanterns, and enchanting light sources. It illuminated the night with enchantment.', 37),
(720, 'The Elemental Elemental Relay Race', 'c', TIMESTAMP('2021-10-03', '14:12:20'), 'm', 30, 'm', TIMESTAMP('2022-05-17', '14:12:20'), 'The Elemental Elemental Relay Race was a fast-paced relay race where teams representing the elements (earth, water, fire, air) competed in a series of elemental challenges. It combined teamwork and athleticism.', 82),
(722, 'The Elemental Enigma Challenge', 'c', TIMESTAMP('2022-04-22', '14:12:20'), 'd', 71, 'd', TIMESTAMP('2022-06-12', '14:12:20'), 'The Elemental Enigma Challenge was a contest of wit and wisdom, with players deciphering riddles and clues tied to the servers elemental lore. It celebrated critical thinking and knowledge of server history.', 5),
(723, 'The Elemental Equestrian Showcase', 'c', TIMESTAMP('2023-07-03', '14:12:20'), 'm', 34, 'h', TIMESTAMP('2022-05-26', '14:12:20'), 'The Elemental Equestrian Showcase was an equestrian event where players rode horses, showcasing their horsemanship while representing the four elements. It celebrated the bond between players and their equine companions.', 57),
(728, 'The Elemental Puzzlers Challenge', 'c', TIMESTAMP('2022-11-16', '14:12:20'), 'd', 3, 'm', TIMESTAMP('2022-04-17', '14:12:20'), 'The Elemental Puzzlers Challenge was a puzzle-solving event where players faced biome-specific puzzles and riddles. They tested their mental acumen and creativity while navigating through diverse challenges.', 68),
(729, 'The Enchanted Night Market', 'c', TIMESTAMP('2022-07-16', '14:12:20'), 'h', 53, 'd', TIMESTAMP('2022-06-21', '14:12:20'), 'The Enchanted Night Market was a night-time market where players set up stalls and shops featuring enchanting and rare items. It celebrated the enchantment and beauty of nightfall.', 9),
(730, 'The Elemental Beacon Marathon', 'c', TIMESTAMP('2023-09-29', '14:12:20'), 'h', 56, 'd', TIMESTAMP('2021-08-02', '14:12:20'), 'The Elemental Beacon Marathon was a long-distance race where players raced through a variety of biomes, activating elemental beacons along the way to demonstrate endurance and mastery.', 6),
(731, 'The Crystal Caves Adventure', 'c', TIMESTAMP('2021-03-28', '14:12:20'), 'h', 93, 'd', TIMESTAMP('2022-12-08', '14:12:20'), 'The Crystal Caves Adventure was a journey through custom-designed underground crystal caves. Players navigated through dazzling crystal formations, overcame unique challenges, and discovered valuable crystal resources.', 19),
(734, 'The Elemental Pet Parade', 'c', TIMESTAMP('2022-06-13', '14:12:20'), 'd', 43, 'd', TIMESTAMP('2021-11-28', '14:12:20'), 'The Elemental Pet Parade was a lively parade where players showcased their in-game pets representing the four elements (earth, water, fire, air). It was a delightful and charming display of creativity.', 31),
(737, 'The Terraforming Sculpture Gallery', 'c', TIMESTAMP('2022-08-06', '14:12:20'), 'd', 87, 'd', TIMESTAMP('2021-03-25', '14:12:20'), 'The Terraforming Sculpture Gallery was an art exhibition where players crafted sculptures inspired by the servers terraformed landscapes. It celebrated the beauty of player-created environments.', 88),
(738, 'The Elemental Paragliding Performance', 'c', TIMESTAMP('2021-03-08', '14:12:20'), 'm', 17, 'm', TIMESTAMP('2021-06-22', '14:12:20'), 'The Elemental Paragliding Performance was a spectacular aerial performance where players, equipped with elytra, performed choreographed flights representing the four elements. It combined flight and artistic expression.', 69),
(740, 'The Mythic Bardic Tale Festival', 'c', TIMESTAMP('2023-02-02', '14:12:20'), 'd', 67, 'h', TIMESTAMP('2021-12-23', '14:12:20'), 'The Mythic Bardic Tale Festival was a storytelling event where players shared epic and mythic tales inspired by server legends and lore. It celebrated storytelling and the rich narrative tradition of the server.', 19),
(741, 'The Elemental Fusion Sculpture', 'c', TIMESTAMP('2021-08-16', '14:12:20'), 'd', 97, 'h', TIMESTAMP('2022-08-18', '14:12:20'), 'The Elemental Fusion Sculpture was a collaborative art project where players created sculptures that blended elements from different server biomes. It celebrated artistic blending and creativity.', 31),
(746, 'The Enchanted Fauna Parade', 'c', TIMESTAMP('2023-06-16', '14:12:20'), 'm', 77, 'm', TIMESTAMP('2022-10-03', '14:12:20'), 'The Enchanted Fauna Parade was a charming parade featuring players dressed as server animals and creatures. It was a delightful and whimsical celebration of Minecrafts wildlife.', 13),
(747, 'Minecraft Server Photography Contest: Personal Captures', 'c', TIMESTAMP('2022-09-21', '14:12:20'), 'm', 22, 'm', TIMESTAMP('2023-11-11', '14:12:20'), 'The Minecraft Server Photography Contest allowed players to submit their personal in-game photographs and share the stories behind their captures. Participants discussed their personal photography techniques, their favorite shots, and the emotions conveyed through their images.', 74),
(748, 'Player-Hosted Petting Zoo: Personal Critter Tales', 'c', TIMESTAMP('2022-10-07', '14:12:20'), 'm', 95, 'd', TIMESTAMP('2021-04-13', '14:12:20'), 'In the Player-Hosted Petting Zoo, players hosted their own personal petting zoos within the server, sharing stories of their virtual critters, their personalities, and the joy of introducing them to others.', 71),
(750, 'Minecraft Sculpture Garden: Personal Artistry', 'c', TIMESTAMP('2021-05-29', '14:12:20'), 'd', 46, 'h', TIMESTAMP('2023-10-18', '14:12:20'), 'The Minecraft Sculpture Garden was a personal showcase of players in-game sculptures. Participants discussed their personal artistic journeys, the inspiration behind their sculptures, and the emotions they had conveyed through their artistry.', 19),
(753, 'Minecraft Brewing Showcase: Personal Elixirs', 'c', TIMESTAMP('2022-11-18', '14:12:20'), 'm', 81, 'm', TIMESTAMP('2022-03-17', '14:12:20'), 'The Minecraft Brewing Showcase allowed players to showcase their personal in-game brewing skills, sharing stories of personal elixirs, favorite potions, and the art of alchemy.', 4),
(754, 'Personal Server Cartography: Mapmakers Journeys', 'c', TIMESTAMP('2021-09-02', '14:12:20'), 'h', 22, 'h', TIMESTAMP('2021-02-23', '14:12:20'), 'Personal Server Cartography highlighted players personal map-making journeys and shared stories of exploration, landmarks discovered, and the personal connections to the maps they had crafted.', 7),
(757, 'Minecraft Dinner Party: Personal Culinary Adventures', 'c', TIMESTAMP('2023-09-08', '14:12:20'), 'm', 85, 'h', TIMESTAMP('2023-03-04', '14:12:20'), 'The Minecraft Dinner Party was a personal culinary event where players discussed their in-game culinary adventures, shared personal recipes, and talked about the culinary delights they had prepared.', 52),
(758, 'Player-Hosted Ender Pearl Relay Race: Personal Speed Records', 'c', TIMESTAMP('2022-08-25', '14:12:20'), 'h', 38, 'h', TIMESTAMP('2021-04-13', '14:12:20'), 'In the Player-Hosted Ender Pearl Relay Race, players hosted their personal relay races, sharing stories of personal speed records, strategic throws, and the thrill of quick traversal.', 60),
(759, 'Personal Volcano Expeditions: Lava Adventures', 'c', TIMESTAMP('2022-01-16', '14:12:20'), 'd', 68, 'h', TIMESTAMP('2022-06-12', '14:12:20'), 'Personal Volcano Expeditions celebrated players personal experiences exploring in-game volcanoes and discussed the volcanic adventures, lava lakes, and the thrill of navigating this fiery terrain.', 26),
(760, 'Minecraft Ballroom Dance: Personal Elegance', 'c', TIMESTAMP('2022-07-02', '14:12:20'), 'h', 98, 'm', TIMESTAMP('2022-08-21', '14:12:20'), 'The Minecraft Ballroom Dance was an elegant event where players showcased their personal dance skills and shared stories of personal elegance, dance inspirations, and the joy of ballroom dancing.', 66),
(765, 'Personal Diving Adventures: Abyssal Exploration', 'c', TIMESTAMP('2021-03-01', '14:12:20'), 'h', 70, 'd', TIMESTAMP('2021-04-23', '14:12:20'), 'Personal Diving Adventures celebrated players personal diving expeditions within the servers oceans and deep underwater chasms. Participants discussed abyssal exploration, the beauty of underwater realms, and the thrill of diving into the depths.', 50);
INSERT INTO {prefix}Event (eid, name, eventDateType, eventDate1, eventDate2, postedDate, description, postedUid)VALUES
(2, 'The Great Server Migration', 'b', TIMESTAMP('2021-09-21', '14:12:20'), TIMESTAMP('2022-02-12', '14:12:20'), TIMESTAMP('2022-06-16', '14:12:20'), 'In a monumental undertaking, the server migrated to a new host to provide better performance and a more stable gaming experience. This massive transition involved transferring thousands of players, plugins, and builds seamlessly while keeping downtime to a minimum. It was a testament to the servers commitment to improving player experiences.', 16),
(5, 'Nether Expansion', 'b', TIMESTAMP('2022-09-30', '14:12:20'), TIMESTAMP('2023-11-11', '14:12:20'), TIMESTAMP('2021-09-17', '14:12:20'), 'A major update that introduced new dimensions, with the Nether being the focus of excitement. Players delved into the depths of the fiery underworld, discovering hidden treasures, battling formidable mobs, and facing the challenges of the revamped Nether terrain. The expansion revitalized exploration and adventure on the server.', 52),
(6, 'Alliance of Factions', 'b', TIMESTAMP('2023-05-25', '14:12:20'), TIMESTAMP('2025-01-21', '14:12:20'), TIMESTAMP('2021-07-24', '14:12:20'), 'The day when multiple factions came together to form a powerful alliance, uniting their strengths to combat a common enemy. This event reshaped the servers political landscape, leading to unique alliances, intricate diplomacy, and epic battles against a formidable adversary, ultimately ensuring the servers security and prosperity.', 67),
(8, 'Seasonal Events Spectacular', 'b', TIMESTAMP('2022-05-20', '14:12:20'), TIMESTAMP('2024-06-25', '14:12:20'), TIMESTAMP('2023-02-27', '14:12:20'), 'A series of seasonal events and festivals, including Halloween, Christmas, and New Years celebrations. These festivities brought the community together, offering unique challenges, exclusive rewards, and a festive atmosphere that created lasting memories and solidified the servers sense of community.', 44),
(10, 'Monumental Server Reset', 'b', TIMESTAMP('2022-01-12', '14:12:20'), TIMESTAMP('2023-08-23', '14:12:20'), TIMESTAMP('2023-01-29', '14:12:20'), 'A bold decision to reset the servers map and start fresh, breathing new life into the world. Players embraced this opportunity to embark on new adventures, build new communities, and redefine the servers history while preserving cherished memories from the past.', 77),
(11, 'The Great Marketplace Boom', 'b', TIMESTAMP('2023-04-02', '14:12:20'), TIMESTAMP('2024-11-03', '14:12:20'), TIMESTAMP('2022-12-04', '14:12:20'), 'A vibrant player-driven marketplace emerged, becoming a hub for trading, auctions, and economic competition. The marketplace allowed players to buy and sell rare items, resources, and services, creating a bustling economic ecosystem within the server.', 63),
(12, 'Skyblock Challenge Competition', 'b', TIMESTAMP('2022-04-28', '14:12:20'), TIMESTAMP('2024-06-05', '14:12:20'), TIMESTAMP('2022-09-16', '14:12:20'), 'A thrilling Skyblock competition where players started on a tiny island and had to survive and expand with limited resources. It fostered creativity, teamwork, and strategic thinking as players devised innovative ways to thrive in isolation.', 69),
(13, 'Server-Wide Talent Show', 'b', TIMESTAMP('2021-02-16', '14:12:20'), TIMESTAMP('2021-03-19', '14:12:20'), TIMESTAMP('2022-01-18', '14:12:20'), 'A creative event where players showcased their talents through in-game performances, from music and theater to art exhibitions. The talent show celebrated the servers diverse community and provided entertainment for all to enjoy.', 1),
(16, 'Servers Anniversary Celebration', 'b', TIMESTAMP('2021-05-13', '14:12:20'), TIMESTAMP('2023-08-04', '14:12:20'), TIMESTAMP('2023-10-09', '14:12:20'), 'An annual celebration marking the servers founding, featuring fireworks, contests, and community gatherings. Each anniversary was an opportunity to reflect on the servers growth and the friendships that had formed over the years.', 31),
(17, 'The Legend of the Lost City', 'b', TIMESTAMP('2022-03-31', '14:12:20'), TIMESTAMP('2024-11-10', '14:12:20'), TIMESTAMP('2022-12-17', '14:12:20'), 'Players embarked on an archaeological expedition to discover the ruins of a long-forgotten city. Uncovering its history, secrets, and hidden treasures added an exciting narrative layer to the servers lore.', 24),
(19, 'Scientific Advancements', 'b', TIMESTAMP('2022-07-24', '14:12:20'), TIMESTAMP('2023-11-14', '14:12:20'), TIMESTAMP('2022-05-27', '14:12:20'), 'The establishment of a player-driven research community focused on inventing new technologies and machines. These innovations revolutionized gameplay by introducing automation, transportation, and resource management systems.', 70),
(22, 'Eco-Friendly Build Competition', 'b', TIMESTAMP('2023-01-12', '14:12:20'), TIMESTAMP('2023-09-04', '14:12:20'), TIMESTAMP('2022-06-09', '14:12:20'), 'A challenge to construct environmentally conscious structures using sustainable materials and eco-friendly designs. The event promoted ecological awareness and sustainable building practices.', 34),
(27, 'Ancient Foe Awakens', 'b', TIMESTAMP('2022-11-16', '14:12:20'), TIMESTAMP('2023-04-19', '14:12:20'), TIMESTAMP('2022-02-01', '14:12:20'), 'An ancient, powerful enemy thought to be long dormant suddenly reawakened, challenging the servers mightiest factions to join forces and fend off the impending threat.', 57),
(29, 'Jurassic Park Adventure', 'b', TIMESTAMP('2021-04-18', '14:12:20'), TIMESTAMP('2023-03-15', '14:12:20'), TIMESTAMP('2023-06-20', '14:12:20'), 'The creation of a dinosaur-themed adventure park filled with lifelike, genetically engineered dinosaurs. Players explored the park, encountering prehistoric creatures and participating in thrilling adventures.', 19),
(30, 'Intercontinental Rail Network', 'b', TIMESTAMP('2023-03-28', '14:12:20'), TIMESTAMP('2024-04-23', '14:12:20'), TIMESTAMP('2023-07-09', '14:12:20'), 'A server-wide project to establish a vast, interconnected rail network, enabling players to travel swiftly across the servers diverse landscapes, fostering trade and connectivity.', 48),
(32, 'Underwater Wonderland', 'b', TIMESTAMP('2022-06-28', '14:12:20'), TIMESTAMP('2024-10-08', '14:12:20'), TIMESTAMP('2022-01-25', '14:12:20'), 'An update introducing an enchanting underwater realm filled with coral reefs, shipwrecks, and aquatic life. Players could explore the depths and engage in new aquatic adventures.', 11),
(33, 'Horse Racing League', 'b', TIMESTAMP('2021-11-01', '14:12:20'), TIMESTAMP('2023-04-02', '14:12:20'), TIMESTAMP('2023-10-01', '14:12:20'), 'The establishment of a competitive horse racing league, where players bred, trained, and raced their horses in thrilling tournaments that captivated both participants and spectators.', 39),
(34, 'Elemental Wars', 'b', TIMESTAMP('2023-06-26', '14:12:20'), TIMESTAMP('2025-08-22', '14:12:20'), TIMESTAMP('2022-08-10', '14:12:20'), 'A server-wide event where players aligned with different elemental factions, each representing an element, and engaged in battles using elemental magic, creating a unique and dynamic combat experience.', 68),
(36, 'Deep Cavern Expeditions', 'b', TIMESTAMP('2023-02-14', '14:12:20'), TIMESTAMP('2023-05-23', '14:12:20'), TIMESTAMP('2022-07-21', '14:12:20'), 'The discovery of uncharted underground caverns, complete with rare ores, hidden settlements, and subterranean biomes, offering exciting opportunities for exploration and resource gathering.', 36),
(37, 'Build-a-Nation Challenge', 'b', TIMESTAMP('2022-05-23', '14:12:20'), TIMESTAMP('2023-06-07', '14:12:20'), TIMESTAMP('2023-10-28', '14:12:20'), 'A competition where players formed nations and had to build cohesive civilizations with unique themes, cultures, and architectural styles, leading to a diverse and immersive world.', 71),
(38, 'Realm of Shadows Unveiled', 'b', TIMESTAMP('2021-06-25', '14:12:20'), TIMESTAMP('2023-11-17', '14:12:20'), TIMESTAMP('2021-05-05', '14:12:20'), 'A dark and mysterious dimension introduced into the server, filled with shadowy creatures, eerie landscapes, and enigmatic quests, providing a thrilling alternative gameplay experience.', 7),
(39, 'The Legendary Enigma of Excalibur', 'b', TIMESTAMP('2022-06-27', '14:12:20'), TIMESTAMP('2024-10-22', '14:12:20'), TIMESTAMP('2022-09-27', '14:12:20'), 'A server-wide quest to discover the mythical sword Excalibur, hidden deep within a labyrinthine castle. Players solved puzzles, overcame challenges, and unveiled the legend of King Arthur.', 7),
(40, 'Village Renaissance Project', 'b', TIMESTAMP('2021-09-19', '14:12:20'), TIMESTAMP('2022-05-21', '14:12:20'), TIMESTAMP('2022-02-09', '14:12:20'), 'An initiative to revitalize and expand NPC villages, making them thriving, player-driven communities with improved aesthetics and functions, emphasizing the importance of village life.', 19),
(41, 'The Battle of Lava Rift', 'b', TIMESTAMP('2022-01-29', '14:12:20'), TIMESTAMP('2024-03-27', '14:12:20'), TIMESTAMP('2021-09-10', '14:12:20'), 'A climactic showdown at the Lava Rift, a treacherous region of fiery lava and dangerous mobs. Factions clashed for control, using unique strategies to overcome the perilous terrain.', 44),
(43, 'Grand Dragon Taming', 'b', TIMESTAMP('2021-05-22', '14:12:20'), TIMESTAMP('2021-09-03', '14:12:20'), TIMESTAMP('2021-10-20', '14:12:20'), 'The introduction of dragons as tamable and rideable creatures, leading to epic aerial battles, dragon racing competitions, and awe-inspiring dragon-mounted armies.', 28),
(45, 'Desert Kingdom Reawakening', 'b', TIMESTAMP('2021-09-02', '14:12:20'), TIMESTAMP('2022-07-25', '14:12:20'), TIMESTAMP('2021-09-07', '14:12:20'), 'The restoration of an ancient desert kingdom that had fallen into ruins, rekindling the glory of the past with grand palaces, bustling bazaars, and sand dunes ripe for exploration.', 87),
(49, 'Enigmatic Time Travel Quest', 'b', TIMESTAMP('2023-09-07', '14:12:20'), TIMESTAMP('2023-11-26', '14:12:20'), TIMESTAMP('2022-03-04', '14:12:20'), 'A time-traveling adventure where players journeyed through different historical eras, solving puzzles, and uncovering the servers rich lore while preserving the fabric of time.', 42),
(50, 'Server-Wide Space Race', 'b', TIMESTAMP('2022-12-30', '14:12:20'), TIMESTAMP('2023-06-08', '14:12:20'), TIMESTAMP('2022-01-13', '14:12:20'), 'The launch of an ambitious space exploration project, with players competing to establish the first space colonies and space stations, pushing the boundaries of the servers world.', 72),
(51, 'Enchanted Elysium Realm', 'b', TIMESTAMP('2021-06-22', '14:12:20'), TIMESTAMP('2023-12-06', '14:12:20'), TIMESTAMP('2022-05-29', '14:12:20'), 'The introduction of the mystical Elysium Realm, a hidden dimension accessible only through magical portals. This realm was filled with breathtaking landscapes, mythical creatures, and rare resources. Players embarked on a quest to unlock the secrets of Elysium, which included mastering ancient enchantments and facing formidable guardian beasts. The Elysium Realm added a touch of wonder and enchantment to the servers universe, making it a captivating destination for explorers.', 78),
(53, 'Mega-Server Event: The Gathering Storm', 'b', TIMESTAMP('2023-05-14', '14:12:20'), TIMESTAMP('2023-12-19', '14:12:20'), TIMESTAMP('2022-11-14', '14:12:20'), 'A month-long, server-wide event of epic proportions. The Gathering Storm was a storyline-driven adventure that unfolded in multiple acts. Players were immersed in a gripping narrative where they had to unite to confront a world-threatening calamity. Each act brought new challenges, mysteries, and alliances, culminating in a final battle against the ultimate adversary. The events complexity and depth captivated players, leaving a lasting mark on the servers history.', 71),
(54, 'Ancient Titans Awoken', 'b', TIMESTAMP('2022-12-15', '14:12:20'), TIMESTAMP('2023-12-26', '14:12:20'), TIMESTAMP('2022-09-07', '14:12:20'), 'The awakening of ancient, colossal titans who roamed the servers world eons ago. These powerful beings had unique abilities and served as formidable challenges for players. Factions came together to strategize and engage in epic battles to subdue these mighty creatures, earning precious rewards and forging unforgettable stories of valor and teamwork.', 92),
(55, 'Servers Custom Resource Pack', 'b', TIMESTAMP('2022-07-28', '14:12:20'), TIMESTAMP('2024-12-30', '14:12:20'), TIMESTAMP('2021-11-25', '14:12:20'), 'The creation of a custom resource pack unique to the server, enhancing the in-game experience with custom textures, sound effects, and visuals. This pack added a distinct flavor to the servers gameplay, further immersing players in the servers world and lore.', 61),
(56, 'Skyrealm Ascension', 'b', TIMESTAMP('2022-12-31', '14:12:20'), TIMESTAMP('2025-07-26', '14:12:20'), TIMESTAMP('2023-05-08', '14:12:20'), 'A transformative update that introduced an ethereal Skyrealm accessible via portals. The Skyrealm was a floating island paradise, offering breathtaking vistas, celestial creatures, and unique challenges. Players reached new heights in their adventures and explored the floating archipelago while discovering its hidden secrets.', 90),
(60, 'The Great Exodus', 'b', TIMESTAMP('2022-08-30', '14:12:20'), TIMESTAMP('2025-01-25', '14:12:20'), TIMESTAMP('2021-02-27', '14:12:20'), 'A significant server migration, where players and their creations were transferred to a new world, enabling the adoption of the latest Minecraft version and improvements. The Great Exodus marked a pivotal moment in the servers history, as players bid farewell to their old home and embraced new adventures.', 78),
(61, 'Player-Run Universities', 'b', TIMESTAMP('2023-10-22', '14:12:20'), TIMESTAMP('2025-05-01', '14:12:20'), TIMESTAMP('2022-11-24', '14:12:20'), 'The establishment of player-run universities offering courses on various in-game topics, from redstone engineering to lore and history. These institutions promoted knowledge-sharing, fostering an atmosphere of learning and collaboration within the server community.', 25),
(67, 'Interstellar Portal Network', 'b', TIMESTAMP('2022-12-12', '14:12:20'), TIMESTAMP('2024-08-07', '14:12:20'), TIMESTAMP('2021-12-22', '14:12:20'), 'The creation of interstellar portals that allowed players to explore distant galaxies and planets. The interstellar network added a dimension of space travel and discovery to the servers universe, enabling players to embark on cosmic adventures.', 13),
(68, 'Spirit of Unity Day', 'b', TIMESTAMP('2023-06-07', '14:12:20'), TIMESTAMP('2025-08-20', '14:12:20'), TIMESTAMP('2021-10-23', '14:12:20'), 'An annual event commemorating the servers sense of unity and community. Players gathered to celebrate their shared experiences, achievements, and friendships, fostering a strong bond among server members.', 29),
(70, 'Golem Uprising', 'b', TIMESTAMP('2021-09-11', '14:12:20'), TIMESTAMP('2023-10-10', '14:12:20'), TIMESTAMP('2022-03-13', '14:12:20'), 'An in-game event where iron golems, brought to life by an ancient curse, turned against players and threatened the servers settlements. Players united to confront the golem uprising, facing hordes of animated golems in thrilling battles.', 59),
(72, 'The Great Library Project', 'b', TIMESTAMP('2023-10-12', '14:12:20'), TIMESTAMP('2026-04-13', '14:12:20'), TIMESTAMP('2023-07-28', '14:12:20'), 'An initiative to build a colossal library where players could document server lore, history, and knowledge. The library became a repository of wisdom and served as a hub for scholars, lorekeepers, and historians.', 7),
(73, 'Mystical Symbiosis Ritual', 'b', TIMESTAMP('2021-11-22', '14:12:20'), TIMESTAMP('2022-10-19', '14:12:20'), TIMESTAMP('2022-08-05', '14:12:20'), 'The unveiling of a mystical ritual that allowed players to form bonds with sentient magical creatures. The ritual enabled players to summon, befriend, and form alliances with these creatures, enhancing their adventures with unique abilities and companionship.', 37),
(74, 'Phantom Sky Races', 'b', TIMESTAMP('2022-08-10', '14:12:20'), TIMESTAMP('2025-05-05', '14:12:20'), TIMESTAMP('2023-03-02', '14:12:20'), 'A thrilling competition involving phantom racing, where players tamed phantoms and participated in high-speed aerial races across challenging courses in the sky. The Phantom Sky Races added an exhilarating element of flight to the servers events.', 43),
(77, 'The Celestial Eclipse', 'b', TIMESTAMP('2023-07-06', '14:12:20'), TIMESTAMP('2025-10-26', '14:12:20'), TIMESTAMP('2023-07-05', '14:12:20'), 'A celestial event that occurred once in a server year, where celestial bodies aligned in a unique configuration. During the Celestial Eclipse, players could access hidden dimensions and encounter otherworldly creatures, making it a rare and awe-inspiring experience for all.', 43),
(78, 'Pandoras Box Challenge', 'b', TIMESTAMP('2021-12-25', '14:12:20'), TIMESTAMP('2024-09-04', '14:12:20'), TIMESTAMP('2021-12-12', '14:12:20'), 'An event where players unlocked and opened mysterious Pandoras Boxes, unleashing unpredictable and fantastical consequences. The challenge led to unexpected adventures, transformations, and hilarity, making it a test of players adaptability and creativity.', 84),
(81, 'Abyssal Abyss Expedition', 'b', TIMESTAMP('2022-04-11', '14:12:20'), TIMESTAMP('2024-01-14', '14:12:20'), TIMESTAMP('2021-08-08', '14:12:20'), 'The exploration of the Abyssal Abyss, an otherworldly underwater chasm filled with mysterious flora and fauna. This immersive event allowed players to venture into the depths of the servers oceans, where they encountered rare marine life, discovered hidden treasures, and navigated through treacherous underwater caves. The Abyssal Abyss Expedition was a testament to the servers commitment to underwater exploration and adventure.', 42),
(85, 'Cosmic Carnival Extravaganza', 'b', TIMESTAMP('2023-10-27', '14:12:20'), TIMESTAMP('2025-10-09', '14:12:20'), TIMESTAMP('2021-05-24', '14:12:20'), 'An otherworldly carnival that arrived on the server, featuring a wide array of minigames, carnival rides, and attractions. The Cosmic Carnival Extravaganza brought a playful and festive atmosphere to the server, offering players a break from their usual adventures to enjoy games, competitions, and prizes.', 32),
(86, 'Grand Forge of Legends', 'b', TIMESTAMP('2021-11-16', '14:12:20'), TIMESTAMP('2023-05-10', '14:12:20'), TIMESTAMP('2021-06-08', '14:12:20'), 'The opening of a legendary forge where players could craft unique, mythic items with unparalleled abilities. This forge was a hub of creativity, as players experimented with forging powerful artifacts, each with its own captivating backstory and effects.', 59),
(88, 'Enchanted Forest Expansion', 'b', TIMESTAMP('2022-04-27', '14:12:20'), TIMESTAMP('2023-05-23', '14:12:20'), TIMESTAMP('2021-09-16', '14:12:20'), 'An expansion introducing a mystical Enchanted Forest, a realm of enchantment, sentient trees, and whimsical creatures. Players journeyed into this magical world, uncovering the forests secrets and engaging in quests that celebrated natures wonder.', 42),
(89, 'Era of Technomancy', 'b', TIMESTAMP('2021-06-14', '14:12:20'), TIMESTAMP('2022-03-24', '14:12:20'), TIMESTAMP('2022-04-20', '14:12:20'), 'The dawn of an era where players could blend magic and technology to create innovative contraptions. This fusion of magical and technological elements offered new gameplay possibilities, empowering players to design incredible machines and automate tasks in ingenious ways.', 6),
(92, 'Mystic Oracles Prophecy', 'b', TIMESTAMP('2022-10-08', '14:12:20'), TIMESTAMP('2025-02-27', '14:12:20'), TIMESTAMP('2021-07-09', '14:12:20'), 'An enigmatic event where players encountered a mystical oracle who revealed cryptic prophecies that hinted at the servers future. This immersive experience added a narrative element to the server, sparking intrigue and exploration as players deciphered the oracles words.', 15),
(93, 'World of Illusions Dimension', 'b', TIMESTAMP('2021-03-10', '14:12:20'), TIMESTAMP('2022-09-04', '14:12:20'), TIMESTAMP('2022-12-27', '14:12:20'), 'The unveiling of a dimensional portal leading to the World of Illusions, a surreal realm filled with optical illusions, gravity-defying landscapes, and reality-bending puzzles. Players navigated through this captivating dimension, testing their perception and creativity.', 86),
(94, 'Ancient Guardians Trials', 'b', TIMESTAMP('2022-06-01', '14:12:20'), TIMESTAMP('2023-08-25', '14:12:20'), TIMESTAMP('2023-09-09', '14:12:20'), 'The initiation of the Ancient Guardians Trials, where players had to prove their worthiness by facing a series of challenging trials. These trials encompassed various gameplay aspects, such as combat, puzzle-solving, and teamwork, offering players a chance to demonstrate their skills and earn prestigious titles.', 66),
(96, 'Exoplanetary Exploration', 'b', TIMESTAMP('2022-12-14', '14:12:20'), TIMESTAMP('2023-07-29', '14:12:20'), TIMESTAMP('2023-09-01', '14:12:20'), 'The introduction of an interstellar spaceship system that allowed players to explore distant exoplanets and celestial bodies. This expansion of the servers universe opened up opportunities for planetary colonization, resource gathering, and extraterrestrial adventures.', 80),
(98, 'Mystic Tournaments of the Elements', 'b', TIMESTAMP('2022-04-16', '14:12:20'), TIMESTAMP('2023-11-14', '14:12:20'), TIMESTAMP('2023-03-03', '14:12:20'), 'An ongoing series of elemental tournaments where players competed in elemental battles, showcasing mastery over fire, water, earth, and air. The Mystic Tournaments of the Elements became a popular, recurring event that celebrated elemental combat skills and strategy.', 57),
(99, 'Cultural Exchange Festivals', 'b', TIMESTAMP('2021-12-10', '14:12:20'), TIMESTAMP('2023-08-14', '14:12:20'), TIMESTAMP('2023-07-11', '14:12:20'), 'The hosting of cultural exchange festivals where players celebrated the diverse traditions, lore, and art of different factions and regions within the server. These festivals promoted mutual understanding and appreciation of the servers rich cultural tapestry.', 13),
(102, 'Voyage of the Ghost Ship', 'b', TIMESTAMP('2022-09-25', '14:12:20'), TIMESTAMP('2023-06-20', '14:12:20'), TIMESTAMP('2022-06-12', '14:12:20'), 'A server-wide event where a legendary ghost ship sailed the servers oceans, bringing ghostly pirates, cursed treasures, and eerie mysteries. Players sailed to confront the spectral vessel, engaging in high-seas adventures and supernatural encounters.', 19),
(103, 'Starry Nights Celebration', 'b', TIMESTAMP('2023-08-07', '14:12:20'), TIMESTAMP('2025-11-29', '14:12:20'), TIMESTAMP('2021-10-13', '14:12:20'), 'A celestial celebration of the servers night skies, featuring stargazing parties, meteor showers, and celestial-themed events. The Starry Nights Celebration allowed players to appreciate the beauty of the servers night sky while indulging in nighttime adventures.', 89),
(104, 'Server-Wide Mosaic Art Project', 'b', TIMESTAMP('2022-10-19', '14:12:20'), TIMESTAMP('2024-02-16', '14:12:20'), TIMESTAMP('2021-06-09', '14:12:20'), 'A collaborative mosaic art project where players contributed individual tiles to create an enormous, server-wide mosaic. This creative endeavor celebrated the servers unity, diversity, and commitment to artistic expression.', 68),
(107, 'Pixel Art Revolution', 'b', TIMESTAMP('2023-03-05', '14:12:20'), TIMESTAMP('2025-03-05', '14:12:20'), TIMESTAMP('2023-03-12', '14:12:20'), 'A pixel art movement that swept the server, resulting in large-scale pixel art installations, breathtaking landscapes, and intricate creations. The Pixel Art Revolution showcased the servers creative prowess and passion for artistic expression.', 59),
(108, 'The Gilded Labyrinth', 'b', TIMESTAMP('2023-05-09', '14:12:20'), TIMESTAMP('2026-01-21', '14:12:20'), TIMESTAMP('2022-10-26', '14:12:20'), 'The discovery of the Gilded Labyrinth, a grand and ornate maze filled with golden treasures and intricate chambers. Players navigated the labyrinths puzzles and traps in pursuit of riches and fame, turning it into an iconic symbol of adventure on the server.', 74),
(109, 'Ender Dragon Hunt', 'b', TIMESTAMP('2023-05-05', '14:12:20'), TIMESTAMP('2024-09-01', '14:12:20'), TIMESTAMP('2021-12-11', '14:12:20'), 'In a grand collaborative effort, players banded together to face the fearsome Ender Dragon in the perilous realm of the End. The battle was intense, with players strategically taking on the dragon, and the event culminated in the dragons defeat. This epic showdown was not just a testament to bravery but also a celebration of teamwork, as players shared the Ends treasure and glory.', 63),
(111, 'Sky Island Showdown', 'b', TIMESTAMP('2023-03-11', '14:12:20'), TIMESTAMP('2024-04-08', '14:12:20'), TIMESTAMP('2021-07-28', '14:12:20'), 'In a thrilling competition, players constructed their floating islands high in the sky, showcasing their creativity and architectural prowess. The Sky Island Showdown was a stunning spectacle of diverse designs and complex redstone creations, proving that Minecrafts creative potential knows no bounds.', 51),
(112, 'Ancient Ruins Exploration', 'b', TIMESTAMP('2021-07-26', '14:12:20'), TIMESTAMP('2024-04-16', '14:12:20'), TIMESTAMP('2022-02-28', '14:12:20'), 'Adventurers embarked on an archaeological expedition to uncover the secrets of ancient ruins hidden deep within the servers world. These ruins, shrouded in mystery, revealed clues about the servers lore and history. As players delved into the depths, they unveiled fascinating artifacts and pieced together the servers intriguing narrative.', 61),
(114, 'Emerald Trading Fair', 'b', TIMESTAMP('2022-10-22', '14:12:20'), TIMESTAMP('2023-10-24', '14:12:20'), TIMESTAMP('2021-04-09', '14:12:20'), 'The Emerald Trading Fair brought together traders and collectors from across the server, offering a platform to barter rare items, enchantments, and custom gear. This bustling marketplace provided a unique opportunity for players to exchange resources and build lasting economic relationships.', 30),
(116, 'Pixel Art Showcase', 'b', TIMESTAMP('2022-07-17', '14:12:20'), TIMESTAMP('2025-03-28', '14:12:20'), TIMESTAMP('2021-04-22', '14:12:20'), 'The Pixel Art Showcase was a celebration of creativity in its purest form. Players competed to create stunning pixel art designs that ranged from intricate portraits to massive landscapes. The event demonstrated the servers dedication to artistic expression within the Minecraft world.', 33),
(117, 'Grand Elemental Convergence', 'b', TIMESTAMP('2021-04-18', '14:12:20'), TIMESTAMP('2022-10-18', '14:12:20'), TIMESTAMP('2021-06-01', '14:12:20'), 'A cosmic event where the elemental planes aligned, causing elemental magic to surge across the servers world. Players harnessed the power of the elements, participating in elemental competitions and collaborating to maintain balance amidst the elemental chaos.', 40),
(118, 'Era of Aetherial Realms', 'b', TIMESTAMP('2023-04-07', '14:12:20'), TIMESTAMP('2025-03-13', '14:12:20'), TIMESTAMP('2021-07-02', '14:12:20'), 'The unveiling of the Aetherial Realms, a collection of ethereal dimensions accessible through celestial gateways. These realms introduced mystical biomes, surreal landscapes, and unique challenges, adding an otherworldly dimension to exploration and adventure.', 18),
(123, 'Epic Wandering Merchant Caravan', 'b', TIMESTAMP('2021-05-14', '14:12:20'), TIMESTAMP('2023-10-19', '14:12:20'), TIMESTAMP('2021-10-12', '14:12:20'), 'A server-wide event featuring a wandering merchant caravan that roamed the server, offering exotic and rare goods. Players could trade, engage in caravan protection missions, and discover fascinating stories within the caravans nomadic lifestyle.', 22),
(127, 'Benevolent Guardians of the Grove', 'b', TIMESTAMP('2023-07-03', '14:12:20'), TIMESTAMP('2025-04-27', '14:12:20'), TIMESTAMP('2023-04-12', '14:12:20'), 'The awakening of benevolent forest guardians that watched over the servers woodlands and natural realms. Players collaborated with these guardians, preserving the servers environment, and engaging in quests to restore balance and harmony.', 43),
(128, 'Era of Timeless Realms', 'b', TIMESTAMP('2023-04-08', '14:12:20'), TIMESTAMP('2025-01-29', '14:12:20'), TIMESTAMP('2022-01-16', '14:12:20'), 'The unveiling of Timeless Realms, enigmatic dimensions where time flowed differently, featuring various historical eras, futuristic realms, and alternate timelines. Players could explore these realms and participate in time-travel quests, unraveling the mysteries of the multiverse.', 4),
(132, 'Enchanted Enigma Garden', 'b', TIMESTAMP('2023-05-11', '14:12:20'), TIMESTAMP('2025-08-19', '14:12:20'), TIMESTAMP('2022-01-12', '14:12:20'), 'The revelation of the Enigma Garden, a realm of mystical flora, sentient plant creatures, and mesmerizing biomes. Players explored this vibrant dimension, deciphered plant-based puzzles, and forged connections with the sentient plant life that inhabited the garden.', 76),
(134, 'Minecraft Artisan Festival', 'b', TIMESTAMP('2021-04-02', '14:12:20'), TIMESTAMP('2021-07-04', '14:12:20'), TIMESTAMP('2023-06-17', '14:12:20'), 'A festival dedicated to celebrating the servers artisans, crafters, and builders. The Artisan Festival featured craft fairs, artistic exhibitions, and architectural showcases, highlighting the servers skilled creators and their impressive works.', 65),
(135, 'Chronicles of the Cosmic Codex', 'b', TIMESTAMP('2022-07-01', '14:12:20'), TIMESTAMP('2024-02-08', '14:12:20'), TIMESTAMP('2022-08-02', '14:12:20'), 'The creation of a cosmic codex that detailed the servers lore, history, and interconnected stories. Players contributed to the codex, further enriching the servers narrative, and providing a comprehensive record of its evolving universe.', 23),
(136, 'Skyborne Odyssey', 'b', TIMESTAMP('2023-02-08', '14:12:20'), TIMESTAMP('2023-07-29', '14:12:20'), TIMESTAMP('2022-02-19', '14:12:20'), 'The introduction of airships and skybound adventures. Players could embark on aerial expeditions, sky pirate raids, and explore floating islands, embracing a new dimension of exploration and strategic gameplay.', 13),
(139, 'Feywild Enchantment', 'b', TIMESTAMP('2022-10-05', '14:12:20'), TIMESTAMP('2023-07-11', '14:12:20'), TIMESTAMP('2023-05-26', '14:12:20'), 'The unveiling of the Feywild, a whimsical dimension inhabited by fey creatures, enchanted forests, and captivating lore. Players ventured into this enchanting realm, experiencing its magical adventures, captivating stories, and immersive experiences.', 9),
(140, 'Voyage to the Center of the Earth', 'b', TIMESTAMP('2021-07-30', '14:12:20'), TIMESTAMP('2022-07-15', '14:12:20'), TIMESTAMP('2023-06-27', '14:12:20'), 'A daring expedition that led players on a journey to the servers subterranean core. Explorers delved deeper than ever before, encountering lava chambers, underground civilizations, and discovering the secrets hidden beneath the servers surface.', 68),
(142, 'Era of Mythic Reckoning', 'b', TIMESTAMP('2023-03-12', '14:12:20'), TIMESTAMP('2024-09-13', '14:12:20'), TIMESTAMP('2021-12-04', '14:12:20'), 'A period marked by the resurgence of mythical creatures, divine beings, and ancient legends that influenced server lore and narrative. Players engaged with these mythic entities, shaping the course of the servers history and mythos.', 29),
(146, 'Epic Spleef Tournament', 'b', TIMESTAMP('2022-02-23', '14:12:20'), TIMESTAMP('2023-04-30', '14:12:20'), TIMESTAMP('2023-01-20', '14:12:20'), 'The servers most skilled Spleef players competed in a high-stakes tournament, showcasing their precise timing and tactics. The Epic Spleef Tournament was a fast-paced and entertaining event that kept spectators on the edge of their seats.', 69),
(147, 'Mega Build Competition', 'b', TIMESTAMP('2023-07-31', '14:12:20'), TIMESTAMP('2025-05-19', '14:12:20'), TIMESTAMP('2021-02-27', '14:12:20'), 'Builders from all corners of the server gathered to create colossal structures. The Mega Build Competition challenged participants to push their architectural skills to the limit, resulting in jaw-dropping creations that left a lasting mark on the servers landscape.', 70),
(151, 'Redstone Expo', 'b', TIMESTAMP('2022-07-18', '14:12:20'), TIMESTAMP('2022-09-15', '14:12:20'), TIMESTAMP('2021-09-17', '14:12:20'), 'Redstone enthusiasts and engineers came together to display their most ingenious contraptions and inventions. The Redstone Expo was a showcase of automated farms, elaborate traps, and mesmerizing contraptions that pushed the boundaries of Minecraft mechanics.', 65),
(153, 'Dragon Egg Capture', 'b', TIMESTAMP('2023-07-11', '14:12:20'), TIMESTAMP('2025-12-28', '14:12:20'), TIMESTAMP('2022-02-21', '14:12:20'), 'An event where players aimed to capture the elusive dragon egg, which was a trophy of the Ender Dragons defeat. The Dragon Egg Capture event required players to demonstrate their wit and teamwork to secure the precious artifact.', 41),
(155, 'Nether Hub Building Contest', 'b', TIMESTAMP('2021-08-17', '14:12:20'), TIMESTAMP('2023-07-04', '14:12:20'), TIMESTAMP('2023-08-01', '14:12:20'), 'The Nether Hub Building Contest tasked players with designing and constructing an intricate transportation hub in the Nether. The resulting network of tunnels and portals enhanced the servers connectivity and aesthetics.', 68),
(157, 'Aqua Park Water Slide Race', 'b', TIMESTAMP('2022-05-07', '14:12:20'), TIMESTAMP('2024-04-13', '14:12:20'), TIMESTAMP('2023-11-02', '14:12:20'), 'Players designed and raced down elaborate water slides in an exhilarating competition. The Aqua Park Water Slide Race was a playful and refreshing event, showcasing the servers commitment to fun and creativity.', 83),
(158, 'Ancient Village Restoration', 'b', TIMESTAMP('2022-06-18', '14:12:20'), TIMESTAMP('2025-01-26', '14:12:20'), TIMESTAMP('2021-07-25', '14:12:20'), 'Players collaborated to restore a long-abandoned village, breathing new life into the historic site. The Ancient Village Restoration event combined building and community efforts, resulting in a vibrant and bustling location.', 32),
(160, 'Netherite Scavenger Hunt', 'b', TIMESTAMP('2022-08-27', '14:12:20'), TIMESTAMP('2024-08-01', '14:12:20'), TIMESTAMP('2022-10-19', '14:12:20'), 'Participants combed through the servers caves in search of Netherite, the coveted upgrade for their gear. The Netherite Scavenger Hunt was a thrilling quest for the servers most valuable resource.', 49),
(161, 'Enchanted Book Bazaar', 'b', TIMESTAMP('2021-08-20', '14:12:20'), TIMESTAMP('2022-03-20', '14:12:20'), TIMESTAMP('2023-02-09', '14:12:20'), 'Enthusiasts of enchanting books gathered to trade, buy, and sell their precious tomes. The Enchanted Book Bazaar was a hub for enchanting enthusiasts, providing access to powerful enchantments and rare books.', 21),
(162, 'Village Trading Fair', 'b', TIMESTAMP('2023-04-07', '14:12:20'), TIMESTAMP('2023-05-01', '14:12:20'), TIMESTAMP('2021-04-17', '14:12:20'), 'Villagers from various server settlements convened to trade their unique resources and items. The Village Trading Fair was a bustling marketplace, fostering camaraderie and commerce among the servers diverse villages.', 82),
(168, 'Underworld Unleashed: Realm of Shadows', 'b', TIMESTAMP('2023-04-03', '14:12:20'), TIMESTAMP('2023-07-29', '14:12:20'), TIMESTAMP('2021-07-29', '14:12:20'), 'The revelation of the Realm of Shadows, a dark dimension shrouded in mystery and enigma. Players delved into this realm, confronting eerie creatures, navigating through shadowy labyrinths, and uncovering hidden narratives that connected to the servers lore.', 28),
(170, 'Enigmatic Monoliths Discovery', 'b', TIMESTAMP('2023-04-01', '14:12:20'), TIMESTAMP('2025-08-26', '14:12:20'), TIMESTAMP('2023-02-22', '14:12:20'), 'The discovery of enigmatic monoliths scattered across the servers landscapes. Players embarked on an exploration quest to unlock the secrets of these monoliths, revealing ancient knowledge, enchantments, and mystical abilities.', 6),
(172, 'Mystic Mages Guild', 'b', TIMESTAMP('2022-08-20', '14:12:20'), TIMESTAMP('2024-08-08', '14:12:20'), TIMESTAMP('2022-07-26', '14:12:20'), 'The establishment of a Mages Guild dedicated to the arcane arts. Players could join the guild, mastering magical disciplines, conducting magical experiments, and participating in quests that unveiled the depths of the servers magic.', 17),
(173, 'Chronicles of the Enchanted Library', 'b', TIMESTAMP('2023-08-20', '14:12:20'), TIMESTAMP('2025-07-31', '14:12:20'), TIMESTAMP('2023-06-27', '14:12:20'), 'The creation of an enchanted library that stored the servers vast knowledge and history. Players contributed books, manuscripts, and lore to the library, forming an extensive collection of server stories and wisdom for all to access.', 69),
(174, 'Skyrealm Symphony Concert', 'b', TIMESTAMP('2022-06-05', '14:12:20'), TIMESTAMP('2023-10-14', '14:12:20'), TIMESTAMP('2021-02-22', '14:12:20'), 'An enchanting concert held within the servers Skyrealm, featuring orchestral performances amidst the celestial backdrop. Players gathered to enjoy live symphonic music and celestial views, enhancing the servers cultural experiences.', 79),
(176, 'Festival of the Luminous Moths', 'b', TIMESTAMP('2021-12-05', '14:12:20'), TIMESTAMP('2023-05-27', '14:12:20'), TIMESTAMP('2022-12-10', '14:12:20'), 'A whimsical festival that celebrated the Luminous Moths of the server. Players joined in moth-themed contests, illuminating the night with lanterns, and embarked on quests that explored the mystical realm of the Luminous Moths.', 91),
(177, 'Feywild Courts Masquerade', 'b', TIMESTAMP('2023-10-05', '14:12:20'), TIMESTAMP('2024-07-26', '14:12:20'), TIMESTAMP('2021-05-20', '14:12:20'), 'A grand masquerade ball hosted by the Feywild Court, a realm inhabited by fey creatures. Players donned enchanting masks, danced in fey-themed ballrooms, and engaged with the fey in an ethereal and magical celebration.', 5),
(181, 'Sorcerers Duels Extravaganza', 'b', TIMESTAMP('2022-05-05', '14:12:20'), TIMESTAMP('2023-08-30', '14:12:20'), TIMESTAMP('2021-08-12', '14:12:20'), 'A grand magical tournament where players engaged in sorcerers duels, showcasing their mastery of arcane arts. The Sorcerers Duels Extravaganza celebrated magical combat and strategy, drawing players into thrilling battles of magic and wits.', 5),
(182, 'Server-Wide Skyfaring Society', 'b', TIMESTAMP('2021-05-22', '14:12:20'), TIMESTAMP('2022-12-27', '14:12:20'), TIMESTAMP('2023-06-10', '14:12:20'), 'The foundation of a Skyfaring Society, dedicated to exploring the servers aerial realms and skies. Society members undertook airborne adventures, manned airships, and navigated floating islands, promoting exploration of the skies.', 71),
(183, 'Celestial Beacon Illumination', 'b', TIMESTAMP('2021-08-01', '14:12:20'), TIMESTAMP('2024-01-17', '14:12:20'), TIMESTAMP('2021-11-04', '14:12:20'), 'A celestial event where players lit celestial beacons that marked significant locations across the server. The illumination of these beacons signified the servers unity and direction, symbolizing the light that guided the community.', 39),
(184, 'Era of Mythic Chronicles', 'b', TIMESTAMP('2021-03-08', '14:12:20'), TIMESTAMP('2021-12-21', '14:12:20'), TIMESTAMP('2022-06-07', '14:12:20'), 'An era devoted to documenting the servers myths, legends, and folklore. Players contributed to a growing compendium of mythic tales, exploring the rich mythos that shaped the servers lore and history.', 14),
(185, 'Dimensional Nexus Convergence', 'b', TIMESTAMP('2022-04-26', '14:12:20'), TIMESTAMP('2024-04-10', '14:12:20'), TIMESTAMP('2022-10-26', '14:12:20'), 'The convergence of multiple server dimensions at a central nexus point. Players could traverse between dimensions, unlocking cross-dimensional quests, and uncovering the nexuss role in the servers interconnected multiverse.', 38),
(186, 'The Eternal Carnival', 'b', TIMESTAMP('2022-10-16', '14:12:20'), TIMESTAMP('2023-04-14', '14:12:20'), TIMESTAMP('2023-05-12', '14:12:20'), 'A never-ending carnival that materialized within the server, featuring whimsical attractions, enchanting parades, and carnival games. The Eternal Carnival provided an ongoing source of entertainment and festivity for all players.', 22),
(190, 'Holographic Quest Realms', 'b', TIMESTAMP('2023-09-09', '14:12:20'), TIMESTAMP('2025-06-09', '14:12:20'), TIMESTAMP('2021-03-07', '14:12:20'), 'The unveiling of holographic quest realms, which projected immersive, interactive environments. Players embarked on quests within these realms, enjoying holographic adventures and puzzles that transcended traditional gameplay.', 5),
(192, 'Mystic Riddle of the Sphynx', 'b', TIMESTAMP('2022-04-05', '14:12:20'), TIMESTAMP('2022-06-11', '14:12:20'), TIMESTAMP('2023-01-19', '14:12:20'), 'An intricate event centered around solving the riddles posed by a mystic sphynx that appeared in the server. Players embarked on a quest to decipher the sphynxs enigmatic riddles and unlock its hidden wisdom.', 23),
(198, 'Treehouse Building Extravaganza', 'b', TIMESTAMP('2023-11-10', '14:12:20'), TIMESTAMP('2024-10-26', '14:12:20'), TIMESTAMP('2023-06-07', '14:12:20'), 'Builders took to the trees to construct elaborate treehouse villages in a breathtaking forest. The Treehouse Building Extravaganza was a celebration of arboreal architecture, demonstrating the servers commitment to creativity and unique construction.', 57),
(202, 'The Great Server Wall Construction', 'b', TIMESTAMP('2021-11-23', '14:12:20'), TIMESTAMP('2023-01-27', '14:12:20'), TIMESTAMP('2023-04-14', '14:12:20'), 'In a massive community project, players collaborated to build a colossal protective wall around the servers central city. The Great Server Wall Construction showcased the servers commitment to safety and teamwork.', 43),
(203, 'Haunted Forest Exploration', 'b', TIMESTAMP('2023-09-30', '14:12:20'), TIMESTAMP('2026-01-04', '14:12:20'), TIMESTAMP('2021-06-29', '14:12:20'), 'Adventurers delved into a spooky Haunted Forest, filled with eerie sounds, ghostly apparitions, and hidden mysteries. The Haunted Forest Exploration was a spine-tingling adventure that celebrated the servers love for atmospheric storytelling.', 66),
(206, 'Nether Roof Parkour Challenge', 'b', TIMESTAMP('2022-11-04', '14:12:20'), TIMESTAMP('2023-10-10', '14:12:20'), TIMESTAMP('2022-12-15', '14:12:20'), 'Players tackled a challenging parkour course on the perilous Nether Roof, testing their agility and determination. The Nether Roof Parkour Challenge was a daredevils dream that showcased the servers love for extreme challenges.', 85),
(207, 'Minecraft Art Gallery', 'b', TIMESTAMP('2022-11-30', '14:12:20'), TIMESTAMP('2023-07-05', '14:12:20'), TIMESTAMP('2023-08-26', '14:12:20'), 'The Minecraft Art Gallery displayed masterpieces created by the servers talented artists. The event celebrated the diversity of artistic talent within the community and allowed players to appreciate stunning in-game artwork.', 47),
(208, 'Potion Brewing Championship', 'b', TIMESTAMP('2022-07-16', '14:12:20'), TIMESTAMP('2023-02-11', '14:12:20'), TIMESTAMP('2022-02-09', '14:12:20'), 'Alchemists and potion enthusiasts competed in a brewing championship to craft the most potent and unique potions. The Potion Brewing Championship was a showcase of the servers dedication to the magical arts.', 91),
(209, 'Winter Wonderland Festival', 'b', TIMESTAMP('2023-06-21', '14:12:20'), TIMESTAMP('2025-04-13', '14:12:20'), TIMESTAMP('2021-10-30', '14:12:20'), 'During the holiday season, the server transformed into a Winter Wonderland, complete with snowy landscapes, festive decorations, and fun winter activities. The Winter Wonderland Festival was a heartwarming and joyful celebration.', 50),
(210, 'Underground Labyrinth Challenge', 'b', TIMESTAMP('2021-06-11', '14:12:20'), TIMESTAMP('2023-11-02', '14:12:20'), TIMESTAMP('2023-10-16', '14:12:20'), 'Players delved into a complex underground labyrinth filled with traps, puzzles, and valuable treasures. The Underground Labyrinth Challenge was a test of wit and bravery, showcasing the servers love for intricate adventures.', 15),
(211, 'Minecraft Education Seminar', 'b', TIMESTAMP('2023-09-11', '14:12:20'), TIMESTAMP('2025-07-19', '14:12:20'), TIMESTAMP('2022-01-05', '14:12:20'), 'The server hosted a Minecraft education seminar, where players and educators discussed the educational benefits of the game and shared creative ways to use Minecraft in learning environments.', 54),
(218, 'Aquatic Adventure Treasure Hunt', 'b', TIMESTAMP('2021-08-01', '14:12:20'), TIMESTAMP('2024-01-24', '14:12:20'), TIMESTAMP('2021-10-07', '14:12:20'), 'Daring adventurers explored the servers expansive oceans in search of hidden underwater treasures. The Aquatic Adventure Treasure Hunt was a wet and wild adventure that celebrated the servers love for aquatic exploration.', 58),
(219, 'Minecraft History Museum Opening', 'b', TIMESTAMP('2021-11-14', '14:12:20'), TIMESTAMP('2023-03-13', '14:12:20'), TIMESTAMP('2021-07-19', '14:12:20'), 'A grand opening of the Minecraft History Museum, which showcased the servers rich history through exhibits, artifacts, and interactive displays. The event highlighted the servers sense of heritage and storytelling.', 15),
(220, 'Epic Snowball Fight', 'b', TIMESTAMP('2021-10-17', '14:12:20'), TIMESTAMP('2021-12-06', '14:12:20'), TIMESTAMP('2022-09-17', '14:12:20'), 'In a lighthearted and snowy showdown, players engaged in a massive snowball fight across a winter landscape. The Epic Snowball Fight was a fun and festive event that celebrated the joy of the winter season.', 64),
(221, 'Sculpture Garden Showcase', 'b', TIMESTAMP('2021-09-17', '14:12:20'), TIMESTAMP('2022-01-11', '14:12:20'), TIMESTAMP('2021-10-29', '14:12:20'), 'Builders and artists unveiled their most impressive sculptures in a beautifully landscaped garden. The Sculpture Garden Showcase was a visual delight that celebrated the servers commitment to creativity and artistic expression.', 60),
(223, 'Epic Dragon Boat Race', 'b', TIMESTAMP('2022-04-25', '14:12:20'), TIMESTAMP('2022-05-29', '14:12:20'), TIMESTAMP('2023-03-04', '14:12:20'), 'Teams of players constructed dragon boats and raced across waterways in a thrilling aquatic competition. The Epic Dragon Boat Race was a test of teamwork and creativity on the high seas.', 1),
(224, 'End Portal Expedition', 'b', TIMESTAMP('2023-08-21', '14:12:20'), TIMESTAMP('2024-08-25', '14:12:20'), TIMESTAMP('2021-07-01', '14:12:20'), 'Adventurers embarked on a quest to activate the End Portal, opening a gateway to the End dimension. The End Portal Expedition was a journey of discovery, teamwork, and mystery, highlighting the servers love for exploration and adventure.', 39),
(225, 'Era of Celestial Alliances', 'b', TIMESTAMP('2021-07-04', '14:12:20'), TIMESTAMP('2024-01-05', '14:12:20'), TIMESTAMP('2022-09-06', '14:12:20'), 'An era marked by celestial beings forming alliances and guiding players in cosmic quests. Players aligned with these celestial factions, unlocking celestial powers and exploring the servers celestial mysteries.', 65),
(226, 'Epic Siege of the Abyssal Fortress', 'b', TIMESTAMP('2023-08-13', '14:12:20'), TIMESTAMP('2024-04-19', '14:12:20'), TIMESTAMP('2022-09-09', '14:12:20'), 'A server-wide event where players united to siege the Abyssal Fortress, an imposing structure hidden within the Abyssal Abyss. This grand siege required cooperation, strategy, and resourcefulness to conquer the fortress, resulting in epic battles and heroic achievements.', 76),
(228, 'Chronicles of the Celestial Atlas', 'b', TIMESTAMP('2022-11-24', '14:12:20'), TIMESTAMP('2023-11-13', '14:12:20'), TIMESTAMP('2022-04-22', '14:12:20'), 'The publication of the Celestial Atlas, an in-game compendium documenting the servers celestial phenomena, constellations, and astral lore. The atlas became a valuable resource for astronomers and stargazers within the server community.', 2),
(230, 'Crystal Labyrinth Expedition', 'b', TIMESTAMP('2022-04-19', '14:12:20'), TIMESTAMP('2022-11-28', '14:12:20'), TIMESTAMP('2023-09-24', '14:12:20'), 'An expedition into the depths of the Crystal Labyrinth, an intricate maze filled with crystalline puzzles and enchantments. Players ventured into this labyrinth to unravel its mysteries and navigate its stunning crystalline landscapes.', 76),
(231, 'Grand Airship Regatta', 'b', TIMESTAMP('2021-10-30', '14:12:20'), TIMESTAMP('2022-07-04', '14:12:20'), TIMESTAMP('2023-01-16', '14:12:20'), 'A thrilling competition where players piloted their airships in a high-speed airship race through challenging aerial courses. The Grand Airship Regatta added an exhilarating element of flight and competition to the servers events.', 38),
(232, 'Era of Elemental Ascendancy II', 'b', TIMESTAMP('2023-08-25', '14:12:20'), TIMESTAMP('2023-12-05', '14:12:20'), TIMESTAMP('2023-01-16', '14:12:20'), 'The return of elemental dominance with a new generation of elemental factions and challenges. This era rekindled elemental battles, competitions, and strategic allegiances, shaping the servers political landscape.', 72),
(237, 'Sorcerers Apprentices Academy', 'b', TIMESTAMP('2023-09-01', '14:12:20'), TIMESTAMP('2025-12-29', '14:12:20'), TIMESTAMP('2022-09-27', '14:12:20'), 'The establishment of a Sorcerers Apprentices Academy, where players honed their magical skills and embarked on magical quests. The academy fostered magical education, camaraderie, and exploration of mystical arts.', 83),
(238, 'Chronicles of the Elemental Codex', 'b', TIMESTAMP('2023-08-14', '14:12:20'), TIMESTAMP('2024-09-21', '14:12:20'), TIMESTAMP('2022-02-07', '14:12:20'), 'The creation of the Elemental Codex, a comprehensive in-game compendium that detailed the servers elemental lore, showcasing elemental deities, elemental spells, and the cultural significance of elemental magic.', 41),
(240, 'Server-Wide Lunar Festival', 'b', TIMESTAMP('2022-10-20', '14:12:20'), TIMESTAMP('2024-07-19', '14:12:20'), TIMESTAMP('2023-04-15', '14:12:20'), 'A celestial festival celebrating the servers moon, featuring lunar-themed contests, moonlit parades, and lunar quests. The Lunar Festival brought an enchanting lunar atmosphere to the server, fostering an appreciation for the moon.', 55),
(242, 'Skyborne Elemental Ascent', 'b', TIMESTAMP('2022-02-08', '14:12:20'), TIMESTAMP('2022-04-12', '14:12:20'), TIMESTAMP('2021-08-18', '14:12:20'), 'A server-wide event where players ascended to the Skyborne Elemental Sanctum to gain the favor of elemental deities. Players participated in elemental trials, unlocking unique elemental abilities and experiencing awe-inspiring adventures in the sky.', 48),
(243, 'Era of Crystal Nexus Connections', 'b', TIMESTAMP('2022-07-07', '14:12:20'), TIMESTAMP('2022-07-07', '14:12:20'), TIMESTAMP('2021-05-30', '14:12:20'), 'A period marked by the unification of the servers diverse dimensions and realms through crystal nexus connections. Players could traverse between these realms, exploring interconnected quests, lore, and narratives that spanned the multiverse.', 70),
(244, 'Festival of Radiant Blossoms', 'b', TIMESTAMP('2021-02-20', '14:12:20'), TIMESTAMP('2022-09-18', '14:12:20'), TIMESTAMP('2022-04-23', '14:12:20'), 'A radiant festival celebrating the servers blooming flowers and vibrant flora. Players engaged in flower-themed contests, enchanting garden displays, and quests that celebrated the world of radiant blossoms.', 11),
(245, 'Phantom Guilds Intrigue', 'b', TIMESTAMP('2023-08-26', '14:12:20'), TIMESTAMP('2025-10-01', '14:12:20'), TIMESTAMP('2022-06-30', '14:12:20'), 'An event centered around a mysterious Phantom Guild that wielded enigmatic powers and shadowy schemes. Players embarked on espionage missions, uncovered the guilds secrets, and navigated through a web of intrigue and mysteries.', 64),
(248, 'Lunar Eclipse Battle Royale', 'b', TIMESTAMP('2021-10-02', '14:12:20'), TIMESTAMP('2022-06-24', '14:12:20'), TIMESTAMP('2023-02-22', '14:12:20'), 'A thrilling battle royale event held during a rare lunar eclipse. Players engaged in epic, lunar-themed battles under the eerie eclipse, combining celestial magic and strategy to secure victory.', 83),
(249, 'Era of Eternal Songs', 'b', TIMESTAMP('2021-02-26', '14:12:20'), TIMESTAMP('2021-08-09', '14:12:20'), TIMESTAMP('2021-11-24', '14:12:20'), 'A transformative era marked by the resurgence of ancient songs and musical legends that shaped the servers cultural and narrative landscape. Players engaged with musical beings, explored musical quests, and celebrated the power of music in the servers history.', 47),
(250, 'Astral Sandscape Odyssey', 'b', TIMESTAMP('2023-03-02', '14:12:20'), TIMESTAMP('2024-12-20', '14:12:20'), TIMESTAMP('2023-01-02', '14:12:20'), 'A cosmic journey into the Astral Sandscape, a dimension where players encountered celestial deserts, astral oases, and otherworldly phenomena. Players ventured into this unique dimension, navigating through astral challenges and unraveling cosmic mysteries.', 89),
(251, 'Minecraft Carnival of Marvels', 'b', TIMESTAMP('2022-07-20', '14:12:20'), TIMESTAMP('2023-02-12', '14:12:20'), TIMESTAMP('2021-07-01', '14:12:20'), 'A grand carnival that arrived on the server, featuring a wide array of minigames, circus performances, and astonishing attractions. The Carnival of Marvels brought a playful and festive atmosphere to the server, offering players a break from their usual adventures to enjoy games, competitions, and prizes.', 44),
(252, 'Grand Elemental Symposium', 'b', TIMESTAMP('2021-02-28', '14:12:20'), TIMESTAMP('2021-06-03', '14:12:20'), TIMESTAMP('2021-10-19', '14:12:20'), 'A grand gathering of elemental scholars and experts who shared their knowledge of the servers elemental lore and magic. Players participated in discussions, engaged in elemental research, and celebrated the servers rich elemental heritage.', 85),
(259, 'Elytra Racing League', 'b', TIMESTAMP('2023-05-21', '14:12:20'), TIMESTAMP('2023-07-08', '14:12:20'), TIMESTAMP('2023-03-16', '14:12:20'), 'The Elytra Racing League was a competitive circuit where players donned their Elytra wings to engage in exhilarating air races. The league featured diverse racecourses, including aerial obstacle courses, precision flying challenges, and speed trials. Participants needed to master Elytra flight mechanics, perform daring maneuvers, and optimize their glide paths. This event celebrated the servers dedication to airborne competition.', 16),
(263, 'Minecraft Farming Expo', 'b', TIMESTAMP('2022-10-10', '14:12:20'), TIMESTAMP('2025-04-26', '14:12:20'), TIMESTAMP('2023-02-23', '14:12:20'), 'The Minecraft Farming Expo was a sprawling event that celebrated the servers agricultural achievements. It featured an array of meticulously designed farms, from automated crop fields and livestock farms to sustainable resource hubs. The expo explored farming techniques, resource optimization, and showcased how players harnessed Minecrafts farming mechanics to feed the servers communities.', 58),
(265, 'PvE Dungeon Crawl Tournament', 'b', TIMESTAMP('2023-10-23', '14:12:20'), TIMESTAMP('2025-03-24', '14:12:20'), TIMESTAMP('2023-10-04', '14:12:20'), 'The PvE Dungeon Crawl Tournament was a player-versus-environment challenge, where adventurers tackled intricate dungeons filled with traps, puzzles, and powerful mobs. The event emphasized strategy, teamwork, and problem-solving skills as participants navigated through complex dungeon layouts, faced mini-bosses, and gathered valuable loot.', 3),
(267, 'Cave Biome Exploration Expedition', 'b', TIMESTAMP('2021-02-26', '14:12:20'), TIMESTAMP('2023-05-10', '14:12:20'), TIMESTAMP('2022-05-26', '14:12:20'), 'Adventurers embarked on a comprehensive journey to explore the diverse biomes hidden within the servers vast underground cave systems. This event highlighted the unique qualities of various underground biomes, such as lush cave networks, glow-like caverns, and more. Participants gained knowledge of cave ecosystems, resource distribution, and the servers approach to enhancing cave exploration.', 66),
(269, 'Minecraft University Graduation', 'b', TIMESTAMP('2023-10-27', '14:12:20'), TIMESTAMP('2025-11-03', '14:12:20'), TIMESTAMP('2023-08-26', '14:12:20'), 'Minecraft University Graduation celebrated the achievements of players who completed in-game courses and educational programs. The event explored the servers commitment to in-game learning, featuring graduation ceremonies, the presentation of virtual diplomas, and discussions about how Minecraft fosters valuable skills and knowledge.', 86),
(274, 'Minecraft Fashion Show', 'b', TIMESTAMP('2022-08-19', '14:12:20'), TIMESTAMP('2024-01-05', '14:12:20'), TIMESTAMP('2021-09-12', '14:12:20'), 'The Minecraft Fashion Show was a glamorous event that celebrated the servers most stylish and creative costume designers. Participants modeled a variety of intricate in-game outfits, demonstrating the artistry behind costume creation, from clothing designs to matching accessories. The event showcased the servers commitment to in-game fashion and style.', 7),
(277, 'Enderpearl Challenge Course', 'b', TIMESTAMP('2023-03-01', '14:12:20'), TIMESTAMP('2023-12-27', '14:12:20'), TIMESTAMP('2023-05-11', '14:12:20'), 'The Enderpearl Challenge Course was a high-intensity parkour challenge where players honed their Enderpearl throwing skills. Participants navigated complex courses filled with gaps, obstacles, and Enderpearl targets, testing their precision, timing, and mastery of this unique Minecraft mechanic.', 64),
(279, 'Biome-Specific Architecture Showcase', 'b', TIMESTAMP('2023-07-29', '14:12:20'), TIMESTAMP('2024-08-29', '14:12:20'), TIMESTAMP('2023-06-15', '14:12:20'), 'The Biome-Specific Architecture Showcase highlighted the servers architectural diversity by featuring intricate buildings tailored to specific biomes. The event explored how builders drew inspiration from biome aesthetics and landscapes to create unique structures, considering factors such as materials, design principles, and environmental integration.', 76),
(284, 'Minecraft Ecology Awareness Campaign', 'b', TIMESTAMP('2021-07-08', '14:12:20'), TIMESTAMP('2022-10-14', '14:12:20'), TIMESTAMP('2023-01-21', '14:12:20'), 'The Minecraft Ecology Awareness Campaign encouraged players to engage in eco-friendly practices and learn about the servers approach to environmental sustainability. Participants engaged in challenges and educational activities, including preserving natural landscapes, recycling materials, and supporting conservation efforts. The event aimed to raise awareness about the servers commitment to in-game environmental ethics.', 31),
(285, 'Exploration of the Nether Void', 'b', TIMESTAMP('2022-10-04', '14:12:20'), TIMESTAMP('2025-05-31', '14:12:20'), TIMESTAMP('2022-06-23', '14:12:20'), 'Adventurers embarked on an extraordinary journey into the depths of the Nether void, exploring the mysterious and desolate landscapes that exist beyond the Nethers typical biomes. The Exploration of the Nether Void event introduced participants to unique environments, resources, and challenges found in this uncharted territory.', 37),
(286, 'Enchanted Forest Photography Contest', 'b', TIMESTAMP('2021-09-03', '14:12:20'), TIMESTAMP('2022-01-13', '14:12:20'), TIMESTAMP('2021-07-08', '14:12:20'), 'The Enchanted Forest Photography Contest celebrated the servers most picturesque biome: the Enchanted Forest. Participants captured stunning screenshots and photographic compositions that highlighted the beauty and unique features of this server-exclusive biome. The event also explored the art of in-game photography, composition, and storytelling through images.', 23),
(290, 'End Biome Showcase', 'b', TIMESTAMP('2022-10-20', '14:12:20'), TIMESTAMP('2024-08-16', '14:12:20'), TIMESTAMP('2023-03-30', '14:12:20'), 'The End Biome Showcase delved into the unique biomes within the End dimension, such as the End Islands, Chorus Forest, and End Cities. Participants explored the aesthetics, challenges, and potential of these biomes, showcasing how the server enhanced the End dimension for adventurous exploration.', 82),
(291, 'Iron Golem Arena Spectacular', 'b', TIMESTAMP('2023-08-05', '14:12:20'), TIMESTAMP('2025-02-16', '14:12:20'), TIMESTAMP('2022-08-07', '14:12:20'), 'The Iron Golem Arena Spectacular was a grand competition where players trained and battled their Iron Golem companions in a dedicated arena. Participants learned about Iron Golem mechanics, behavior, and combat strategies, culminating in an action-packed spectacle.', 81),
(294, 'Minecraft Server Legacy Celebration', 'b', TIMESTAMP('2022-04-04', '14:12:20'), TIMESTAMP('2023-12-20', '14:12:20'), TIMESTAMP('2023-06-30', '14:12:20'), 'The Minecraft Server Legacy Celebration marked a significant milestone in the servers history, honoring its longstanding legacy and community achievements. This grand event reflected on the servers journey, shared stories of its founding and growth, and recognized the contributions of players, builders, and staff members who shaped the servers history.', 39),
(295, 'The Great Nether Expedition', 'b', TIMESTAMP('2022-03-14', '14:12:20'), TIMESTAMP('2022-08-06', '14:12:20'), TIMESTAMP('2022-04-09', '14:12:20'), 'The Great Nether Expedition was a remarkable event that brought adventurers from all corners of the server together to explore the treacherous Nether dimension. With powerful gear and strategic cooperation, participants braved the fiery depths in search of rare resources, fortresses, and bastions. They navigated through an eerie landscape, battling hordes of hostile mobs while collecting valuable materials like ancient debris, Netherite, and blaze rods. The expedition was a testament to the servers camaraderie and bravery.', 2),
(298, 'The Enchanted Forest Quest', 'b', TIMESTAMP('2021-03-16', '14:12:20'), TIMESTAMP('2021-08-23', '14:12:20'), TIMESTAMP('2022-12-28', '14:12:20'), 'The Enchanted Forest Quest was an enchanting adventure that sent players deep into a mystical forest teeming with magical creatures and hidden secrets. Armed with nothing but their wits and limited gear, participants embarked on a journey to solve riddles, complete challenges, and unravel the mysteries of the forest. The forest was filled with unique flora and fauna, and only those who demonstrated resourcefulness and clever problem-solving could emerge victorious.', 76),
(302, 'Ender Dragon Slayer Showdown', 'b', TIMESTAMP('2021-04-07', '14:12:20'), TIMESTAMP('2022-04-15', '14:12:20'), TIMESTAMP('2023-06-16', '14:12:20'), 'The Ender Dragon Slayer Showdown was an exhilarating competition where players tested their combat skills against the formidable Ender Dragon. Participants formed teams and entered the End dimension to face off against this legendary foe. They fought strategically to defeat the dragon while managing Endermen and the dragons devastating attacks. The showdown was a thrilling display of bravery, strategy, and teamwork.', 40),
(303, 'The Great Biome Expedition', 'b', TIMESTAMP('2022-08-09', '14:12:20'), TIMESTAMP('2022-08-27', '14:12:20'), TIMESTAMP('2022-11-15', '14:12:20'), 'The Great Biome Expedition was an ambitious journey where players set out to explore the servers vast world and document its diverse biomes. They collected samples of unique flora and fauna, creating a comprehensive atlas of the servers natural landscapes. This event celebrated the beauty and biodiversity of Minecrafts terrain.', 70),
(304, 'The Ender Pearl Relay Race', 'b', TIMESTAMP('2022-04-24', '14:12:20'), TIMESTAMP('2023-10-24', '14:12:20'), TIMESTAMP('2021-11-10', '14:12:20'), 'The Ender Pearl Relay Race was a fast-paced competition that required players to traverse treacherous landscapes using ender pearls. Teams passed ender pearls among themselves, teleporting through challenging obstacles and terrain. Speed, precision, and teamwork were essential to claim victory in this high-stakes relay.', 5),
(306, 'The Redstone Rollercoaster Extravaganza', 'b', TIMESTAMP('2021-05-28', '14:12:20'), TIMESTAMP('2023-04-17', '14:12:20'), TIMESTAMP('2023-09-21', '14:12:20'), 'The Redstone Rollercoaster Extravaganza was a showcase of creative rollercoaster designs, each enhanced with intricate redstone-powered features. Players constructed thrilling rollercoasters, incorporating boosters, minecart switches, and pulse-activated surprises. Visitors rode these rollercoasters, experiencing the servers most exhilarating rides.', 2),
(307, 'The Underground Arena Championship', 'b', TIMESTAMP('2022-01-22', '14:12:20'), TIMESTAMP('2023-08-06', '14:12:20'), TIMESTAMP('2021-04-21', '14:12:20'), 'The Underground Arena Championship was a fierce PvP competition held in an expansive underground arena. Teams battled within dimly lit tunnels, using strategy and cunning to outmaneuver their opponents. The event was a test of close-quarters combat skills and adaptability in a confined space.', 50),
(308, 'The Giant Pumpkin Carving Contest', 'b', TIMESTAMP('2023-04-02', '14:12:20'), TIMESTAMP('2024-06-22', '14:12:20'), TIMESTAMP('2021-06-26', '14:12:20'), 'The Giant Pumpkin Carving Contest encouraged players to unleash their artistic talents by carving giant pumpkins. These colossal pumpkins served as canvases for intricate designs, and participants used a variety of tools to create stunning, illuminated masterpieces. The event added a touch of Halloween charm to the server.', 58),
(310, 'The Elemental Dungeon Challenge', 'b', TIMESTAMP('2022-05-23', '14:12:20'), TIMESTAMP('2024-04-08', '14:12:20'), TIMESTAMP('2021-11-04', '14:12:20'), 'The Elemental Dungeon Challenge was an epic quest where players delved into four distinct elemental dungeons, each filled with elemental-themed puzzles and monsters. Participants had to unlock the secrets of earth, water, fire, and air to progress and earn valuable rewards.', 86),
(312, 'The End Portal Race', 'b', TIMESTAMP('2023-06-24', '14:12:20'), TIMESTAMP('2025-05-16', '14:12:20'), TIMESTAMP('2023-06-28', '14:12:20'), 'The End Portal Race was a thrilling competition that challenged players to find and activate End portals scattered throughout the server. The first team to successfully activate the End portal and confront the Ender Dragon emerged victorious. The race tested navigation skills and resourcefulness.', 5),
(314, 'The Ocean Monument Expedition', 'b', TIMESTAMP('2021-04-07', '14:12:20'), TIMESTAMP('2023-02-17', '14:12:20'), TIMESTAMP('2022-08-03', '14:12:20'), 'The Ocean Monument Expedition was an aquatic adventure where players teamed up to conquer the depths of ocean monuments. Armed with underwater breathing potions and specialized gear, they battled guardian mobs and solved underwater puzzles to claim rare sea lanterns and prismarine treasures.', 68),
(317, 'The Server-Wide Art Gallery', 'b', TIMESTAMP('2021-03-08', '14:12:20'), TIMESTAMP('2021-09-19', '14:12:20'), TIMESTAMP('2021-05-29', '14:12:20'), 'The Server-Wide Art Gallery showcased the creative talents of players, allowing them to display their unique artwork within a grand exhibition hall. From pixel art to sculptures, participants contributed pieces that highlighted the servers artistic diversity and appreciation for visual expression.', 14),
(320, 'The Redstone Escape Room Challenge', 'b', TIMESTAMP('2023-05-11', '14:12:20'), TIMESTAMP('2024-09-24', '14:12:20'), TIMESTAMP('2022-02-08', '14:12:20'), 'The Redstone Escape Room Challenge tasked players with navigating a series of intricate redstone-powered escape rooms. To succeed, participants had to solve puzzles, unlock doors, and overcome obstacles by leveraging redstone mechanisms and logic. It was a test of problem-solving and ingenuity.', 47),
(323, 'The Skyblock Skydive Spectacular', 'b', TIMESTAMP('2021-11-15', '14:12:20'), TIMESTAMP('2024-03-14', '14:12:20'), TIMESTAMP('2022-09-14', '14:12:20'), 'The Skyblock Skydive Spectacular was a gravity-defying event where players leaped from the floating islands of a custom skyblock world. Using elytra wings, participants glided and soared through the sky, navigating complex courses, and performing breathtaking aerobatics. It was a celebration of flight and acrobatics.', 72),
(326, 'Volcano Expedition', 'b', TIMESTAMP('2022-07-27', '14:12:20'), TIMESTAMP('2023-10-27', '14:12:20'), TIMESTAMP('2022-02-09', '14:12:20'), 'Players embarked on a daring journey to explore a recently discovered active volcano on the server. The Volcano Expedition offered participants a unique opportunity to study volcanic geology, lava mechanics, and the environmental impact of volcanic activity.', 10),
(328, 'Minecraft Space Race', 'b', TIMESTAMP('2023-10-15', '14:12:20'), TIMESTAMP('2026-05-28', '14:12:20'), TIMESTAMP('2023-09-29', '14:12:20'), 'The Minecraft Space Race was a thrilling competition where players designed and launched their custom-built rockets to reach the outer limits of the servers world. The event explored the intricacies of space travel, including rocket design, launch mechanics, and celestial navigation.', 25),
(330, 'Guardian Farm Construction Showcase', 'b', TIMESTAMP('2022-12-26', '14:12:20'), TIMESTAMP('2023-05-28', '14:12:20'), TIMESTAMP('2022-05-31', '14:12:20'), 'The Guardian Farm Construction Showcase detailed the design and construction of a massive guardian farm, demonstrating how players harnessed ocean monuments to create efficient resource farms. The event delved into guardian spawning mechanics, design choices, and farm optimization.', 84),
(333, 'Beneath the Bedrock: Bedrock Edition Showcase', 'b', TIMESTAMP('2021-11-21', '14:12:20'), TIMESTAMP('2023-03-26', '14:12:20'), TIMESTAMP('2022-12-03', '14:12:20'), '"Beneath the Bedrock" was a special event that explored the unique features and experiences available to players in the Bedrock Edition of Minecraft. Participants discussed the gameplay mechanics, compatibility, and server-specific opportunities that set the Bedrock Edition apart from other versions.', 77),
(335, 'Lost City Archaeology Expedition', 'b', TIMESTAMP('2021-05-22', '14:12:20'), TIMESTAMP('2021-07-18', '14:12:20'), TIMESTAMP('2023-01-26', '14:12:20'), 'The Lost City Archaeology Expedition took players on a journey to explore and excavate a long-lost city buried beneath the servers landscape. Participants uncovered historical artifacts, deciphered ancient inscriptions, and pieced together the citys enigmatic history.', 20),
(337, 'Coral Reef Conservation Awareness', 'b', TIMESTAMP('2021-07-17', '14:12:20'), TIMESTAMP('2023-10-13', '14:12:20'), TIMESTAMP('2021-07-15', '14:12:20'), 'The Coral Reef Conservation Awareness event raised awareness about the importance of protecting and preserving the servers coral reefs. Participants discussed the unique ecology of coral reefs, threats to their survival, and conservation efforts implemented within the server.', 10),
(338, 'Biome-Specific Survival Challenges', 'b', TIMESTAMP('2021-12-28', '14:12:20'), TIMESTAMP('2024-03-24', '14:12:20'), TIMESTAMP('2023-03-11', '14:12:20'), 'The Biome-Specific Survival Challenges were a series of events in which players tested their survival skills in various server biomes. Each challenge focused on different biome-specific obstacles, resources, and strategies, allowing participants to adapt and thrive in diverse environments.', 67),
(340, 'Enderman Behavior Observation', 'b', TIMESTAMP('2022-07-25', '14:12:20'), TIMESTAMP('2025-02-13', '14:12:20'), TIMESTAMP('2021-04-04', '14:12:20'), 'In the Enderman Behavior Observation event, players conducted experiments to study the behaviors and characteristics of Endermen within the server. Participants shared their findings, hypotheses, and observations about Enderman mechanics and interactions.', 78),
(341, 'Minecraft Server Achievements Awards', 'b', TIMESTAMP('2022-03-29', '14:12:20'), TIMESTAMP('2024-03-23', '14:12:20'), TIMESTAMP('2023-10-03', '14:12:20'), 'The Minecraft Server Achievements Awards recognized players who achieved significant milestones and accomplishments within the server. The event showcased achievements, accolades, and player stories, highlighting the servers culture of setting and reaching goals.', 49),
(343, 'Environmental Landscaping Project', 'b', TIMESTAMP('2021-10-18', '14:12:20'), TIMESTAMP('2022-12-13', '14:12:20'), TIMESTAMP('2023-01-29', '14:12:20'), 'The Environmental Landscaping Project highlighted the servers commitment to environmental aesthetics and sustainability. Participants transformed landscapes, restored natural beauty, and discussed the principles of balanced landscaping, including terraforming, reforestation, and beautification.', 47),
(344, 'Community Server Revival', 'b', TIMESTAMP('2021-07-28', '14:12:20'), TIMESTAMP('2022-12-09', '14:12:20'), TIMESTAMP('2023-08-17', '14:12:20'), 'The Community Server Revival event commemorated the servers resilience and the efforts to revive and restore the community following challenges or setbacks. Participants shared their experiences, stories of collaboration, and the determination to rebuild and strengthen the servers community spirit.', 90),
(345, 'Minecraft Server Marketplace', 'b', TIMESTAMP('2022-08-04', '14:12:20'), TIMESTAMP('2025-04-22', '14:12:20'), TIMESTAMP('2022-05-22', '14:12:20'), 'The Minecraft Server Marketplace showcased the servers thriving in-game economy, featuring a range of shops, marketplaces, and trading centers. Participants explored the dynamics of player-driven economies, entrepreneurship, and the exchange of resources, items, and services.', 22),
(347, 'Village Harmony Festival', 'b', TIMESTAMP('2021-04-16', '14:12:20'), TIMESTAMP('2021-07-23', '14:12:20'), TIMESTAMP('2022-07-27', '14:12:20'), 'The Village Harmony Festival was a celebration of the servers diverse village communities. Participants shared stories of village life, unique traditions, and the social dynamics that defined each village. The event explored the importance of cooperation, diplomacy, and shared values within these communities.', 89),
(348, 'Server-Wide Renewable Resource Drive', 'b', TIMESTAMP('2022-03-10', '14:12:20'), TIMESTAMP('2024-02-28', '14:12:20'), TIMESTAMP('2023-04-11', '14:12:20'), 'The Server-Wide Renewable Resource Drive encouraged players to support renewable resource initiatives. Participants discussed sustainable resource management, responsible farming practices, and the servers approach to minimizing resource depletion.', 15),
(349, 'Nether Fortress Siege Reenactment', 'b', TIMESTAMP('2023-02-23', '14:12:20'), TIMESTAMP('2024-03-03', '14:12:20'), TIMESTAMP('2023-02-11', '14:12:20'), 'The Nether Fortress Siege Reenactment allowed players to recreate historic Nether fortress battles from the servers lore. Participants assumed roles within the reenactment, reliving memorable events and discussing the strategies, tactics, and outcomes of these epic battles.', 52),
(351, 'Mysteries of the Server Lore Discussion', 'b', TIMESTAMP('2022-01-12', '14:12:20'), TIMESTAMP('2022-12-23', '14:12:20'), TIMESTAMP('2022-05-13', '14:12:20'), 'The Mysteries of the Server Lore Discussion event delved into the servers most enigmatic and unsolved mysteries. Participants shared', 13),
(352, 'The Magical Maze Challenge', 'b', TIMESTAMP('2022-08-28', '14:12:20'), TIMESTAMP('2025-01-17', '14:12:20'), TIMESTAMP('2021-10-17', '14:12:20'), 'The Magical Maze Challenge was a mind-bending event where players navigated through a labyrinthine maze filled with enchanting traps and illusions. Participants had to rely on wit and memory to find their way to the mazes heart, where a grand treasure awaited the victor.', 33),
(353, 'The Underwater City Building Contest', 'b', TIMESTAMP('2022-05-21', '14:12:20'), TIMESTAMP('2024-05-31', '14:12:20'), TIMESTAMP('2021-05-12', '14:12:20'), 'The Underwater City Building Contest saw players constructing intricate underwater cities, showcasing their architectural prowess and creativity. Participants overcame the challenges of underwater building, designing stunning aquatic metropolises with innovative structures and transport systems.', 6),
(354, 'The Ender Pearl Golf Tournament', 'b', TIMESTAMP('2022-09-11', '14:12:20'), TIMESTAMP('2024-12-29', '14:12:20'), TIMESTAMP('2023-09-08', '14:12:20'), 'The Ender Pearl Golf Tournament was a unique take on golf, with players aiming to get their ender pearls into specific holes using the fewest throws possible. The event tested both precision and strategy, as participants navigated courses filled with hazards and obstacles.', 27),
(355, 'The Biome Olympics', 'b', TIMESTAMP('2023-01-22', '14:12:20'), TIMESTAMP('2024-11-10', '14:12:20'), TIMESTAMP('2021-05-15', '14:12:20'), 'The Biome Olympics was a sporting spectacle where players represented different biomes in a series of competitive events. From sprinting across deserts to archery in forests, the games celebrated the servers diverse landscapes and athleticism.', 4),
(356, 'The Pirate Plunder Adventure', 'b', TIMESTAMP('2022-06-06', '14:12:20'), TIMESTAMP('2024-11-06', '14:12:20'), TIMESTAMP('2021-02-14', '14:12:20'), 'The Pirate Plunder Adventure was a daring voyage where players assumed the roles of pirates and embarked on a treasure hunt. The journey took them to hidden islands, deep caves, and treacherous waters, all while evading rival pirate crews. The event celebrated exploration and swashbuckling action.', 54),
(358, 'The Ruins of Eldoria Quest', 'b', TIMESTAMP('2023-06-18', '14:12:20'), TIMESTAMP('2024-09-06', '14:12:20'), TIMESTAMP('2021-05-29', '14:12:20'), 'The Ruins of Eldoria Quest was a narrative-driven adventure where players delved into the lore of a lost civilization. Participants solved puzzles, explored ancient ruins, and pieced together the story of Eldoria, culminating in a grand revelation.', 72),
(359, 'The Super Smelter Showdown', 'b', TIMESTAMP('2022-02-16', '14:12:20'), TIMESTAMP('2023-01-24', '14:12:20'), TIMESTAMP('2023-07-08', '14:12:20'), 'The Super Smelter Showdown was a crafting competition where participants built the most efficient and massive smelting systems possible. Enthusiasts showcased their redstone automation skills and knowledge of fuel management, resulting in astonishingly fast smelting setups.', 27),
(360, 'The Wilderness Survival Challenge', 'b', TIMESTAMP('2021-03-20', '14:12:20'), TIMESTAMP('2022-01-20', '14:12:20'), TIMESTAMP('2022-12-03', '14:12:20'), 'The Wilderness Survival Challenge was a test of survival skills as players were dropped into the servers untamed wilderness with minimal supplies. They had to forage, hunt, and build shelters to withstand the elements and threats of the wild.', 86),
(361, 'The Mythic Beasts Parade', 'b', TIMESTAMP('2023-03-11', '14:12:20'), TIMESTAMP('2025-09-14', '14:12:20'), TIMESTAMP('2021-10-09', '14:12:20'), 'The Mythic Beasts Parade was a colorful event where players transformed into mythical creatures and paraded through the servers towns and cities. This light-hearted event showcased imaginative costume designs and creativity.', 68),
(365, 'The Ancient Ruins Preservation Quest', 'b', TIMESTAMP('2021-04-16', '14:12:20'), TIMESTAMP('2023-07-27', '14:12:20'), TIMESTAMP('2021-06-24', '14:12:20'), 'The Ancient Ruins Preservation Quest tasked players with exploring server-generated ruins and preserving them for posterity. Participants excavated, restored, and documented these historical sites, unearthing hidden stories and secrets.', 61),
(368, 'The Enchanted Forest Survival Expedition', 'b', TIMESTAMP('2021-06-12', '14:12:20'), TIMESTAMP('2021-11-17', '14:12:20'), TIMESTAMP('2023-01-02', '14:12:20'), 'The Enchanted Forest Survival Expedition sent players on a challenging journey into an enchanted forest filled with magical creatures, riddles, and puzzles. They had to rely on wits and cooperation to overcome the forests trials and mysteries.', 21),
(371, 'The Skyblock Community Carnival', 'b', TIMESTAMP('2021-07-25', '14:12:20'), TIMESTAMP('2021-09-21', '14:12:20'), TIMESTAMP('2022-04-25', '14:12:20'), 'The Skyblock Community Carnival was a festive gathering where players from the servers skyblock community showcased their island designs, hosted minigames, and competed in challenges. It celebrated the vibrant creativity of the skyblock players.', 30),
(372, 'The Elemental Tower Climb', 'b', TIMESTAMP('2021-03-29', '14:12:20'), TIMESTAMP('2023-05-23', '14:12:20'), TIMESTAMP('2021-03-05', '14:12:20'), 'The Elemental Tower Climb was an event where players ascended towering elemental-themed structures, each filled with unique puzzles and traps related to their respective element. Climbers had to conquer earth, water, fire, and air towers to claim their rewards.', 92),
(373, 'The Ender Crystal Capture', 'b', TIMESTAMP('2023-09-11', '14:12:20'), TIMESTAMP('2025-02-07', '14:12:20'), TIMESTAMP('2022-05-17', '14:12:20'), 'The Ender Crystal Capture was a high-stakes competition where players aimed to capture and control Ender Crystals in a custom-built arena. Teams fought fiercely to gain dominance over the crystals and accumulate points in a strategic battle.', 60),
(374, 'The Deep Sea Diving Expedition', 'b', TIMESTAMP('2021-08-23', '14:12:20'), TIMESTAMP('2023-02-02', '14:12:20'), TIMESTAMP('2022-06-14', '14:12:20'), 'The Deep Sea Diving Expedition challenged players to explore the depths of the servers oceans, venturing into underwater caves and ravines. The event celebrated aquatic exploration and the beauty of Minecrafts underwater biomes.', 32),
(376, 'The Server-Wide Maze Run', 'b', TIMESTAMP('2021-04-10', '14:12:20'), TIMESTAMP('2021-12-18', '14:12:20'), TIMESTAMP('2022-03-06', '14:12:20'), 'The Server-Wide Maze Run was a massive maze competition where players raced to complete intricate mazes filled with twists, turns, and surprises. It tested their navigation, memory, and problem-solving skills in a grand maze extravaganza.', 54),
(377, 'The Giant Treehouse Build-Off', 'b', TIMESTAMP('2021-06-09', '14:12:20'), TIMESTAMP('2022-11-03', '14:12:20'), TIMESTAMP('2023-06-21', '14:12:20'), 'The Giant Treehouse Build-Off featured players constructing colossal treehouses in the heart of towering forests. The event showcased inventive treehouse designs and impressive feats of engineering among the treetops.', 54),
(383, 'Minecraft Artisans Odyssey', 'b', TIMESTAMP('2022-08-18', '14:12:20'), TIMESTAMP('2024-07-08', '14:12:20'), TIMESTAMP('2023-01-18', '14:12:20'), 'An event that celebrated the servers artisans and crafters, who embarked on an artistic journey to create captivating works of art, sculptures, and architectural marvels. The Artisans Odyssey showcased the servers artistic prowess and encouraged creative expression.', 91),
(385, 'Luminous Nexus of the Skies', 'b', TIMESTAMP('2023-05-10', '14:12:20'), TIMESTAMP('2025-06-30', '14:12:20'), TIMESTAMP('2023-04-29', '14:12:20'), 'The unveiling of the Luminous Nexus, a celestial gateway that connected different dimensions and realms in the servers multiverse. Players traversed the Nexus, unlocking cross-dimensional quests, and unraveling its role in the servers interconnected cosmos.', 85),
(386, 'Era of Myths and Legends II', 'b', TIMESTAMP('2021-12-15', '14:12:20'), TIMESTAMP('2024-02-14', '14:12:20'), TIMESTAMP('2023-05-14', '14:12:20'), 'A continuation of the era of myths and legends, with new mythical beings, divine entities, and ancient sagas influencing the servers lore and narratives. Players continued to shape the servers cultural and mystical landscape.', 91),
(387, 'Minecraft Renaissance Faire II', 'b', TIMESTAMP('2022-03-29', '14:12:20'), TIMESTAMP('2023-08-24', '14:12:20'), TIMESTAMP('2022-01-20', '14:12:20'), 'A sequel to the Renaissance Faire, with even more historical reenactment, jousting tournaments, costumed parades, and theatrical performances. The Renaissance Faire II provided an immersive experience of a bygone era, fostering cultural appreciation.', 63),
(388, 'Realm of Timeless Echoes', 'b', TIMESTAMP('2021-09-13', '14:12:20'), TIMESTAMP('2022-06-27', '14:12:20'), TIMESTAMP('2021-05-05', '14:12:20'), 'The unveiling of the Realm of Timeless Echoes, a dimension where echoes of the past, present, and future coexisted. Players journeyed through this time-bending realm, experiencing time-travel quests, alternate realities, and temporal conundrums.', 20),
(391, 'Phantom Opera Masquerade II', 'b', TIMESTAMP('2023-02-28', '14:12:20'), TIMESTAMP('2024-04-04', '14:12:20'), TIMESTAMP('2021-12-23', '14:12:20'), 'A sequel to the Phantom Opera Masquerade, offering an enchanting masquerade ball hosted by enigmatic phantoms within the server. Players donned elegant masks, danced in phantom-hosted ballrooms, and engaged in ethereal quests.', 52),
(394, 'Lost Chronicles Expedition II', 'b', TIMESTAMP('2023-01-11', '14:12:20'), TIMESTAMP('2023-04-09', '14:12:20'), TIMESTAMP('2023-05-10', '14:12:20'), 'A continuation of the ambitious expedition dedicated to uncovering forgotten chapters in the servers history. Players ventured into hidden archives, deciphered cryptic texts, and pieced together lost lore, further enriching the servers narrative.', 86),
(395, 'Lunar Eclipse Battle Royale II', 'b', TIMESTAMP('2022-03-22', '14:12:20'), TIMESTAMP('2024-05-03', '14:12:20'), TIMESTAMP('2021-12-27', '14:12:20'), 'A thrilling sequel to the lunar eclipse battle royale, with new celestial challenges and lunar-themed battles under the eerie eclipse. Players combined celestial magic and strategy to secure victory and claim celestial rewards.', 16),
(396, 'Era of Eternal Songs II', 'b', TIMESTAMP('2021-07-08', '14:12:20'), TIMESTAMP('2022-09-14', '14:12:20'), TIMESTAMP('2022-12-14', '14:12:20'), 'A continuation of the era dedicated to ancient songs and musical legends that shaped the servers cultural and narrative landscape. Players engaged with musical beings, explored musical quests, and celebrated the power of music in the servers history.', 18),
(397, 'Astral Sandscape Odyssey II', 'b', TIMESTAMP('2023-10-11', '14:12:20'), TIMESTAMP('2025-03-28', '14:12:20'), TIMESTAMP('2021-10-25', '14:12:20'), 'A cosmic journey into the Astral Sandscape, a dimension filled with celestial deserts, astral oases, and otherworldly phenomena. Players ventured into this unique dimension, navigating through astral challenges and unraveling cosmic mysteries.', 66),
(398, 'Minecraft Carnival of Marvels II', 'b', TIMESTAMP('2021-03-15', '14:12:20'), TIMESTAMP('2022-01-10', '14:12:20'), TIMESTAMP('2022-03-06', '14:12:20'), 'A sequel to the grand carnival, featuring an expanded array of minigames, circus performances, and astonishing attractions. The Carnival of Marvels II brought a playful and festive atmosphere to the server, offering players new games, competitions, and prizes.', 87),
(399, 'Grand Elemental Symposium II', 'b', TIMESTAMP('2022-07-30', '14:12:20'), TIMESTAMP('2023-04-12', '14:12:20'), TIMESTAMP('2023-05-07', '14:12:20'), 'A follow-up to the grand gathering of elemental scholars and experts, who shared their knowledge of the servers elemental lore and magic. Players participated in discussions, engaged in elemental research, and celebrated the servers rich elemental heritage.', 6),
(404, 'Elemental Forges of Power II', 'b', TIMESTAMP('2022-01-11', '14:12:20'), TIMESTAMP('2022-08-22', '14:12:20'), TIMESTAMP('2022-05-02', '14:12:20'), 'A continuation of the introduction of Elemental Forges that allowed players to forge elemental weapons and equipment. Players harnessed the power of fire, water, earth, and air to craft powerful gear with unique elemental abilities, encouraging strategic customization and specialization.', 75),
(406, 'Era of Nether Reclamation II', 'b', TIMESTAMP('2022-09-25', '14:12:20'), TIMESTAMP('2025-03-01', '14:12:20'), TIMESTAMP('2023-09-08', '14:12:20'), 'A continuation of the transformation of the Nether, with players working together to cleanse the fiery realm, restore its balance, and unlock its hidden secrets. The Nether Reclamation continued to breathe new life into the dimension, making it a realm of discovery and adventure.', 7),
(409, 'Era of Elemental Genesis II', 'b', TIMESTAMP('2022-03-22', '14:12:20'), TIMESTAMP('2024-08-20', '14:12:20'), TIMESTAMP('2023-10-12', '14:12:20'), 'A continuation of the period that delved into the creation myths of elemental magic and the birth of elemental deities. Players continued to participate in elemental creation quests, learn the origins of elemental magic, and explore the primordial forces that shaped the servers universe.', 3),
(415, 'Minecraft Server Diversity Fair', 'b', TIMESTAMP('2023-06-03', '14:12:20'), TIMESTAMP('2023-12-04', '14:12:20'), TIMESTAMP('2021-04-04', '14:12:20'), 'The Minecraft Server Diversity Fair celebrated the servers inclusive and diverse community. Participants shared their experiences and perspectives, fostering understanding and tolerance while discussing the importance of diversity within the server.', 10),
(417, 'Biome Challenge Week', 'b', TIMESTAMP('2023-06-07', '14:12:20'), TIMESTAMP('2024-07-12', '14:12:20'), TIMESTAMP('2023-10-05', '14:12:20'), 'Biome Challenge Week was a week-long event where players embraced and thrived in specific biomes, each day focusing on a different biome. Participants discussed biome-specific survival techniques, resource collection, and building styles, emphasizing adaptability.', 88),
(420, 'Minecraft Server Literary Symposium', 'b', TIMESTAMP('2022-05-04', '14:12:20'), TIMESTAMP('2024-08-19', '14:12:20'), TIMESTAMP('2022-04-17', '14:12:20'), 'The Minecraft Server Literary Symposium celebrated the servers writers and authors, showcasing their in-game literary works and discussing the process of creating stories, lore, and narratives within Minecraft.', 17),
(421, 'Aerial Archery Tournament', 'b', TIMESTAMP('2023-09-06', '14:12:20'), TIMESTAMP('2024-10-06', '14:12:20'), TIMESTAMP('2023-06-17', '14:12:20'), 'The Aerial Archery Tournament was a high-flying archery competition where players tested their marksmanship skills while gliding with Elytra wings. Participants discussed their tactics, bow mechanics, and the art of precision archery in the sky.', 23),
(425, 'Minecraft History Trivia Night', 'b', TIMESTAMP('2021-11-10', '14:12:20'), TIMESTAMP('2022-06-12', '14:12:20'), TIMESTAMP('2021-07-03', '14:12:20'), 'The Minecraft History Trivia Night tested players knowledge of the servers history, lore, and significant milestones. Participants engaged in a lively trivia competition, sharing insights and celebrating their understanding of the servers past.', 58),
(426, 'The Art of Minigame Design', 'b', TIMESTAMP('2023-06-10', '14:12:20'), TIMESTAMP('2023-12-22', '14:12:20'), TIMESTAMP('2022-03-02', '14:12:20'), 'The Art of Minigame Design event celebrated the servers minigame creators and designers. Participants discussed their creative process, design philosophies, and the complexities of developing fun and engaging in-game challenges.', 48),
(427, 'Server-Wide Sculpture Collaborative', 'b', TIMESTAMP('2022-08-31', '14:12:20'), TIMESTAMP('2025-05-15', '14:12:20'), TIMESTAMP('2021-06-05', '14:12:20'), 'The Server-Wide Sculpture Collaborative brought together players from diverse backgrounds to collaborate on an expansive sculpture project. Participants discussed their roles in the collaborative effort, construction techniques, and the significance of working as a team on large-scale projects.', 4),
(428, 'Minecraft Environmental Responsibility Campaign', 'b', TIMESTAMP('2021-03-11', '14:12:20'), TIMESTAMP('2022-07-24', '14:12:20'), TIMESTAMP('2021-10-27', '14:12:20'), 'The Minecraft Environmental Responsibility Campaign focused on sustainability and responsible resource management within the server. Participants discussed eco-friendly practices, the servers environmental initiatives, and ways to minimize the impact of in-game activities on the virtual world.', 34),
(429, 'Jungle Temple Architectural Symposium', 'b', TIMESTAMP('2022-02-17', '14:12:20'), TIMESTAMP('2023-02-11', '14:12:20'), TIMESTAMP('2023-08-30', '14:12:20'), 'The Jungle Temple Architectural Symposium celebrated the unique architectural styles and designs of jungle temples within the server. Participants explored jungle aesthetics, architectural principles, and the cultural significance of these structures.', 63),
