(435, 'Architectural Showcase: Server Capitals', 'b', TIMESTAMP('2022-06-26', '14:12:20'), TIMESTAMP('2023-01-26', '14:12:20'), TIMESTAMP('2023-04-10', '14:12:20'), 'The Architectural Showcase: Server Capitals event highlighted the grand capitals of the server, showcasing the architectural beauty and planning that defined these bustling hubs. Participants explored the history, culture, and architectural landmarks of each capital.', 84),
(436, 'Nether Bridge Infrastructure Spotlight', 'b', TIMESTAMP('2021-06-06', '14:12:20'), TIMESTAMP('2022-07-21', '14:12:20'), TIMESTAMP('2023-04-20', '14:12:20'), 'The Nether Bridge Infrastructure Spotlight showcased the intricate Nether bridges that connected distant regions within the server. Participants discussed bridge design, transportation challenges, and the importance of efficient Nether infrastructure.', 62),
