(439, 'Server-Wide Festival of Friendship', 'b', TIMESTAMP('2021-05-11', '14:12:20'), TIMESTAMP('2022-10-02', '14:12:20'), TIMESTAMP('2021-04-28', '14:12:20'), 'The Server-Wide Festival of Friendship was a joyous celebration of the bonds formed within the servers community. Participants shared stories of friendship, cooperation, and camaraderie, emphasizing the significance of relationships and connections.', 38),
