(443, 'The Elemental Archers Tournament', 'b', TIMESTAMP('2023-08-01', '14:12:20'), TIMESTAMP('2023-10-01', '14:12:20'), TIMESTAMP('2022-06-11', '14:12:20'), 'The Elemental Archers Tournament was an archery competition where participants used specially enchanted bows and arrows representing the four elements (earth, water, fire, and air). Archers showcased their precision and mastery over elemental powers in a series of challenging contests.', 45),
(445, 'The Skydiving Spectacular', 'b', TIMESTAMP('2021-06-13', '14:12:20'), TIMESTAMP('2023-11-18', '14:12:20'), TIMESTAMP('2023-10-14', '14:12:20'), 'The Skydiving Spectacular was a breathtaking event that celebrated players love for freefalling. Participants donned elytra wings and soared from dizzying heights, performing acrobatics and landing with pinpoint precision to earn style points.', 53),
(452, 'The Realm of Illusions', 'b', TIMESTAMP('2023-06-18', '14:12:20'), TIMESTAMP('2024-03-29', '14:12:20'), TIMESTAMP('2023-03-22', '14:12:20'), 'The Realm of Illusions was a mind-bending adventure that transported players to an otherworldly dimension filled with optical illusions, paradoxes, and bizarre challenges. Participants unraveled the surreal mysteries of this alternate realm.', 67),
