(465, 'The Astral Observatory', 'b', TIMESTAMP('2021-11-16', '14:12:20'), TIMESTAMP('2023-01-19', '14:12:20'), TIMESTAMP('2023-01-12', '14:12:20'), 'The Astral Observatory was a celestial event where players explored the mysteries of the night sky. Astronomers and stargazers gathered to share their knowledge of in-game constellations and celestial phenomena.', 27),
