(695, 'Personal Brewery Tour: Crafting Stories', 'b', TIMESTAMP('2022-07-19', '14:12:20'), TIMESTAMP('2025-01-29', '14:12:20'), TIMESTAMP('2021-12-23', '14:12:20'), 'Personal Brewery Tour allowed players to showcase their personal in-game breweries and share their crafting stories, from brewing techniques to favorite potions and elixirs.', 17),
(696, 'Minecraft Server Trading Card Exchange: Personal Collections', 'b', TIMESTAMP('2021-05-21', '14:12:20'), TIMESTAMP('2022-06-27', '14:12:20'), TIMESTAMP('2023-06-06', '14:12:20'), 'The Minecraft Server Trading Card Exchange featured personal collections of in-game trading cards. Participants discussed their personal card collections, the history behind each card, and the enjoyment of trading.', 56),
(697, 'Personal Village Craftsmanship: Community Stories', 'b', TIMESTAMP('2023-08-23', '14:12:20'), TIMESTAMP('2025-09-12', '14:12:20'), TIMESTAMP('2021-08-22', '14:12:20'), 'Personal Village Craftsmanship celebrated players in-game villages and personal craftsmanship. Participants discussed the sense of community, the cooperation involved, and the personal stories behind their village creations.', 91),
(698, 'Player-Hosted Fireworks Show: Personal Pyrotechnics', 'b', TIMESTAMP('2021-08-16', '14:12:20'), TIMESTAMP('2023-10-24', '14:12:20'), TIMESTAMP('2023-03-30', '14:12:20'), 'In the Player-Hosted Fireworks Show, players hosted their own personal fireworks displays and shared stories of personal pyrotechnic creativity, from the choice of colors to choreographed displays.', 11),
(700, 'Personal Jungle Adventures: Wild Encounters', 'b', TIMESTAMP('2021-12-16', '14:12:20'), TIMESTAMP('2022-05-17', '14:12:20'), TIMESTAMP('2022-10-05', '14:12:20'), 'Personal Jungle Adventures invited players to share their personal stories of exploration within the servers jungle biomes. Participants discussed the wild encounters, the beauty of the jungle, and the thrill of venturing into untamed landscapes.', 7),
(701, 'Minecraft Server Petting Zoo: Personal Pets', 'b', TIMESTAMP('2022-05-09', '14:12:20'), TIMESTAMP('2023-03-09', '14:12:20'), TIMESTAMP('2023-02-15', '14:12:20'), 'The Minecraft Server Petting Zoo featured players personal in-game pets. Participants discussed their personal pet stories, the bond with their virtual animals, and the joy of having companions.', 32),
(702, 'Player-Hosted Fishing Derby: Personal Catches', 'b', TIMESTAMP('2021-12-08', '14:12:20'), TIMESTAMP('2022-09-13', '14:12:20'), TIMESTAMP('2021-05-16', '14:12:20'), 'In the Player-Hosted Fishing Derby, players hosted their personal fishing competitions, sharing stories of personal catches, favorite fishing spots, and the satisfaction of landing big catches.', 83),
(703, 'Personal Desert Oasis Retreat: Sand and Serenity', 'b', TIMESTAMP('2021-11-04', '14:12:20'), TIMESTAMP('2023-02-24', '14:12:20'), TIMESTAMP('2022-11-27', '14:12:20'), 'Personal Desert Oasis Retreat allowed players to discuss their personal in-game desert oases, sharing stories of serenity, the allure of desert landscapes, and the personal escapes they had created.', 24),
(705, 'Personal Oceanic Explorations: Nautical Adventures', 'b', TIMESTAMP('2022-07-12', '14:12:20'), TIMESTAMP('2023-05-01', '14:12:20'), TIMESTAMP('2021-03-23', '14:12:20'), 'Personal Oceanic Explorations celebrated players personal nautical adventures within the servers oceans. Participants discussed nautical stories, underwater treasures, and the personal thrill of exploring the depths.', 82),
(706, 'Player-Hosted Snowball Fight: Personal Victories', 'b', TIMESTAMP('2021-12-11', '14:12:20'), TIMESTAMP('2023-07-23', '14:12:20'), TIMESTAMP('2022-05-10', '14:12:20'), 'In the Player-Hosted Snowball Fight, players hosted personal snowball fights, sharing stories of personal victories, snowball strategies, and the fun of winter battles.', 77),
(709, 'Minecraft Coffee House: Personal Conversations', 'b', TIMESTAMP('2021-12-09', '14:12:20'), TIMESTAMP('2023-11-09', '14:12:20'), TIMESTAMP('2023-07-07', '14:12:20'), 'The Minecraft Coffee House provided a personal space for players to engage in relaxed conversations over a virtual cup of coffee. Participants discussed personal interests, shared stories, and formed connections in a cozy setting.', 89),
(710, 'Player-Hosted Art Auction: Personal Collections', 'b', TIMESTAMP('2023-04-30', '14:12:20'), TIMESTAMP('2025-02-21', '14:12:20'), TIMESTAMP('2022-05-25', '14:12:20'), 'In the Player-Hosted Art Auction, players auctioned their personal in-game art collections and discussed the personal connections they had to each piece. Participants shared their artistic journeys and the stories behind their favorite art.', 29),
(711, 'Personal Astronomy Nights: Starry Serenity', 'b', TIMESTAMP('2023-08-12', '14:12:20'), TIMESTAMP('2024-06-20', '14:12:20'), TIMESTAMP('2021-10-03', '14:12:20'), 'Personal Astronomy Nights allowed players to share their personal experiences stargazing within the server. Participants discussed the starry skies, their favorite constellations, and the personal serenity of watching the night sky.', 6),
(718, 'The Mystical Lighthouse Tour', 'b', TIMESTAMP('2022-11-18', '14:12:20'), TIMESTAMP('2023-03-08', '14:12:20'), TIMESTAMP('2022-09-26', '14:12:20'), 'The Mystical Lighthouse Tour was an enchanting tour of the servers lighthouses, highlighting their unique designs and enchanting features. It celebrated the art of lighthouse construction and navigation.', 39),
(721, 'The Biome Biodiversity Symposium', 'b', TIMESTAMP('2023-07-01', '14:12:20'), TIMESTAMP('2025-02-15', '14:12:20'), TIMESTAMP('2021-11-30', '14:12:20'), 'The Biome Biodiversity Symposium was a scholarly gathering where players discussed the diverse flora and fauna of server biomes, sharing knowledge and insights about Minecrafts wildlife.', 15),
(724, 'The Underworld Lava Relay', 'b', TIMESTAMP('2022-07-25', '14:12:20'), TIMESTAMP('2023-01-25', '14:12:20'), TIMESTAMP('2022-10-26', '14:12:20'), 'The Underworld Lava Relay was a thrilling relay race set in a custom-designed underground lava biome. Teams navigated challenging lava-based obstacles and dangers while passing the baton in a test of skill and teamwork.', 13),
(725, 'The Elemental Elemental Language Fair', 'b', TIMESTAMP('2021-05-25', '14:12:20'), TIMESTAMP('2023-07-27', '14:12:20'), TIMESTAMP('2022-09-24', '14:12:20'), 'The Elemental Elemental Language Fair was a cultural event where players shared phrases, scripts, and languages inspired by the four elements. It celebrated linguistic diversity and communication.', 49),
(726, 'The Elemental Recipe Cook-Off', 'b', TIMESTAMP('2021-07-23', '14:12:20'), TIMESTAMP('2021-09-16', '14:12:20'), TIMESTAMP('2021-06-10', '14:12:20'), 'The Elemental Recipe Cook-Off was a culinary competition where players prepared dishes using ingredients specific to the servers diverse biomes. It was a delicious celebration of server gastronomy.', 69),
(727, 'The Mystical Artifacts Auction', 'b', TIMESTAMP('2023-08-29', '14:12:20'), TIMESTAMP('2023-09-15', '14:12:20'), TIMESTAMP('2023-10-20', '14:12:20'), 'The Mystical Artifacts Auction was an auction of rare and magical artifacts collected throughout the servers history. Players bid on unique and valuable items tied to server legends and lore.', 87),
(732, 'The Elemental Fashion Fusion Show', 'b', TIMESTAMP('2022-08-23', '14:12:20'), TIMESTAMP('2023-12-09', '14:12:20'), TIMESTAMP('2022-11-25', '14:12:20'), 'The Elemental Fashion Fusion Show was a fashion event where players combined elements from different biomes to create unique and stylish outfits. It celebrated fashion and creativity.', 36),
(733, 'The Grand Elemental Collage', 'b', TIMESTAMP('2023-03-07', '14:12:20'), TIMESTAMP('2024-08-17', '14:12:20'), TIMESTAMP('2021-03-04', '14:12:20'), 'The Grand Elemental Collage was a community art project where players contributed to a colossal collage representing server biomes, cultures, and events. It celebrated collective art and collaboration.', 54),
(735, 'The Elemental Sailing Regatta', 'b', TIMESTAMP('2023-08-18', '14:12:20'), TIMESTAMP('2023-09-22', '14:12:20'), TIMESTAMP('2023-02-25', '14:12:20'), 'The Elemental Sailing Regatta was a sailing competition where players raced in boats themed after the four elements. Participants navigated through a series of challenging aquatic courses.', 60),
(736, 'The Enchanted Pumpkin Carving Festival', 'b', TIMESTAMP('2023-10-30', '14:12:20'), TIMESTAMP('2025-05-09', '14:12:20'), TIMESTAMP('2021-09-16', '14:12:20'), 'The Enchanted Pumpkin Carving Festival was a festive event where players displayed their pumpkin carving skills by creating intricate and enchanting designs, celebrating the art of carving.', 72),
(739, 'The Biome-Specific Documentary Showcase', 'b', TIMESTAMP('2021-11-17', '14:12:20'), TIMESTAMP('2022-09-13', '14:12:20'), TIMESTAMP('2023-03-17', '14:12:20'), 'The Biome-Specific Documentary Showcase was a showcase of player-created documentaries that explored and highlighted the servers diverse biomes, ecosystems, and cultural elements.', 77),
(742, 'The Mystical Music Box Gala', 'b', TIMESTAMP('2021-09-29', '14:12:20'), TIMESTAMP('2023-07-19', '14:12:20'), TIMESTAMP('2022-06-13', '14:12:20'), 'The Mystical Music Box Gala was a musical event where players showcased custom-made music boxes inspired by server lore and music. It celebrated the servers musical creativity and storytelling through music.', 67),
(743, 'The Elemental Terraforming Symposium', 'b', TIMESTAMP('2021-02-20', '14:12:20'), TIMESTAMP('2022-09-09', '14:12:20'), TIMESTAMP('2021-11-21', '14:12:20'), 'The Elemental Terraforming Symposium was an educational gathering where players discussed and shared techniques for terraforming server landscapes. It celebrated the art of terraforming and the servers customized environments.', 2),
(744, 'The Elemental Creature Masquerade', 'b', TIMESTAMP('2022-09-14', '14:12:20'), TIMESTAMP('2023-07-08', '14:12:20'), TIMESTAMP('2022-03-12', '14:12:20'), 'The Elemental Creature Masquerade was a costume event where players dressed up as their favorite in-game creatures, celebrating Minecrafts wildlife and mythical beings.', 48),
(745, 'The Grand Elemental Art Showcase', 'b', TIMESTAMP('2022-01-10', '14:12:20'), TIMESTAMP('2022-11-19', '14:12:20'), TIMESTAMP('2022-01-19', '14:12:20'), 'The Grand Elemental Art Showcase was an art exhibition where players displayed paintings, sculptures, and digital art inspired by the four elements (earth, water, fire, air). It celebrated artistic expression and elemental themes.', 76),
(749, 'Personal Desert Oasis Stories: Oasis Serenity', 'b', TIMESTAMP('2021-10-19', '14:12:20'), TIMESTAMP('2023-10-14', '14:12:20'), TIMESTAMP('2023-05-07', '14:12:20'), 'Personal Desert Oasis Stories were players personal reflections on their in-game desert oases, where they discussed the serenity they found, the moments of tranquility, and the personal stories of these special landscapes.', 68),
(751, 'Player-Hosted Snow Fort Building: Personal Architectural Feats', 'b', TIMESTAMP('2021-10-09', '14:12:20'), TIMESTAMP('2021-11-05', '14:12:20'), TIMESTAMP('2023-06-02', '14:12:20'), 'In the Player-Hosted Snow Fort Building event, players showcased their personal architectural feats, sharing stories of snow fort design, personal tactics, and the thrill of building winter strongholds.', 27),
(752, 'Personal Underwater Expeditions: Subaquatic Adventures', 'b', TIMESTAMP('2022-04-18', '14:12:20'), TIMESTAMP('2024-01-11', '14:12:20'), TIMESTAMP('2021-05-18', '14:12:20'), 'Personal Underwater Expeditions celebrated players personal underwater adventures within the servers oceans. Participants discussed subaquatic stories, discoveries of hidden treasures, and the personal thrill of exploring the deep.', 4),
(755, 'Player-Hosted Costume Contest: Personal Creations', 'b', TIMESTAMP('2022-02-09', '14:12:20'), TIMESTAMP('2024-07-18', '14:12:20'), TIMESTAMP('2022-04-27', '14:12:20'), 'In the Player-Hosted Costume Contest, players showcased their personal in-game costumes and shared stories of costume creation, inspirations, and the personal touch they had added to their designs.', 6),
(756, 'Personal Mountain Retreats: Awe-Inspiring Escapes', 'b', TIMESTAMP('2022-10-04', '14:12:20'), TIMESTAMP('2024-08-28', '14:12:20'), TIMESTAMP('2023-04-07', '14:12:20'), 'Personal Mountain Retreats allowed players to share their personal mountain getaways within the server. Participants discussed awe-inspiring moments, the grandeur of mountain landscapes, and the serenity of their personal mountain escapes.', 55),
(761, 'Personal Treehouse Retreats: Treetop Serenity', 'b', TIMESTAMP('2021-05-12', '14:12:20'), TIMESTAMP('2021-07-05', '14:12:20'), TIMESTAMP('2022-05-25', '14:12:20'), 'Personal Treehouse Retreats allowed players to share their personal in-game treehouse retreats, discussing the serenity of treetop living, the personal bonds formed with trees, and the stories behind their arboreal escapes.', 31),
(762, 'Player-Hosted Archery Challenge: Personal Bulls-Eyes', 'b', TIMESTAMP('2021-10-05', '14:12:20'), TIMESTAMP('2022-10-26', '14:12:20'), TIMESTAMP('2023-03-16', '14:12:20'), 'In the Player-Hosted Archery Challenge, players hosted their personal archery competitions and shared stories of personal bulls-eyes, archery skills, and the satisfaction of hitting the mark.', 7),
(763, 'Personal Canyon Expeditions: Ravine Adventures', 'b', TIMESTAMP('2023-06-10', '14:12:20'), TIMESTAMP('2023-11-01', '14:12:20'), TIMESTAMP('2021-07-06', '14:12:20'), 'Personal Canyon Expeditions celebrated players personal experiences exploring in-game canyons and ravines, discussing the rugged beauty of these landscapes, challenging traversals, and the thrill of the unknown.', 92),
(764, 'Minecraft Greenhouse Showcase: Personal Horticulture', 'b', TIMESTAMP('2022-02-15', '14:12:20'), TIMESTAMP('2023-05-25', '14:12:20'), TIMESTAMP('2022-06-15', '14:12:20'), 'The Minecraft Greenhouse Showcase allowed players to showcase their personal in-game greenhouses and share stories of personal horticulture, favorite plant species, and the joy of gardening.', 36);
